  `delivery_days` int(0) NULL DEFAULT 0 COMMENT '交割时间',
  `min_margin` decimal(20, 4) NULL DEFAULT 0.0000 COMMENT '最小保证金',
  `loss_rate` decimal(20, 4) NULL DEFAULT 0.0000 COMMENT '止损率',
  `earn_rate` decimal(20, 4) NULL DEFAULT 0.0000 COMMENT '止盈率',
  `float_profit` decimal(20, 6) NULL DEFAULT 0.000000 COMMENT '浮动盈利点',
  `profit_loss` decimal(20, 6) NULL DEFAULT NULL COMMENT '浮动盈亏',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 15 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

