  `buy_purchase` int(0) NULL DEFAULT 0 COMMENT ' 购买次数',
  `avg_rate` decimal(8, 2) NULL DEFAULT 0.00 COMMENT '日平均利率',
  `coin` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '币种 ',
  `classify` varchar(2) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '0' COMMENT '分类（0 普通  1 vip  2 增值）',
  `basic_invest_amount` decimal(26, 4) NULL DEFAULT 0.0000 COMMENT '平台基础投资金额',
  `total_invest_amount` decimal(26, 4) NULL DEFAULT 0.0000 COMMENT '平台总投资额',
  `level` int(0) NULL DEFAULT 0 COMMENT 'VIP等级 ',
  `process` decimal(8, 2) NULL DEFAULT 0.00 COMMENT '项目进度',
