-- ----------------------------
-- Procedure structure for agentCount
-- ----------------------------
DROP PROCEDURE IF EXISTS `agentCount`;
delimiter ;;
CREATE PROCEDURE `agentCount`(IN d INT)
BEGIN

DECLARE s INT DEFAULT 0;
DECLARE uid INT DEFAULT 0;
DECLARE curr DATE DEFAULT NULL;

DECLARE cu CURSOR FOR SELECT user_id FROM t_app_user WHERE user_id IN (SELECT distinct root_id FROM agent_relation  );
DECLARE CONTINUE HANDLER FOR NOT found SET s=1;

OPEN cu;
	SET curr = DATE_SUB(CURDATE(),INTERVAL d DAY);
	FETCH cu INTO uid;
	WHILE s<>1 DO
		DROP TABLE IF EXISTS a_temp;
		CREATE TABLE a_temp AS SELECT user_id FROM agent_relation WHERE root_id=uid;
		SELECT @subnum:= COUNT(*) FROM a_temp;
		
		IF @subnum>0 THEN
			SELECT @reward:= IFNULL(SUM(amount),0) FROM t_app_wallet_record WHERE user_id =uid AND type=3 AND date_format(create_time,'%y%m%d') = date_format(curr,'%y%m%d');

			SELECT @firstperson:= COUNT(1) FROM t_app_recharge WHERE user_id IN (SELECT user_id FROM a_temp ) AND pay_times=1 AND status=1 AND date_format(update_time,'%y%m%d') = date_format(curr,'%y%m%d');
			SELECT @drwamoney:= IFNULL(SUM(t.amount),0) ,@drawperson:= COUNT(distinct(t.user_id)) FROM t_withdraw t WHERE  t.user_id IN (SELECT user_id FROM a_temp ) AND t.status=1  AND date_format(t.update_time,'%y%m%d') = date_format(curr,'%y%m%d');
			SELECT @sdrawmoney:= IFNULL(SUM(t.amount),0) ,@sdrawperson:= COUNT(distinct(t.user_id)) FROM t_app_wallet_record t WHERE t.user_id IN (SELECT user_id FROM a_temp ) AND t.type=12 AND date_format(t.create_time,'%y%m%d') = date_format(curr,'%y%m%d');
			
			SELECT @paymoney:= IFNULL(SUM(t.amount),0) ,@person:= COUNT(distinct(t.user_id)) FROM t_app_wallet_record t WHERE t.user_id IN (SELECT user_id FROM a_temp ) AND (t.type=1 OR t.type=10) AND date_format(t.create_time,'%y%m%d') = date_format(curr,'%y%m%d');
			SELECT @ordtime:=COUNT(*) ,@ordperson := COUNT(distinct(r.user_id)) FROM t_order_item r WHERE r.user_id IN (SELECT user_id FROM a_temp ) AND date_format(r.create_time,'%y%m%d') = date_format(curr,'%y%m%d');
			SELECT @directsub:= COUNT(*) FROM t_app_user WHERE parent_id =uid;
		END IF;
		FETCH cu INTO uid;
	END WHILE;
CLOSE cu;
DROP TABLE IF EXISTS a_temp;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for agentRelation
-- ----------------------------
DROP PROCEDURE IF EXISTS `agentRelation`;
delimiter ;;
CREATE PROCEDURE `agentRelation`(IN uid BIGINT)
BEGIN

DECLARE rlevel INT DEFAULT 0;
DECLARE rootid TEXT DEFAULT NULL;

SELECT @rtree:=tree FROM t_app_user where user_id=uid;
SET rlevel=1;
    iterator:
    LOOP
        SET rootid =SUBSTRING_INDEX(SUBSTRING_INDEX(@rtree,',',0-rlevel),',',1);
        IF rootid =0 THEN
            LEAVE iterator;
        END IF;
        SET rlevel=rlevel+1;
    END LOOP;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for agentRelationAll
-- ----------------------------
DROP PROCEDURE IF EXISTS `agentRelationAll`;
delimiter ;;
CREATE PROCEDURE `agentRelationAll`()
BEGIN

DECLARE s INT DEFAULT 0;
DECLARE uid INT DEFAULT 0;
DECLARE rlevel INT DEFAULT 0;
DECLARE rootid TEXT DEFAULT NULL;
DECLARE rtree VARCHAR(1024);

DECLARE cu CURSOR FOR SELECT user_id,tree FROM t_app_user;
DECLARE CONTINUE HANDLER FOR NOT found SET s=1;

OPEN cu;
    FETCH cu INTO uid,rtree;
    WHILE s<>1 DO
        SET rlevel=1;
        iterator:
        LOOP
        SET rootid =SUBSTRING_INDEX(SUBSTRING_INDEX(rtree,',',0-rlevel),',',1);
        IF rootid =0 THEN
            LEAVE iterator;
        END IF;
        SET rlevel=rlevel+1;
        END LOOP;
	    FETCH cu INTO uid,rtree;
    END WHILE;
CLOSE cu;
DROP TABLE IF EXISTS a_temp;
END
;;
delimiter ;

