CREATE PROCEDURE `betDateCount`()
BEGIN
    SELECT @betTimes:=COUNT(*),@betMoney:=IFNULL(SUM(t.money),0),@betperson:=COUNT(distinct (t.user_id)),@fee:=IFNULL(SUM(t.fee),0), @lose:=IFNULL(SUM(t.money-t.earn*t.money),0),
    @tax:= SUM(t.money*(100+t.odd_percent)/100+t.earn*t.money*(100+t.odd_percent)/100-t.fee-t.earn*t.fee),@wl:=COUNT(t.earn),@win:=IFNULL(SUM(IF(earn=1,t.fee-t.money,0)),0)
    FROM t_order_item t WHERE  date_format(t.update_time,'%y%m%d')= DATE_SUB(CURDATE(),INTERVAL 1 DAY) AND t.`status`=1;

