-- ----------------------------
-- Procedure structure for bitchBack
-- ----------------------------
DROP PROCEDURE IF EXISTS `bitchBack`;
delimiter ;;
CREATE PROCEDURE `bitchBack`(IN matchid INT,IN bet VARCHAR(20),IN ishalf INT,IN cname VARCHAR(20))
BEGIN
	DECLARE s INT DEFAULT 0;
	DECLARE uid INT DEFAULT 0;
	DECLARE betmoney BIGINT DEFAULT 0;
	DECLARE tmoney BIGINT DEFAULT 0;
    DECLARE toid VARCHAR(50) DEFAULT 0;
	DECLARE cu CURSOR FOR SELECT user_id,money,serial_id FROM t_order_item WHERE match_id=matchid AND cut_line=bet AND status=1 AND is_half=ishalf;
	DECLARE CONTINUE HANDLER FOR NOT found SET s=1;
	OPEN cu;
		FETCH cu INTO uid,betmoney,toid;
		WHILE s<>1 DO
			SELECT @tmoney:=money,@uname:=username FROM t_wallet WHERE user_id=uid;
			UPDATE t_wallet SET money=money+betmoney WHERE user_id=uid;
            FETCH cu INTO uid,betmoney,toid;
		END WHILE;
	CLOSE cu;
	UPDATE t_order_item SET `status`=3 WHERE match_id=matchid AND cut_line=bet AND status=1 AND is_half=ishalf;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for dailyData
-- ----------------------------
DROP PROCEDURE IF EXISTS `dailyData`;
delimiter ;;
CREATE PROCEDURE `dailyData`(IN d INT)
BEGIN

DECLARE s INT DEFAULT 0;
DECLARE uid INT DEFAULT 0;
DECLARE curr DATE DEFAULT NULL;

DECLARE cu CURSOR FOR SELECT contract_id FROM m_game;
DECLARE CONTINUE HANDLER FOR NOT found SET s=1;

OPEN cu;
	SET curr = DATE_SUB(CURDATE(),INTERVAL 1 DAY);
	FETCH cu INTO uid;
	WHILE s<>1 DO
		SELECT @totalAmount:=sum(amount)/1000000, @totalNumber:=count(*), @totalUser:=count(DISTINCT(address))
		from t_order where date_format(create_time,'%y%m%d') =DATE_SUB(CURDATE(),INTERVAL 1 DAY);
			SELECT @loseAmount:=sum(amount)/1000000, @loseNumber:=count(*), @totalUser:=count(DISTINCT(address))
		from t_order where date_format(create_time,'%y%m%d') =DATE_SUB(CURDATE(),INTERVAL 1 DAY) and status = 2;
			SELECT @lotteryAmount:=sum(amount)/1000000, @lotteryNumber:=count(*), @lotteryUser:=count(DISTINCT(address))
		from t_order where date_format(create_time,'%y%m%d') =DATE_SUB(CURDATE(),INTERVAL 1 DAY) and status = 3;
			SELECT @doneAmount:=sum(amount)/1000000, @doneNumber:=count(*), @doneUser:=count(DISTINCT(address))
		from t_order where date_format(create_time,'%y%m%d') =DATE_SUB(CURDATE(),INTERVAL 1 DAY) and status = 4;
		FETCH cu INTO uid;
	END WHILE;
CLOSE cu;
END
;;
delimiter ;

