-- ----------------------------
-- Procedure structure for daily_sum_statistic
-- ----------------------------
DROP PROCEDURE IF EXISTS `daily_sum_statistic`;
delimiter ;;
CREATE PROCEDURE `daily_sum_statistic`()
BEGIN 
DECLARE s INT DEFAULT 0; 
DECLARE uid INT DEFAULT 0;
DECLARE curr DATE DEFAULT NULL; 
DECLARE cu CURSOR FOR SELECT contract_id FROM m_game; 
DECLARE CONTINUE HANDLER FOR NOT found SET s=1;
OPEN cu;
 SET curr = DATE_SUB(CURDATE(),INTERVAL 1 DAY);
 FETCH cu INTO uid;
 WHILE s<>1 DO
  SELECT @totalAmount:=sum(amount)/1000000 as totalAmount, @totalNumber:=count(*) as totalNumber, @totalUser:=count(DISTINCT(address)) as totalUser from t_order where date_format(create_time,'%y%m%d') =DATE_SUB(CURDATE(),INTERVAL 1 DAY) and game_id = uid;
  SELECT @loseAmount:=sum(amount)/1000000 as loseAmount , @loseNumber:=count(*) as loseNumber, @loseUser:=count(DISTINCT(address)) as loseUser from t_order where date_format(create_time,'%y%m%d') =DATE_SUB(CURDATE(),INTERVAL 1 DAY) and status = 2 and game_id = uid;
  SELECT @lotteryAmount:=sum(amount)/1000000 as lotteryAmount, @lotteryNumber:=count(*) as lotteryNumber, @lotteryUser:=count(DISTINCT(address)) as lotteryUser from t_order where date_format(create_time,'%y%m%d') =DATE_SUB(CURDATE(),INTERVAL 1 DAY) and status = 3 and game_id=uid;
  SELECT @doneAmount:=sum(amount)/1000000 as doneAmount, @doneNumber:=count(*) as doneNumber, @doneUser:=count(DISTINCT(address)) as doneUser from t_order where date_format(create_time,'%y%m%d') =DATE_SUB(CURDATE(),INTERVAL 1 DAY) and status = 4 and game_id=uid;
  VALUES (uid,ifnull(@totalAmount,0),ifnull(@totalUser,0),ifnull(@totalNumber,0),ifnull(@lotteryAmount,0),ifnull(@lotteryUser,0),ifnull(@lotteryNumber,0),ifnull(@loseAmount,0),ifnull(@loseUser,0),ifnull(@loseNumber,0), ifnull(@doneNumber,0), ifnull(@doneUser,0), curr,now());
  FETCH cu INTO uid;
 END WHILE;
CLOSE cu;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for daily_sum_statistic_address
-- ----------------------------
DROP PROCEDURE IF EXISTS `daily_sum_statistic_address`;
delimiter ;;
CREATE PROCEDURE `daily_sum_statistic_address`()
BEGIN 
DECLARE s INT DEFAULT 0; 
DECLARE uid INT DEFAULT 0;
DECLARE curr DATE DEFAULT NULL; 
DECLARE out_done int DEFAULT FALSE ;
DECLARE cu CURSOR FOR SELECT contract_id FROM m_game; 
DECLARE CONTINUE HANDLER FOR NOT found SET out_done=true;
OPEN cu;
SET curr = DATE_SUB(CURDATE(),INTERVAL 1 DAY);
WHILE not out_done DO
  FETCH cu INTO uid;
  if NOT out_done THEN
  BEGIN
        DECLARE inner_done int DEFAULT FALSE;
        DECLARE address_now varchar(128) DEFAULT NULL;

        DECLARE address_cu CURSOR FOR SELECT distinct(address) FROM t_order where DATE(create_time) = DATE_SUB(CURDATE(),INTERVAL 1 DAY) and address is not null and game_id = uid;
        DECLARE CONTINUE HANDLER FOR NOT FOUND SET inner_done = TRUE;

        OPEN address_cu;
        WHILE not inner_done DO
            FETCH address_cu INTO address_now;
            IF NOT inner_done THEN
                SELECT uid, address_now, @totalAmount:=sum(amount)/1000000 as totalAmount, @totalNumber:=count(*) as totalNumber from t_order where date_format(create_time,'%y%m%d')=date_format(DATE_SUB(CURDATE(),INTERVAL 1 DAY), '%y%m%d') and address = address_now and game_id = uid;
    
                SELECT  uid, address_now, @loseAmount:=sum(amount)/1000000 as loseAmount , @loseNumber:=count(*) as loseNumber from t_order where date_format(create_time,'%y%m%d')=date_format(DATE_SUB(CURDATE(),INTERVAL 1 DAY), '%y%m%d') and status = 2  and address = address_now and game_id = uid;
    
                SELECT  uid, address_now, @lotteryAmount:=sum(amount)/1000000 as lotteryAmount, @lotteryNumber:=count(*) as lotteryNumber from t_order where date_format(create_time,'%y%m%d')=date_format(DATE_SUB(CURDATE(),INTERVAL 1 DAY), '%y%m%d') and status = 3 and address = address_now and game_id = uid;
    
                SELECT  uid, address_now, @doneAmount:=sum(amount)/1000000 as doneAmount, @doneNumber:=count(*) as doneNumber from t_order where date_format(create_time,'%y%m%d')=date_format(DATE_SUB(CURDATE(),INTERVAL 1 DAY), '%y%m%d') and status = 4  and address = address_now and game_id = uid;
  
            END IF;
        END WHILE;   
  END;         
  END IF;
END WHILE;
CLOSE cu;
END
;;
delimiter ;

