-- ----------------------------
-- Procedure structure for recordAgentbetDate
-- ----------------------------
DROP PROCEDURE IF EXISTS `recordAgentbetDate`;
delimiter ;;
CREATE PROCEDURE `recordAgentbetDate`(IN d int,IN i int)
BEGIN
DECLARE s INT DEFAULT 0;
DECLARE c INT DEFAULT 0;
DECLARE uid INT DEFAULT 0;
DECLARE rtree VARCHAR(1024);

DECLARE uids INT DEFAULT 0;
DECLARE rtrees VARCHAR(1024);

DECLARE cu CURSOR FOR SELECT user_id,tree FROM t_app_user where user_id = i;
DECLARE cus CURSOR FOR SELECT user_id,tree FROM t_app_user where is_super_agent=1;

DECLARE CONTINUE HANDLER FOR NOT found SET s=1;
IF i <> 0 THEN
	SELECT count(id) into c from t_agent_bet_date t where t.agent_id = i and t.create_time = DATE_SUB(CURDATE(), INTERVAL d DAY);
	if c<>0 THEN
		DELETE from t_agent_bet_date t  where t.agent_id = i and t.create_time = DATE_SUB(CURDATE(), INTERVAL d DAY);
	end if;
	OPEN cu;
	 FETCH cu INTO uid,rtree;
			WHILE s<>1 DO
				 SELECT
				@betTimes := COUNT(*),
				@betMoney := IFNULL( SUM( t.money ), 0 ),
				@betperson := COUNT(DISTINCT ( t.user_id )),
				@fee := IFNULL( SUM( t.fee ), 0 ),
				@lose := IFNULL( SUM( t.money - t.earn * t.money ), 0 ),
				@tax := SUM(IF( t.earn = 1, t.money *( 100+t.odd_percent )/ 100-t.fee, 0 )),
				@wl := COUNT(t.earn ),
				@win := IFNULL( SUM( IF ( earn = 1, t.fee - t.money, 0 )), 0 ) 
			FROM
				t_order_item t 
			WHERE
				date_format( t.update_time, '%y%m%d' )= DATE_SUB( CURDATE(), INTERVAL d DAY ) 
				AND ( t.`status` = 1 OR t.`status` = 4 ) 
				AND t.user_id IN (SELECT user_id FROM t_app_user u WHERE u.is_test = 0 and (u.tree = CONCAT(rtree,',',uid) or u.tree like CONCAT(rtree,',',uid,'%')));
					
					VALUES (DATE_SUB(CURDATE(),INTERVAL d DAY),@betMoney,@betTimes,@betperson,IFNULL(@tax,0),@fee,@wl,@lose,@win,uid);
			FETCH cu INTO uid,rtree;
			END WHILE;
	CLOSE cu;
ELSE		
   OPEN cus;
	    FETCH cus INTO uids,rtrees;
			WHILE s<>1 DO
			  SELECT
				@betTimes := COUNT(*),
				@betMoney := IFNULL( SUM( t.money ), 0 ),
				@betperson := COUNT(DISTINCT ( t.user_id )),
				@fee := IFNULL( SUM( t.fee ), 0 ),
				@lose := IFNULL( SUM( t.money - t.earn * t.money ), 0 ),
				@tax := SUM(IF( t.earn = 1, t.money *( 100+t.odd_percent )/ 100-t.fee, 0 )),
				@wl := COUNT(t.earn ),
				@win := IFNULL( SUM( IF ( earn = 1, t.fee - t.money, 0 )), 0 ) 
			FROM
				t_order_item t 
			WHERE
				date_format( t.update_time, '%y%m%d' )= DATE_SUB( CURDATE(), INTERVAL d DAY ) 
				AND ( t.`status` = 1 OR t.`status` = 4 ) 
				AND t.user_id IN (SELECT user_id FROM t_app_user u WHERE u.is_test = 0 and (u.tree = CONCAT(rtrees,',',uids) or u.tree like CONCAT(rtrees,',',uids,'%')));
					
					VALUES (DATE_SUB(CURDATE(),INTERVAL d DAY),@betMoney,@betTimes,@betperson,IFNULL(@tax,0),@fee,@wl,@lose,@win,uids);
			FETCH cus INTO uids,rtrees;
			END WHILE;
	CLOSE cus;
END IF;
END
;;
delimiter ;

