-- ----------------------------
-- Procedure structure for RecorduserDate
-- ----------------------------
DROP PROCEDURE IF EXISTS `RecorduserDate`;
delimiter ;;
CREATE PROCEDURE `RecorduserDate`(IN d INT)
BEGIN

DECLARE s INT DEFAULT 0;
DECLARE uid INT DEFAULT 0;
DECLARE curr DATE DEFAULT NULL;

DECLARE cu CURSOR FOR SELECT user_id FROM t_app_user WHERE is_test=0;
DECLARE CONTINUE HANDLER FOR NOT found SET s=1;

OPEN cu;
	SET curr = DATE_SUB(CURDATE(),INTERVAL d DAY);
	FETCH cu INTO uid;
	WHILE s<>1 DO
		SELECT @paymoney:= IFNULL(SUM(t.amount),0),@paytimes:= COUNT(*) FROM t_app_wallet_record t WHERE t.user_id =uid AND (t.type=1 OR t.type=10) AND date_format(t.create_time,'%y%m%d') = date_format(curr,'%y%m%d');
		SELECT @drwamoney:= IFNULL(SUM(t.amount),0) ,@drawtimes:= COUNT(*) FROM t_withdraw t WHERE  t.user_id =uid AND t.status=1  AND date_format(t.update_time,'%y%m%d') = date_format(curr,'%y%m%d');
		SELECT @sdrawmoney:= IFNULL(SUM(t.amount),0),@sdrawtimes:= COUNT(*) FROM t_app_wallet_record t WHERE t.user_id=uid AND t.type=12 AND date_format(t.create_time,'%y%m%d') = date_format(curr,'%y%m%d');

    	SELECT @betrealmoney:=IFNULL(SUM(t.money),0) ,@reward:=IFNULL(SUM(t.fee),0),@bettimes:=COUNT(*),@betwl:=IFNULL(SUM(t.earn),0) ,
        @tax:= SUM(IF(t.earn=1,t.money*(100+t.odd_percent)/100-t.fee,0)) FROM t_order_item t WHERE t.user_id =uid AND date_format(t.update_time,'%y%m%d') = date_format(curr,'%y%m%d') AND (t.status=1 or t.status=4);
     	SELECT @betmoney:=IFNULL(SUM(t.money),0) FROM t_order_item t WHERE t.user_id =uid AND date_format(t.update_time,'%y%m%d') = date_format(curr,'%y%m%d');
		
		SELECT @ordermoney:=IFNULL(SUM(t.money),0) FROM t_order_item t WHERE t.user_id =uid AND (t.status=0 or t.status=4);
		SELECT @walletmoney:=t.money FROM t_wallet t WHERE t.user_id =uid;

		SELECT @rewardMoney:= IFNULL(SUM(t.amount),0) FROM t_app_wallet_record t WHERE t.user_id =uid AND type=3 AND date_format(t.create_time,'%y%m%d') = date_format(curr,'%y%m%d');
		
		FETCH cu INTO uid;
	END WHILE;
CLOSE cu;
END
;;
delimiter ;

