INSERT INTO `t_help_center_info` VALUES (00000000000000000001, 5, '如何加入流动性挖矿？', '<p>参与无损保障的流动性挖矿，需要支付ETH作为矿工费用，一个加密货币钱包地址只需要认领一次，成功后自动打开挖矿权限。 </p>', 'zh', '1', '0', '2023-08-22 19:11:29', 'admin', '2023-08-22 19:11:29', 'admin', NULL, NULL);
INSERT INTO `t_help_center_info` VALUES (00000000000000000002, 5, '我要怎么取钱？', '<p>您可以将每天产生的币种转换为USDT，然后发起提现。USDT提现将自动发送到您添加到节点的钱包地址，不支持其他地址。 </p>', 'zh', '1', '0', '2023-08-22 19:14:18', 'admin', '2023-08-22 19:14:18', 'admin', NULL, NULL);
INSERT INTO `t_help_center_info` VALUES (00000000000000000003, 5, '为什么提现不到账？', '<p>当您从 EX 提取数字资产到其他平台时，若提币未到账，通常由以下情况造成：</p><p><br></p><p>（1）区块未确认，提现无法正常到账。当您汇出后，这笔资金已经在区块中，需区块进行确认，区块确认时间不固定。如区块确认后仍然不到账，需联系对方平台进行核实。</p><p><br></p><p>（2）资产未汇出，提现无法正常到账。当您的资产未汇出会显示提现中或等待提现，是系统正在排队汇出，是由于提现人数较多造成的，系统会按照当前提现用户提交时间逐一汇出，人工无法干预，麻烦您耐心等待，给您带来不便请您谅解。</p><p><br></p><p>（3）提现无法正常到账。选择和汇入方地址一致的链或网络。</p><p><br></p><p>在提现的时候，一定要选择与充币平台相同的链和网络。例如您从</p><p>A平台提现到B平台，在A平台选择TRC链，在B平台选择ERC20的</p><p>链，那么您的币是无法到账的。</p>', 'zh', '1', '0', '2023-08-22 19:45:40', 'admin', '2023-08-22 19:45:40', 'admin', NULL, NULL);
INSERT INTO `t_help_center_info` VALUES (00000000000000000004, 6, '新手攻略', '<p>我们是全球领先的数字资产服务平台，拥有全球顶级专家组成的安全团队，可以为您的资产提供银行级的安全存储和保护。</p><p><br></p><p>首次使用平台的用户，可以通过此文快速学会交易比特币等数字资产，并初步了解EX金融理财产品。买卖数字资产整体分为二步：</p><p><br></p><p><strong>第一步：交易前设置</strong></p><p>1：下载</p><p>2：注册</p><p>3：身份认证</p><p>4：添加收款方式</p><p><br></p><p><strong>第二步：买币/卖币</strong></p><p>1：充值</p><p>2：资金划转</p><p>3：币币交易买币/卖币</p><p><br></p><p><strong>1：下载APP</strong></p><p><br></p><p>打开EX平台H5端，点击<strong>【下载图标】</strong>进入下载页面，然后选择下载通道，点击下载即可。</p><p><img src=\"https://admin-api2.ok6.cc/profile/upload/2023/08/22/组 710@2x_20230822195243A001.png\"></p><p><img src=\"https://admin-api2.ok6.cc/profile/upload/2023/08/22/截屏2023-08-11 09.56.33@2x_20230822195341A002.png\"></p><p><br></p><p><strong>2：注册</strong></p><p><br></p><p>点击右上角【头像】右下角【资产】或者其它功能进入登录界面，用户可以选择【用户名】【邮箱】或者【手机号】，按提示完成注册即可。</p><p><img src=\"https://admin-api2.ok6.cc/profile/upload/2023/08/22/组 711@2x_20230822195542A003.png\"></p><p><br></p><p><img src=\"https://admin-api2.ok6.cc/profile/upload/2023/08/22/组 712@2x_20230822195552A004.png\"></p><p><strong>3：身份认证</strong></p><p><br></p><p>为了给用户提供更好的平台交易体验，用户在完成注册，登录之后，点击主页右上角的【头像】，进入【侧边栏】页面，点击【身份认证】按提示完成身份认证即可。</p><p><img src=\"https://admin-api2.ok6.cc/profile/upload/2023/08/22/组 713@2x_20230822195853A007.png\"></p><p><img src=\"https://admin-api2.ok6.cc/profile/upload/2023/08/22/组 714@2x_20230822195845A006.png\"></p><p><strong>4：绑定银行卡</strong></p><p><br></p><p>用户在可以添加自己的银行卡</p><p><img src=\"https://admin-api2.ok6.cc/profile/upload/2023/08/22/组 715@2x_20230822195730A005.png\"></p>', 'zh', '1', '0', '2023-08-22 19:59:01', 'admin', '2023-08-22 20:02:45', 'admin', NULL, NULL);
INSERT INTO `t_help_center_info` VALUES (00000000000000000005, 6, '下载、注册', '<p>EX拥有全球顶级专家组成的安全团队，可以为您的资产提供银行</p><p>级的安全存储和保护。首次下载、注册EX平台，可以参照以下步</p><p>骤操作。</p><p><br></p><p><strong>1：下载APP</strong></p><p><br></p><p>打开EX平台H5端，点击<strong>【下载图标】</strong>进入下载页面，然后选择下载通道，点击下载即可。</p><p><img src=\"https://admin-api2.ok6.cc/profile/upload/2023/08/22/%E7%BB%84%20710@2x_20230822195243A001.png\"></p><p><img src=\"https://admin-api2.ok6.cc/profile/upload/2023/08/22/%E6%88%AA%E5%B1%8F2023-08-11%2009.56.33@2x_20230822195341A002.png\"></p><p><br></p><p><strong>2：注册</strong></p><p><br></p><p>点击右上角【头像】右下角【资产】或者其它功能进入登录界面，用户可以选择【用户名】【邮箱】或者【手机号】，按提示完成注册即可。</p><p><img src=\"https://admin-api2.ok6.cc/profile/upload/2023/08/22/%E7%BB%84%20711@2x_20230822195542A003.png\"></p><p><br></p><p><img src=\"https://admin-api2.ok6.cc/profile/upload/2023/08/22/%E7%BB%84%20712@2x_20230822195552A004.png\"></p>', 'zh', '1', '0', '2023-08-22 20:05:34', 'admin', '2023-08-22 20:06:06', 'admin', NULL, NULL);
