INSERT INTO `t_option_rules` VALUES (100108, '秒合约规则', 'zh', '<p>交易时间： 秒合约的交易时间非常短，您需要在极短的时间内进行交易决策和操作。</p><p><br></p><p>交易币种： 秒合约可能适用于不同的交易币种，您可以选择您熟悉的币种进行交易。</p><p><br></p><p>交易方向： 您可以选择做多（买入）或做空（卖出）秒合约，根据您对市场走势的判断。</p><p><br></p><p>交易费用： 秒合约可能会产生交易费用，包括开仓费、平仓费等。这些费用可能因交易所而异。</p><p><br></p><p>交易平台： 秒合约通常在一些特定的交易平台上提供，这些平台专注于提供快速交易的体验。</p><p><br></p><p> 秒合约的交易时间短，市场波动也可能较大，因此市场风险相对较高。建议您进行充分的市场分析和风险评估。</p>', '0', '2023-08-08 15:21:38', 1, NULL);
INSERT INTO `t_option_rules` VALUES (100109, '贷款规则', 'zh', '<p>1,什么是 Bybit借贷？</p><p>Bybit 贷款是与第三方贷款公司合作的一项金融服务，为您提供贷款以满足短期流动性资金需求。&nbsp;</p><p><br></p><p>2，我怎样才能获得贷款？需要满足什么要求？</p><p>贷款程序尽可能简单。只要你有一个 bybit 账户。你需要确保你的Bybit账户中有足够的抵押资产进行贷款，同意条款并申请贷款，然后寻找客服进行确认</p><p><br></p><p>3，所借资产可以在 Bybit 上交易哪些产品？</p><p>所借代币可以在 Bybit 上进行任何交易，（杠杆交易，合约交易，质押挖矿）</p><p><br></p><p>4，所借资产可以提现吗？</p><p>可以，你可以提取所借资产，但是请注意您的还款不能从Bybit 账户内扣除，您需要完成还款才能进行提取功能</p><p><br></p><p>5，借币以什么形式进行发放？</p><p>借币可以以USDT，BTC，ETH等热门币种进行发放，贷款审核完成后会在24小时内发放到你的总资产中</p><p><br></p><p>6，最低贷款期限是多少？</p><p>目前，贷款期设有 7 天、14 天、30 天和60 天，用户可以随时归还所借代币。如有疑问请联系客服进行详细咨询</p><p><br></p><p>7，我可以用与贷款货币不同的币种来偿还贷款吗？</p><p>可以，你可以使用等额的BTC，ETH或USDT偿还贷款</p><p><br></p><p>8，如何计算贷款利息？</p><p>利息根据实际借贷时间计算得出（不足一个月按一个月进行计算）。月利率0.01。（例如你借款100000美元，那么你一个月的还款利息是1000美元）</p><p>每月的最后3天为最后还款日，当然你也可以提前完成还款，如果月末3天遇上周六，周日，或者公休日，还款日将顺推1-3天</p><p><br></p><p><br></p><p>9，可以提前偿还全部或部分贷款吗？</p><p>您可以提前偿还贷款。您可以寻找客服申请提前还款完成此操作。</p><p><br></p><p>如果提前还款，超过3000美元（或3500美元或3500欧元）。 总还款额（包括费用）不能超过您在原期结束时必须还款的金额。 这意味着，在提前还款的情况下，您必须偿还相同款项。</p><p><br></p><p>10，如何偿还本金和利息？</p><p>请联系客服人员，客服人员将为你提供专门的还款账户</p><p><br></p><p>11，贷款到期后会自动还款吗？</p><p>目前暂不支持自动还款。</p><p><br></p><p>12，如果我没有按时还款会怎么样？</p><p>为避免错过贷款还款日，客服会在您该还款日期之前反复通知。如果您错过还款日，您的贷款将自动延长7天。在这种情况下，您将被收取贷款金额的0.025的额外逾期利息</p><p><br></p><p>如果您在延长期限结束时错过付款，您的信用额度将再次延长 7 天。通过这种方式，贷款可以根据您的意愿多次延长，同时您的抵押品足以担保债务。请注意，您需要为贷款的每次延期付费。您的贷款债务随着每次延期而增加，在每次延期时你必须先缴纳逾期利息，请注意！如果长时间未缴纳逾期利息或归还本金，可能会面临冻结账户</p>', '0', '2023-08-08 15:46:47', 7, NULL);
