INSERT INTO `t_option_rules` VALUES (100111, '使用条款', 'zh', '<p>User License Agreement</p><p><br></p><p>1. General Rules</p><p>1.1 The User Agreement (\"Agreement\" or \"Terms and Conditions\") consists of the text, the Privacy Policy, the Know Your Customer and Anti-Money Laundering Policy, and various rules, statements, and instructions that have been or may be issued by the Site. The Agreement consists of the text, the Privacy Policy, the Know Your Customer and Anti-Money Laundering Policy, and any rules, statements, instructions, etc. that have been or may be published on the Site.</p><p>1.2 You should read this Agreement carefully before using the services provided by the Site and consult a professional lawyer if you do not understand anything or if otherwise necessary. If you do not agree with this Agreement and/or its modification from time to time, you should immediately stop using the services provided by the Site or stop accessing the Site. Once you access this website, use any service of this website or any other similar behavior, you have understood and fully agree to the content of this agreement, including any modification of this agreement made by this website at any time.</p><p>1.3 You can become a member of this website (hereinafter referred to as \"Member\") by filling in the relevant information in accordance with the requirements of this website and successfully registering after other relevant procedures. In the process of registration, clicking the \"Agree\" button means that you have reached an agreement with the company in the form of electronic signature; or when you click on any button marked with \"Agree\" or similar meaning in the process of using this website or actually use the services provided by this website in other ways allowed by this website, it means that you fully understand, agree and accept the binding of all the terms under this agreement, and the absence of your handwritten written signature does not The absence of your handwritten signature does not affect the legally binding effect of this Agreement on you.</p><p>1.4 After becoming a member of this website, you will be given a member account and a corresponding password, which shall be kept by you; you shall be legally responsible for all activities and events carried out with your account.</p><p>1.5 Only members of this website can use the digital asset trading platform provided by this website to trade and enjoy other services provided by this website that are only available to members; non-members can only access the website, browse the website and other services provided by this website.</p><p>1.6 By registering and using any of the services and features offered on the Site, you will be deemed to have read, understood and：</p><p>1.6.1 Accept to be bound by all terms and conditions of this Agreement.</p><p>1.6.2 You confirm that you are 16 years of age or older or have the legal age to enter into a contract under different applicable laws, and that your registration, sale or purchase, posting of information and other acceptance of services on the Site shall be in accordance with the relevant laws and regulations of the sovereign country or region having jurisdiction over you, and that you have sufficient capacity to accept these terms and enter into transactions and use the Site for digital assets Transactions.</p><p>1.6.3 You warrant that all digital assets belonging to you involved in a transaction are legally acquired and owned by you. 1.6.4 You agree that you are solely responsible for your own transactions or non-transactions and any gains or losses.</p><p>1.6.5 You confirm that the information provided during registration is true and accurate.</p><p>1.6.6 You agree to comply with any relevant legal requirements, for tax purposes, including reporting any trading profits.</p><p>1.6.7 You agree not to engage in or participate in conduct or activities that are detrimental to the interests of the Site or the Company at any time, whether or not in connection with the services provided on the Site.</p><p>1.6.8 This Agreement only governs the rights and obligations agreed between you and us, and does not cover legal relationships and legal disputes between users of the Site and other websites and between you as a result of transactions in digital assets.</p><p><br></p><p>2. Agreement amendment</p><p>We reserve the right to revise this Agreement from time to time and to announce the changes by way of posting on the Website without further separate notice to you, and the changed Agreement will be marked on the first page of this Agreement with the time of the changes and will become effective immediately upon posting on the Website. If you do not agree with the changes, you should immediately stop using the Services; by continuing to use the Services, you accept and agree to be bound by the revised Agreement.</p><p><br></p><p>3.Sign Up</p><p>3.1 Sign Up Qualification</p><p>You acknowledge and Sign Up that you shall be a natural person, legal entity or other organization with the ability to sign this agreement and use the services of this website as provided by applicable laws when you complete the registration process or actually use the services provided by this website in other ways as permitted by this website. Once you click on the Sign Up button, it means that you yourself or your authorized agent has agreed to the content of the agreement and its agent to Sign Up and use the services of this website. If you do not have the aforementioned subject qualifications, you and your authorized agent shall bear all consequences resulting from this, and the Company reserves the right to cancel or permanently freeze your account and pursue responsibility from you and your authorized agent.</p><p>3.2 Sign Up Purpose</p><p>You acknowledge and undertake that your Sign Up on this website is not for the purpose of violating laws and regulations or disrupting the orderly trading of digital assets on this website.</p><p>3.3 Sign Up Process</p><p>3.3.1 You agree to provide valid email address, cell phone number and other information as required by the user Sign Up page of this website, and you may use the email address, cell phone number provided or confirmed by you or other means allowed by this website as a means of logging into this website. If necessary, according to the relevant laws and Sign Up of different jurisdictions, you must provide your real name, identity document and other relevant information as stipulated by the law and the Sign Up page, and keep the information on the Sign Up page updated to meet the timeliness, exhaustiveness and accuracy of the Sign Up page. All information initially keyed in will be cited as contracted information. You shall be responsible for the truthfulness, completeness and accuracy of such information, and shall bear any direct or indirect losses and adverse consequences arising therefrom.</p><p>3.3.2 If the laws, regulations, rules, orders and other norms of your sovereign country or region have real name requirements for cell phone numbers, you agree to provide that the Sign Up cell phone number is registered with your real name, and if you do not provide it in accordance with the regulations, any direct or indirect losses and adverse consequences caused to you as a result shall be borne by you.</p><p>3.3.3 You are entitled to obtain an account number and password for this website after you have legally, completely and effectively provided the information required for Sign Up and verified it.</p><p>3.3.4 You agree to receive e-mails and/or short messages from the Site in connection with the administration and operation of the Site.</p><p><br></p><p>4.Serve</p><p>This website only provides web trading platform services for your digital asset trading activities (including but not limited to digital asset trading and other services) through this website.</p><p>4.1 Service Content</p><p>4.1.1 You have the right to browse the real-time quotation and trading information of various products of digital assets on this website, and the right to submit digital asset trading orders and complete digital asset trading through this website.</p><p>4.1.2 You have the right to view the information under your member account on this website and the right to use the functions provided on this website for operation.</p><p>4.1.3 You have the right to participate in the website activities organized by this website in accordance with the rules of activities published on this website.</p><p>4.1.4 Other services that this website promises to provide for you.</p><p>4.2. Service Rules You undertake to abide by the following service rules of this website：</p><p>4.2.1 You shall comply with the provisions of laws, regulations, and policy requirements, ensure the legality of the source of all digital assets in your account, and shall not engage in illegal or other activities that harm the rights and interests of the Website or third parties on the Website or using the services of the Website, including but not limited to sending or receiving any illegal, irregular, or infringing information on the rights and interests of others, sending or receiving marketing materials or other harmful information or Once your account funds are complained, you must cooperate with the platform to review the information and collect the evidence.</p><p>4.2.2 You shall comply with the laws and regulations and use and keep your account and login password, fund password, and the cell phone number bound to your registration, as well as the cell phone verification code received by your cell phone. You are fully responsible for any operation and consequences of using your account number and login password, fund password and mobile phone verification code. When you find that the account number, login password, or fund password or verification code of this website is used by a third party without your authorization, or there are other account security problems, you should immediately and effectively notify this website and request this website to suspend the service of this website account. This website has the right to take action on such request from you within a reasonable time, but this website will not be responsible for the consequences (including but not limited to any loss to you) that have arisen before taking action. You may not give, borrow, rent, transfer or otherwise dispose of your account on the Website to another person without the consent of the Website.</p><p>4.2.3 You agree to be responsible for all activities that occur under your account and password on the Site (including but not limited to disclosing information, posting information, clicking online to agree to or submit to various rules and agreements, renewing agreements online or purchasing services, etc.).</p><p>4.2.4 You shall not maliciously interfere with the normal conduct of digital asset transactions or disrupt the order of transactions when trading digital assets on this website; you shall not interfere with the normal operation of this website or interfere with other users\' use of the services of this website by any technical means or otherwise; you shall not maliciously defame the goodwill of this website by falsifying facts or other means.</p><p>4.2.5 If you have disputes with other users due to online transactions, you shall not request the Website to provide relevant information through judicial or administrative channels other than the Website.</p><p>4.2.6 In the process of using the services provided by this website, the taxable expenses, as well as all hardware, software, services and other expenses shall be borne by you alone.</p><p>4.2.7 Due to the current special international situation, large amounts of funds are withdrawn from sensitive countries or regions (USA, Russia, Ukraine, China, Taiwan, etc.). You must ensure that your funds are legitimate, do not use the decentralized nature of the Site to engage in any form of terrorist, political, military or anti-religious activities, and refuse to fund such groups and individuals. If your funds are monitored and prosecuted by the financial authorities during the withdrawal process, you may be required to pay a deposit of 5%-50%.</p><p>4.2.8 You shall comply with this Agreement and other terms of service and operating rules published and updated from time to time on this website, and have the right to terminate the use of the services provided by this website at any time.</p><p>4.2.9 If you withdraw a total of USD 200,000 or a single withdrawal of USD 50,000 or more from our website, you will need to increase your KYC level and pay a deposit for the upgrade channel fee, which will be calculated through a cryptographic system based on the blockchain network you use and will be refunded to your trading account when the upgrade is completed.</p><p>4.3. Product rules</p><p>4.3.1 Viewing Trading Information</p><p>When browsing the trading information on this website, you should carefully read all the contents contained in the trading information, including but not limited to the price, order volume, commission, buy or sell direction, and you should not click on the button to trade until you fully accept all the contents contained in the trading information.</p><p>4.3. 2 Submitting an order</p><p>After reviewing the trade information and confirming that it is correct, you may submit your trade order. When you submit a trade order, you authorize this website to conduct the corresponding trade aggregation on your behalf, and this website will automatically complete the aggregated trade without prior notice to you when there is a trade that meets your order price.</p><p>4.3.3 Viewing transaction details</p><p>You can view the corresponding transaction records through your account.</p><p>4.3.4 Revoke/modify an order. You have the right to revoke or modify an order at any time before it is concluded.</p><p><br></p><p>5. Rights and obligations of this website</p><p>5.1 If you do not have the registration qualifications agreed to in this agreement, the Site has the right to refuse your registration, and for those who have registered, the Site has the right to cancel your membership account, and the Site reserves the right to pursue responsibility from you or your authorized agent. At the same time, this website reserves the right to decide whether to accept your registration under any other circumstances.</p><p>5.2 According to the Site\'s own judgment, the Site has the right to suspend or terminate your account and all associated accounts if it finds that you or your associated account users are not suitable for high-risk investments.</p><p>5.3 If the Website finds that the account user is not the initial registrant of the account, it has the right to suspend or terminate the use of the account.</p><p>5.4 The Website has the right to notify you to correct or update the information or suspend or terminate the services of the Website for you when it reasonably suspects that the information provided by you is incorrect, inaccurate, invalid or incomplete through technical testing, manual sampling and other testing methods.</p><p>5.5 The Website has the right to correct any information displayed on the Website if it is found to be obviously incorrect.</p><p>5.6 The Website reserves the right to modify, suspend or terminate the services of the Website at any time, and the Website exercises the right to modify or suspend the services without prior notice to you; if the Website terminates one or more services on the Website, the termination will take effect from the date the Website publishes the termination notice on the Website.</p><p>5.7 The Website will take necessary technical means and management measures to guarantee the normal operation of the Website and provide necessary and reliable trading environment and trading services to maintain the order of digital asset trading.</p><p>5.8 If you do not use the website member account and password to log in this website for one consecutive year, this website has the right to cancel your account of this website. After account cancellation, the Website has the right to open the corresponding membership name for other users to register and use.</p><p>5.9 Tax Obligations When the available funds in your trading account exceed the funds you deposited, each withdrawal of your funds will trigger a tax audit. If there are no tax disputes in your account, your funds will arrive quickly to your external wallet, otherwise the system will limit some of the functions of your account and send an email about taxes to your email address. Due to the anonymity and untraceability of cryptocurrencies, you cannot use the funds available in your trading account for tax purposes and you will need to pay the corresponding amount of cryptocurrency using your external wallet, as calculated by the system. If you have any concerns or questions, you can consult our online customer service for detailed assistance before using the account.</p><p><br></p><p>6.Compensation</p><p>6.1 In no event will our liability to you for direct damages exceed the total service fees we charge you for your use of the Site for a period of three (3) months.</p><p>6.2 In the event of any breach by you of this Agreement or other laws or regulations, etc., you shall indemnify us for at least $2,000,000 and all costs incurred in connection therewith (including attorneys\' fees, etc.), which shall be made up if not sufficient to cover actual damages.</p><p><br></p><p>7.The right to seek injunctive relief</p><p>We and you acknowledge that common law remedies for your breach or threatened breach may not be sufficient to cover the full amount of damages we have suffered, so we are entitled to seek injunctive relief in the event of your breach or threatened breach and all other remedies permitted at common law or in equity.</p><p><br></p><p>8. Limitation of Liability and Exclusion of Liability</p><p>8.1 You understand and agree that in no event shall we be liable for.</p><p>8.1.1 Loss of revenue.</p><p>8.1.2 Loss of trading profits or contracts.</p><p>8.1.3 Losses resulting from business interruption.</p><p>8.1.4 loss of anticipated monetary savings.</p><p>8.1.5 Losses due to information problems.</p><p>8.1.6 Loss of opportunity, goodwill or reputation.</p><p>8.1.7 Damage to or loss of data.</p><p>8.1.8 The cost of purchasing alternative products or services.</p><p>8.1.9 any indirect, special or incidental loss or damage arising out of tort (including negligence), breach of contract or any other cause, whether or not such loss or damage was reasonably foreseeable by us; whether or not we were advised in advance of the possibility of such loss or damage.</p><p>Sections 8.1.1 to 8.1.9 are independent of each other.</p><p>8.2 You understand and agree that we shall not be liable to you for any damages arising out of any of the following.</p><p>8.2.1 there may be a material breach of law or contract in relation to your particular transaction</p><p>8.2.2 Your conduct on the Site is suspected to be illegal or immoral.</p><p>8.2.3 Costs and losses arising from acts or substitutes such as purchasing or obtaining any data or information or conducting transactions through the services of this website.</p><p>8.2.4 Your misunderstanding of the services of this website.</p><p>8.2.5 Any other losses not caused by us in connection with the services provided on this website.</p><p>8.3 We are not responsible for any loss or damage caused by maintenance of information network equipment, failure of information network connection, failure of computer, communication or other systems, power failure, weather, accidents, strikes, labor disputes, riots, insurrections, disturbances, lack of productivity or means of production, fires, floods, storms, explosions, wars, bank or other partner causes, collapse of the digital asset market, governmental actions, judicial or administrative authorities, other acts beyond our control or beyond our ability to control, or third parties. orders, other acts beyond our control or our ability to control, or third parties, and we will not be liable for any failure to provide service or delay in service, or for any loss you may incur.</p><p>8.4 We cannot guarantee that all information, programs, texts, etc. contained in this website are completely safe and free from any interference and damage by viruses, Trojan horses and other malicious programs, so it is your personal decision and your own risk and possible loss to log on, use any service on this website or download and use any programs, information, data, etc. downloaded.</p><p>8.5 We do not guarantee or promise any information, products and business of any third party websites linked to this website or any other form of content that does not belong to our subjects, etc. If you use any services, information and products provided by third party websites, it is your personal decision and you bear all responsibilities arising therefrom.</p><p>8.6 We make no warranties, express or implied, with respect to your use of the services on the Site, including, but not limited to, the suitability, absence of errors or omissions, continuity, accuracy, reliability, and fitness for a particular purpose of the services provided on the Site. Also, we do not make any promises and guarantees for the validity, accuracy, correctness, reliability, quality, stability, completeness and timeliness of the technology and information involved in the services provided on this website. The decision to access or use the services provided on this website is your own and is at your own risk and possible loss. You understand and appreciate that the market for digital assets is unstable, and that prices and values may fluctuate or collapse significantly at any time, and that trading in digital assets is your own free choice and decision and you bear your own risk and possible losses.</p><p>8.7 Our warranties and undertakings set forth in this Agreement are the only warranties and representations made by us in connection with this Agreement and the services provided on the Site and supersede all other warranties and undertakings, whether written or oral, express or implied, arising from any other means or manner. All such warranties and representations represent only our own promises and guarantees and do not guarantee compliance by any third party with the warranties and undertakings in this Agreement.</p><p>8.8 We do not waive any right we have to limit, exclude or set off our liability for damages to the maximum extent applicable by law that is not mentioned in this agreement.</p><p>8.9 By registering, you acknowledge that any actions taken by us in accordance with the rules set out in this Agreement are at your risk.</p><p><br></p><p>9.Termination of Agreement</p><p>9.1 The Website has the right to terminate all the services of the Website in accordance with this Agreement, and this Agreement will be terminated on the date of termination of all the services of the Website.</p><p>9.2 After the termination of this Agreement, you have no right to request the Website to continue to provide any service or perform any other obligations to you, including but not limited to requesting the Website to retain or disclose to you any information in its original Website account, forwarding to you or a third party any information that it has not read or sent, etc.</p><p>9.3 The termination of this Agreement shall not affect the defaulting party\'s claim of other liabilities against the defaulting party.</p><p><br></p><p>10.Intellectual Property</p><p>10.1 All intellectual property rights in all intellectual works contained in the Site including, but not limited to, the Site logo, databases, Site design, text and graphics, software, photographs, videos, music, sound and combinations thereof, software compilations, related source code and software (including applets and scripts) are owned by the Site. You may not reproduce, modify, copy, transmit or use any of the foregoing materials or content for commercial purposes.</p><p>10.2 All rights (including, without limitation, goodwill and trademarks and logos) contained in the name of the Site are owned by the Company.</p><p>10.3 Your acceptance of this Agreement shall be deemed as your initiative to transfer the copyright of any form of information published on this website, including but not limited to: reproduction rights, distribution rights, rental rights, exhibition rights, performance rights, projection rights, broadcasting rights, information network transmission rights, filming rights, adaptation rights, translation rights, compilation rights and other transferable rights that should be enjoyed by the copyright owner to this website exclusively without compensation, this website The right to file a separate lawsuit against any subject infringement and obtain full compensation. This Agreement shall apply to the content of any copyrighted work published by you on the Website, regardless of whether the content was formed before or after the signing of this Agreement.</p><p>10.4 You shall not unlawfully use or dispose of the intellectual property rights of the Website or others in the course of using the services of the Website. You may not publish or authorize other websites (and media) to use the information that has been published on the Website in any form.</p><p>10.5 Your access to the Site or use of any of the services provided on the Site shall not be deemed to be a transfer of any intellectual property rights from us to you.</p><p><br></p><p>11.Asset Protection</p><p>Risk Control for Withdrawal Addresses. If your withdrawal address is incorrect, the risk control system will lock your account and automatically initiate the verification process. You must complete the following three steps in order for the risk control system to recognize your identity and unlock your account.</p><p>1) Provide a photo of the KYC document you used to authenticate your account on our website.</p><p>2) Find a white piece of paper with today\'s date written on it and have your KYC document, your face and the white paper appear on the same photo.</p><p>3) Use the original crypto wallet to deposit a sum of money to the exchange in the amount of 20% of the total principal amount of your account. Please note that you must complete the deposit to the exchange using the initial crypto wallet or the verification will fail.</p><p><br></p><p><br></p><p>12.Calculation</p><p>All transaction calculations have been verified by us and all calculations have been made public on the website, but we cannot guarantee that the use of the website will be uninterrupted or error-free.</p><p><br></p><p>13.The rights and obligations agreed to in this Agreement also bind the assignees, heirs, executors and administrators of the parties who derive a benefit from such rights and obligations. You may not assign to any third party without our consent, but we may assign our rights and obligations under this Agreement to any third party at any time by giving you notice.</p><p><br></p><p>14.Divisibility</p><p>If any provision of this Agreement is held to be unenforceable, invalid or illegal by any court of competent jurisdiction, it shall not affect the validity of the remaining provisions of this Agreement.</p><p><br></p><p>15.Non-Agent Relationship</p><p>Nothing in this Agreement shall be deemed to create, imply, or otherwise treat us as your agent, fiduciary, or other representative, except as otherwise provided in this Agreement.</p><p><br></p><p>16.Waiver of rights</p><p>No waiver by us or by either of you of the right to pursue a breach of contract or other liability under this Agreement shall be deemed or construed as a waiver of any other breach; and the failure to exercise any right or remedy shall not in any way be construed as a waiver of such right or remedy.</p><p><br></p><p>17.Entry into force and interpretation of the agreement</p><p>19.1 This Agreement shall become effective when you click on the consent to register on the registration page of the Website and complete the registration process and obtain an account and password for the Website, and shall be binding on both the Website and you.</p><p>19.2 The final interpretation of this Agreement is the property of the Website.</p><p><br></p><p>Disclaimer</p><p><br></p><p>Risk Warning</p><p>1. Digital assets involve significant risks and market trading uncertainties. Also, due to the generally small total market capitalization of digital currencies, prices are susceptible to significant fluctuations due to dealer control and the policies of various governments around the world. As a result of price fluctuations, you may have large profits or losses. Any digital asset can fluctuate significantly and may even become worthless.</p><p>2. Digital asset trading may be suspended or prohibited at any time due to the enactment or modification of laws, regulations and regulatory documents in each country. Users should assess their own risks according to local laws, regulations and policy documents when using StarCoin services.</p><p>3. Users should carefully consider and evaluate the investment value and risk of digital assets according to their own financial situation, control the risk of trading, and bear the economic risk of losing all their investment.</p><p><br></p><p>Rights Attribution</p><p>All rights (including copyrights, trademarks, patents, trade secrets and other related rights) in all products, technologies, software, programs, data and other information (including text, icons, images, photos, audio, video, graphics, color combinations, layout designs, etc.) within the Platform are owned by the Platform Service Provider and/or its affiliates unless otherwise stated by the Platform. Without the permission of the platform service provider and/or its affiliates, no one is allowed to use any content in the platform in an unauthorized manner, including monitoring, copying, transmitting, displaying, mirroring, uploading, downloading, etc. through programs or devices such as robots, spiders, etc.</p><p>The text and logo of the Platform, as well as other logos, emblems, product and service names of the Platform are trademarks of the Platform Service Provider and/or its affiliates, and you must obtain prior written authorization from the Platform Service Provider and/or its affiliates for any use such as promotion or display.</p>', '0', '2023-08-08 16:08:18', 6, NULL);
INSERT INTO `t_option_rules` VALUES (100112, '注册隐私', 'zh', '<p>Introduction</p><p>Your privacy is important to us. We are committed to protecting the privacy, confidentiality, and security of the personal data we hold by complying with the requirements under applicable laws and regulations. We are equally committed to ensuring that all our employees, service providers, and agents uphold these obligations. This policy explains how we manage personal data within our organization.</p><p><br></p><p>We collect personal data about you in the following ways:</p><p>where you register for an account or to receive emails from us;</p><p>when you order products or services from us</p><p>when you submit a query or request to us</p><p>when you respond to a survey that we run or fill in forms on one of our websites</p><p>by tracking your use of our websites and mobile applications</p><p>from public sources</p><p>from the examination of public and private blockchains</p><p>from third parties who are entitled to disclose that information to us</p><p>when you apply for a job with us</p><p>In some cases, we may be required by law to collect certain types of personal data about you.</p><p>Where we collect personal data from you, we will do so ourselves. However, in some cases, we may collect personal data from a third party, such as through your representatives, contractors who provide services to us, or third parties who refer you to us because they think you may be interested in our products or services.</p><p><br></p><p>Types of personal data we collect</p><p>The types of personal data that we collect and hold about you may include:</p><p><br></p><p>identifying information, such as your name and date of birth, as well</p><p>ID documentation such as a passport or other government-issued photo identification and proof of address documentation such as a utility bill or bank statement</p><p>contact information, such as your postal address, email address and telephone number</p><p>social media handles and other social media profile information that you make available to us or to the public</p><p>public financial information, such as credit card, bank account or other payment details, which DO NOT give access to you funds</p><p>blockchain identifiers, such as blockchain addresses and public keys</p><p>emails and passwords that you create when registering for an account with us</p><p>details of any products or services that we provide to you</p><p>information about how you use the products and services we provide</p><p>records of our communications with you, including any messages you send us</p><p>Without this information, we may not be able to provide you with our products or services (or with all of the features and functionality offered by our products or services) or to respond to queries or requests that you submit to us.</p><p><br></p><p>Purposes for which we use personal data</p><p>We use personal data that we collect about you for the following purposes:</p><p><br></p><p>to verify your identity when you are dealing with us</p><p>to determine your eligibility for any of our products or services</p><p>to determine your compliance with the terms and conditions that apply to any of our products or services and applicable law</p><p>to enable us to provide our products and services</p><p>to improve our website based on your information and feedback</p><p>to answer your queries and requests</p><p>to comply with our legal and regulatory obligations</p><p>to carry out market analysis and research</p><p>to monitor use of our products and services</p><p>to assess, maintain, upgrade and improve our products and services</p><p>to carry out education and training programs for our staff</p><p>to manage and resolve any legal or commercial complaints or issues</p><p>to carry out planning and forecasting activities and other internal business processes</p><p>to keep you informed about our activities, including by sending out newsletters</p><p>Direct marketing</p><p>We may from time to time use your personal data to send you marketing materials about products or services that we think you may be interested in (including in some cases products and services that are provided by a third party). We may not use your data unless we have received your consent. You can opt-out of receiving marketing communications from us by contacting us at csr@tokpiedex.com.</p><p><br></p><p>We may use your following personal data for direct marketing:</p><p><br></p><p>identifying information, such as your name and date of birth</p><p>contact information, such as your postal address, email address and telephone number</p><p>products and services portfolio information and demographic data held by us from time to time</p><p>We may use your personal data to market the following products and services to you:</p><p><br></p><p>creating, purchasing and trading digital assets</p><p>software and hardware wallets for holding digital assets</p><p>other products or services related to digital assets</p><p>If we use your personal data in any direct marketing communications, you have the right to request that we provide you with the source of that personal data. There is no fee for requesting this information. We will provide you with the source of the personal data unless it is impracticable or unreasonable to do so.</p><p><br></p><p>Please indicate your consent to receiving information relating to the above by contacting us at csr@tokpiedex.com.</p><p><br></p><p>We may also use and disclose your information for other purposes under your requests or instructions.</p><p><br></p><p>People to whom we disclose personal data</p><p>We may share personal data about you with:</p><p><br></p><p>your representatives, advisers, and others you have authorized to interact with us on your behalf</p><p>our staff who need the information to discharge their duties</p><p>related entities within our corporate group</p><p>our business partners, agents and service providers</p><p>prospective purchasers of all or part of our business or shares in our company or a related entity</p><p>professional advisers who we engage to provide advice on our business</p><p>government authorities who request us to disclose that information only due to a related court decision, or to other people as required by law</p><p>In some cases, the people to whom we disclose your personal information may be located overseas. Further, we may have servers located overseas. The jurisdictions in which these people and servers are likely to be located include Hong Kong, Georgia, Estonia, Russia, the United States of America, and the United Kingdom. There may not be in place data protection laws, which are substantially similar to or serve the same purposes as the applicable data privacy laws in Hong Kong. This means your personal information may not be protected to the same or similar level in Hong Kong. We will never sell your personal data to any third party.</p><p><br></p><p>Cookies</p><p>We use cookies to monitor and observe your use of our websites, compile aggregate data about that use, and provide you with a more effective service (which may include customizing parts of our websites based on your preferences and past activities on those websites). “Cookies” are small text files created and stored on your hard drive by your internet browser software, to hold relevant information about the web page you are currently viewing. Most internet browsers have a facility that will allow you to disable cookies altogether – please refer to your browser’s help menu to find out how to do this. While you will still be able to browse our websites with cookies disabled on your internet browser, some website functionality may not be available or may not function correctly.</p><p><br></p><p>Storage and security of personal data</p><p>We store the personal data that we collect in electronic databases, some of which may be held on our behalf by third party data storage providers. Sometimes we also keep hard copy records of this personal data in physical storage facilities. We use a range of physical and technical security processes and procedures to protect the confidentiality and security of the information that we hold, and we update these from time to time to address new and emerging security threats that you become aware of.</p><p><br></p><p>We also take steps to monitor access to and modification of your information by our staff, and ensure that our staff is aware of and properly trained in their obligations for managing your privacy.</p><p><br></p><p>Google Analytics</p><p>Our website uses Google Analytics, a web analytics service provided by Google, Inc. (“Google”). Google Analytics uses cookies to help the website analyze how users use our website.</p><p><br></p><p>The information generated by the cookie about your use of our website (including your IP address) will be transmitted to and stored by Google on servers in the United States. Google will use this information for the purpose of evaluating your use of the website, compiling reports on website activity for website operators and providing other services relating to website activity and internet usage. Google may also transfer this information to third parties where required to do so by law, or where such third parties process the information on Google’s behalf. Google will not associate your IP address with any other data held by Google.</p><p><br></p><p>You may refuse the use of cookies by selecting the appropriate settings on your browser, however, please note that if you do this, you may not be able to use the full functionality of our website. By using our website, you consent to the processing of data about you by Google in the manner and for the purposes set out above.</p><p><br></p><p>Retention of personal data</p><p>Your personal data will not be kept longer than required.</p><p><br></p><p>We may retain your personal data for 5 years. At our discretion, we may retain personal data for longer than the said period if we consider it necessary or desirable to do so to meet our legal or regulatory obligations.</p><p><br></p><p>Access and correction</p><p>If you want to access any of the personal data that we hold about you or to correct some aspect of it (e.g., because you think it is incomplete or incorrect), please contact our privacy compliance team using the contact details set out below. To protect the integrity and security of the information we hold, we may ask that you follow a defined access procedure, which may include steps to verify your identity. In certain cases, we may charge you an administration fee for providing you with access to the information you have asked for, but we will inform you of this before proceeding. There may be cases where we are unable to provide the information you request, such as where it would interfere with the privacy of others or result in a breach of confidentiality. In these cases, we will let you know why we cannot comply with your request.</p><p><br></p><p>Even if you do not request access to and/or correct your personal data held by us, if we are satisfied that, having regard to the reasons for which we hold your personal data, that personal data is inaccurate, incomplete, out-of-date, irrelevant or misleading, we may take reasonable steps to correct that information.</p><p><br></p><p>Your Consent</p><p>By using our site, providing personal data and using any of our products or services, you agree that:</p><p><br></p><p>you consent to this privacy policy, as updated from time to time; and</p><p>if you have provided personal data to us relating to any other person, you:</p><p>have a right to provide that information;</p><p>have provided a copy of this privacy policy, as updated from time to time, to that person; and</p><p>each such person has agreed to those terms.</p><p>Complaints</p><p>We try to meet the highest standards to protect your privacy. However, if you are concerned about the way in which we are managing your personal data and think we may have breached any applicable privacy laws or any other relevant obligation, please contact our privacy compliance team using the contact details set out below. We will make a record of your complaint and refer it to our internal complaint resolution department for further investigation. We will deal with the matter as soon as we can, and keep you informed of the progress of our investigation.</p><p><br></p><p>If we have not responded to you within a reasonable time or if you feel that your complaint has not been resolved to your satisfaction, you are entitled to make a complaint to the Hong Kong Privacy Commissioner for Personal Data.</p><p><br></p><p>Changes to this policy</p><p>We may make changes to this policy from time to time, to take into account changes to our standard practices and procedures or where necessary to comply with new laws and regulations. The latest version of this policy will always be available on our website.</p><p><br></p>', '0', '2023-08-08 16:11:29', 5, NULL);
INSERT INTO `t_option_rules` VALUES (100116, '1', 'en', '<p>Welcome to visit our products. Sonecoin (including services provided by App and other products, hereinafter referred to as \"products and services\") is developed and operated by sube (hereinafter referred to as \"we\"). Ensuring user data security and privacy protection is our top priority. This Privacy Policy sets out the data collected and how it is processed when you access and use our products and services.</p><p><br></p><p>Please be sure to carefully read and confirm that you fully understand all the rules and points of this privacy policy before continuing to use our products. Once you choose to use it, you are deemed to agree to the entire content of this privacy policy and agree to our collection and use of your information. related information. If you have any questions about this policy during the reading process, you can contact our customer service for consultation. Please contact us through yopmfa@gmail.com or the feedback method in the product. If you do not agree to the relevant agreement or any of its terms, you should stop using our products and services.</p><p><br></p><p>This Privacy Policy helps you understand the following:</p><p><br></p><p>1. How we collect and use your personal information;</p><p><br></p><p>2. How we store and protect your personal information;</p><p><br></p><p>3. How we share, transfer and publicly disclose your personal information;</p><p><br></p><p>4. How do we use cookies and other tracking technologies;</p><p><br></p><p>5. How do we handle the personal information of minors;</p><p><br></p><p>1. How we collect and use your personal information</p><p><br></p><p>Personal information refers to various information recorded electronically or in other ways that can identify a specific natural person or reflect the activities of a specific natural person, either alone or in combination with other information. According to the \"Network Security Law of the People\'s Republic of China\" and \"Information Security Technology Personal Information Security Specifications\" (GB/T 35273-2017) and other relevant laws and regulations, and strictly follow the principles of legitimacy, legality and necessity, for your Collect and use your personal information in the process of using the services and/or products we provide, including but not limited to phone numbers, email addresses, preferences and interests, etc.</p><p><br></p><p>In order to receive our comprehensive product services, you should first register a user account, through which we will record relevant data. All the information you provide comes from the data you provide during registration and the data we obtain from third-party partners. The account name, password, and your own contact information you are going to use, we may verify whether your identity is valid by sending text messages or emails.</p><p><br></p><p>2. How we store and protect your personal information</p><p><br></p><p>As a general rule, we only retain your personal information for as long as necessary to fulfill the purposes for which it was collected. We retain your personal information for as long as is strictly necessary to manage our relationship with you (for example, when you open an account, obtain services from our products). We may need to retain your personal information on file beyond the expiration of the above periods to comply with a legal obligation or to demonstrate that a right or contract satisfies applicable statute of limitations requirements and cannot be deleted at your request. We ensure that your personal data is completely deleted or anonymized when it is no longer necessary for the purposes or archives corresponding to our statutory obligations or statutory statute of limitations. If you confirm that you will no longer use our products and services, and actively cancel your account as required, all information will be completely deleted.</p><p><br></p><p>We use industry-standard security measures to protect the personal information you provide, and encrypt key data in it to prevent unauthorized access, public disclosure, use, modification, damage or loss. We will take all reasonable and feasible measures to protect your personal information. We will use encryption technology to ensure the confidentiality of data; we will use trusted protection mechanisms to prevent data from malicious attacks.</p><p><br></p><p>It is worth mentioning that in order to strengthen the protection of private data, we have desensitized it when collecting it, and even in our own database, we will not store associated private data in clear text.</p><p><br></p><p>3. How do we share, transfer and publicly disclose your personal information</p><p><br></p><p>When it is necessary to manage our daily business activities, we will use your personal information in a compliant and appropriate manner in order to pursue legitimate interests and better serve customers. Out of comprehensive consideration of business and various aspects, we will share this data with third-party partners, and this data will also comply with their privacy policies and will not be disposed of arbitrarily.</p><p><br></p><p>We may share your personal information externally in accordance with laws and regulations, or in accordance with the mandatory requirements of government authorities. Under the premise of complying with laws and regulations, when we receive the above request for information disclosure, we will require to issue corresponding legal documents, such as subpoenas or investigation letters. We firmly believe that we should be as transparent as the law allows about the information we are asked to provide.</p><p><br></p><p>In the following situations, sharing, transferring, and publicly disclosing your personal information does not require your prior authorization and consent:</p><p><br></p><p>1. Directly related to national security and national defense security;</p><p><br></p><p>2. Directly related to criminal investigation, prosecution, trial and execution of judgments;</p><p><br></p><p>3. For the protection of your or other personal life, property and other major legitimate rights and interests, but it is difficult to obtain the consent of the person;</p><p><br></p><p>4. Personal information that you disclose to the public by yourself;</p><p><br></p><p>5. Collecting personal information from legally disclosed information, such as legal news reports, government information disclosure and other channels.</p><p><br></p><p>6. It is necessary to sign and perform a contract according to the requirements of the personal information subject;</p><p><br></p><p>7. It is necessary to maintain the safe and stable operation of the products or services provided, such as discovering and handling product or service failures;</p><p><br></p><p>8. Other circumstances stipulated by laws and regulations.</p><p><br></p><p>4. How do we use cookies and other tracking technologies</p><p><br></p><p>In order to ensure the normal operation of the product, we will store a small data file called a cookie on your computer or mobile device. Cookies usually contain identifiers, product names and some numbers and characters. With the help of cookies, we can store data such as your preferences or products, and use them to determine whether registered users have logged in, improve service and product quality, and optimize user experience.</p><p><br></p><p>We use various cookies for different purposes, including: strictly necessary cookies, performance cookies, marketing cookies and functional cookies. Certain cookies may be served by external third parties to provide additional functionality to our products. We will not use cookies for any purpose other than those stated in this policy. You can manage or delete cookies according to your own preferences. You can clear all cookies saved on your computer or mobile phone, and most web browsers have the function of blocking or disabling cookies, and you can configure the browser. After blocking or disabling the cookie function, your use of our products and services may be affected or cannot be fully used.</p><p><br></p><p>V. How do we handle personal information of minors</p><p><br></p><p>Our products, websites and services are primarily intended for adults. Children may not create their own user accounts without the consent of a parent or guardian. For the collection of children\'s personal information with parental consent, we will only use or publicly disclose this information when permitted by law, with the explicit consent of parents or guardians, or when it is necessary to protect children.</p><p><br></p><p>If we discover that we have collected personal information from children without prior verifiable parental consent, we will try to delete the data as soon as possible. If you are the guardian of a minor, please contact us in time when you have any questions about the minor under your guardianship\'s use of our services or the user information provided to us. We will protect the confidentiality and security of minor user information in accordance with relevant national laws and regulations and this policy.</p>', '0', '2023-08-11 16:40:06', 0, NULL);
INSERT INTO `t_option_rules` VALUES (100117, 'U本位规则', 'zh', '<p>合约类型： U本位合约可以基于不同的加密货币，如BTC/USDT、ETH/USDT等。这些合约允许您以USDT来计价和交易这些加密货币的价格变动。</p><p><br></p><p>交易单位： 合约的交易单位通常以基础加密货币（如比特币、以太坊）为基准，例如，1个BTC/USDT合约可能等同于0.001 BTC。这取决于交易所和合约的具体设置。</p><p><br></p><p>合约大小： 合约大小指的是每个合约的价值，以USDT计价。它会随着基础加密货币的价格而变化。例如，BTC/USDT合约的大小可能是100 USDT，当比特币价格上涨或下跌时，合约大小会相应变化。</p><p><br></p><p>保证金和杠杆： 交易者需要提供一定数量的USDT作为保证金，以便在合约交易中承担亏损。不同的交易所和平台提供不同的杠杆倍数，允许交易者使用少量的保证金控制更大的头寸。</p><p><br></p><p>交易费用： 交易U本位合约通常会产生交易费用，这些费用可能包括开仓费、平仓费、过夜持仓费等，具体取决于交易所的政策。</p><p><br></p><p>结算和盈亏： 合约的盈亏计算以及每日的结算通常以USDT为单位。当您平仓或者每日结算时，盈利或亏损会计算并反映在您的USDT余额中。</p><p><br></p><p>合约到期： 有些合约可能有到期时间，到期时合约将被结算，持仓会被平仓。到期前，您可以选择续约或平仓。</p><p><br></p><p>请注意，具体的规则和设置可能因交易所而异，因此在交易之前，您应该仔细阅读交易所的U本位合约规则和用户协议，以确保您充分了解合约的特性、费用、风险以及交易所的政策。</p>', '0', '2023-08-16 15:59:25', 4, NULL);
INSERT INTO `t_option_rules` VALUES (100118, '币币交易规则', 'zh', '<p>币币交易是指一种数字资产对另外一种数字资产的交易，以ETH/USDT币对为例，ETH就是“交易货币”，USDT则是“计价货币”，可以理解为用USDT买ETH。</p><p><br></p><p>一、资金划转</p><p><br></p><p>在进行币币交易之前，需要先进行资金划转，把数字资产USDT划转到现货账户里。</p><p><br></p><p><strong>二、买入，卖出</strong></p><p><br></p><p><strong>以DOGE为例：</strong>打开APP，进入<strong>【交易】</strong>页面&nbsp;—&nbsp;点击左上角币对框<strong>【DOGE/USDT】；</strong>在新页面下点击切换交易模式-币币交易&nbsp;。</p><p>选择<strong>【买入】&amp;</strong>【卖出】—<strong>【限价委托】</strong>—&nbsp;输入<strong>【价格】、【数量】</strong>—点击<strong>【买入DOGE】</strong></p><p><br></p><p><strong>注：</strong>当市场价格达到用户预期，系统会以事前设置的委托价格送入市场中撮合成交。</p><p><br></p><p><br></p><p><br></p>', '0', '2023-08-16 16:00:28', 2, NULL);
INSERT INTO `t_option_rules` VALUES (100119, '服务条款', 'zh', '<p>PLATFORM_TITLE 用户协议</p><p><br></p><p>本协议（“协议”）适用于居住在美国、英国、欧洲经济区、日本和新加坡以外的客户。</p><p><br></p><p>在查看这些术语时，您会看到一些文本是绿色的。这些条款仅适用于 CB Payments, Ltd 向您提供的受监管服务，不适用于 PLATFORM_TITLE Kenya Limited 向您提供的服务。</p><p><br></p><p>CB Payments, Ltd（也以 PLATFORM_TITLE 名义交易）受英国金融行为监管局监管。</p><p><br></p><p>这是您与以下各方之间的合同：CB Payments, Ltd（“PLATFORM_TITLE Payments”）是一家在英格兰和威尔士注册成立的私人有限公司，公司编号为 09708629，注册办公地址为 5 Fleet Place, London EC4M 7RD, United Kingdom；和PLATFORM_TITLE Ascending Markets Kenya Limited（“PLATFORM_TITLEKenya”）是一家在肯尼亚注册成立的私人有限公司（公司编号 PVT-27U5Y39Y），注册办公地址为 P.O.邮政信箱 10643号信箱肯尼亚内罗毕。本协议中对“PLATFORM_TITLE”、“我们”、“我们的”或“我们”的引用是指 PLATFORM_TITLE Payments 和/或 PLATFORM_TITLE Kenya，具体取决于所讨论的服务，而对“您”或“您的”的引用是指PLATFORM_TITLE 与之签订本协议的人。通过 PLATFORM_TITLE.com 或 pro.PLATFORM_TITLE.com 或我们的任何关联网站、应用程序编程接口（“API”）或移动应用程序（统称“网站”）注册使用帐户，即表示您同意阅读、理解并接受本协议中包含的所有条款和条件，以及我们的隐私政策和 Cookie 政策。我们将电子货币服务、数字货币服务和附加服务（定义见下文）统称为“PLATFORM_TITLE 服务”，可通过 PLATFORM_TITLE 运营的平台（“PLATFORM_TITLE 平台”）（包括在线平台）访问可通过网站或 PLATFORM_TITLE 不时规定的位置访问）。只有在 PLATFORM_TITLE &lt;br&gt;Payments 自行决定提供电子货币服务时，才会自动提供对电子货币服务的访问。</p><p><br></p><p>如下文第 2 条所述，每项 PLATFORM_TITLE 服务均由 PLATFORM_TITLE Payments 或 PLATFORM_TITLE Kenya 提供。*您应该知道，交易或持有数字货币的损失风险可能很大。与任何资产一样，数字货币的价值可能会上升或下降，并且可能存在您在购买、出售、持有或投资数字货币时亏损的巨大风险。数字货币服务和附加服务目前不受金融行为监管局、肯尼亚中央银行或英国或肯尼亚任何其他监管机构的监管。数字货币服务和附加服务不在英国金融监察员服务的管辖范围内，您的数字货币和电子货币不受英国金融服务补偿计划的保护。根据肯尼亚中央银行 2015 年第 14 号通知，数字货币在肯尼亚不是法定货币，因此如果 PLATFORM_TITLE 面临财务困难，您无法获得任何保护。您应该根据您的财务状况仔细考虑交易或持有数字货币是否适合您。*</p><p><br></p><p>1. 资格。</p><p><br></p><p>要获得使用任何 PLATFORM_TITLE 服务的资格，您必须年满 18 岁并且居住在可以访问相关 PLATFORM_TITLE 服务的国家/地区。请注意，并非所有 PLATFORM_TITLE 服务在每个国家都可用。按国家/地区可访问的 PLATFORM_TITLE 服务列表可在 https://www.PLATFORM_TITLE.com/global 找到。</p><p><br></p><p>2. 服务。</p><p><br></p><p>2.1 电子货币服务。</p><p><br></p><p>PLATFORM_TITLE Payments 可能会向您提供以下服务（“电子货币服务”）：(A) 托管数字钱包（“电子货币钱包”），使您能够存储由 CB Payments 发行的以法定货币（“电子货币”）计价的电子货币；和</p><p><br></p><p>(B) 使您能够发送和接收电子货币的某些支付服务（如下所述）。</p><p><br></p><p>电子货币服务受英国金融行为监管局 (“FCA”) 监管。PLATFORM_TITLE Payments 是一家由 FCA 授权和监管的授权电子货币机构，注册号为 900635。对电子货币服务的访问不是自动的，只有在 PLATFORM_TITLE Payments 自行决定提供这些服务时才提供。</p><p><br></p><p>2.2 数字货币服务。</p><p><br></p><p>PLATFORM_TITLE Kenya 可能向您提供以下服务（“数字货币服务”）：</p><p><br></p><p>(A) 一个或多个托管数字货币钱包（“数字货币钱包”），使您能够存储、跟踪、转移和管理某些受支持的数字货币（如比特币或以太坊）的余额（统称为“数字货币”或“数字货币” ”);</p><p><br></p><p>(B) 一种数字货币兑换服务，使您能够获得购买和销售数字货币的价格，并且（受某些限制）执行网站上的任何此类购&lt;br&gt;买或销售（“数字货币兑换服务”）。与电子货币服务不同，数字货币服务不受监管。 PLATFORM_TITLE Kenya 不是受监管的金融服务提供商。 PLATFORM_TITLE Kenya 位于肯尼亚，并在肯尼亚提供服务。重要提示：PLATFORM_TITLE Kenya 不是受监管的金融服务提供商，未在肯尼亚中央银行、资本市场管理局或肯尼亚任何其他金融服务监管机构注册、监管或授权，因此您将无法利用与此类受监管实体相关的监管保护，例如投资者或存款保护计划。</p><p><br></p><p>2.3 其他 PLATFORM_TITLE 服务</p><p><br></p><p>除了核心服务（即电子货币服务和数字货币服务）之外，PLATFORM_TITLE Kenya（或 PLATFORM_TITLE 集团的其他成员，定义见第2.6 节）可能会提供以下服务（“附加服务”）下面）给满足某些资格标准的用户：</p><p><br></p><p>(A) 数字货币订单簿交换平台（详见附录 4）（“PLATFORM_TITLE Pro”）；</p><p><br></p><p>(B) PLATFORM_TITLE 提供的开发应用程序（详见附录 5）（“开发者工具”）；</p><p><br></p><p>(C) 质押服务（详见附录 6）（“质押服务”）。</p><p><br></p><p>2.4 若干责任。您同意 PLATFORM_TITLE Payments 和 PLATFORM_TITLE Kenya 在本协议项下的责任是单独的而不是连带的，并且 PLATFORM_TITLE Payments 和 PLATFORM_TITLE Kenya 各自仅对各自在本协议项下的义务以及他们对这些义务的任何违反承担责任义务。这意味着他们每个人都对您自己违反本协议的行为负责，而不是对彼此的违反行为负责。</p><p><br></p><p>2.5 费用。您同意负责支付并支付所有费用。 PLATFORM_TITLE 服务的完整费用清单（不时修订）可在网站的“定价和费用披露”和“交易费用”页面上找到，这些页面应构成本协议的一部分。</p><p><br></p><p>2.6 PLATFORM_TITLE 集团。在本协议中，“PLATFORM_TITLE 集团”是指 PLATFORM_TITLE Kenya 及其附属公司，包括提供数字货币存储和钱包服务的特拉华州公司 PLATFORM_TITLE, Inc.。此定义不包括仅提供电子货币服务的所有公司附属机构，包括但不限于 PLATFORM_TITLE Payments。</p><p><br></p><p>2.7 支付服务合作伙伴。 PLATFORM_TITLE 可能会使用第三方支付处理器或收款代理来处理您与 PLATFORM_TITLE 之间以相关国家/地区的相关中央银行发行的货币计价的任何付款，包括但不限于与相关的付款禁止您使用电子货币钱包或 PLATFORM_TITLE 账户中的数字货币交易或存款或取款。</p><p><br></p><p>3. 帐户设置。</p><p><br></p><p>3.1 PLATFORM_TITLE 账户注册。要使用 PLATFORM_TITLE 服务，您需要通过提供您的详细信息（包括您的姓名、电子邮件地址和密码）并接受本协议的条款来注册一个 PLATFORM_TITLE 帐户（“PLATFORM_TITLE 帐户”）。使用 PLATFORM_TITLE 帐户，即表示您同意并声明您将仅为自己使用 PLATFORM_TITLE 服务，而不代表任何第三方，除非您已根据本协议第 3.2 和 4.10 节事先获得 PLATFORM_TITLE 的批准。每个客户只能注册一个 PLATFORM_TITLE 帐户。您对在您的 PLATFORM_TITLE 账户下发生的所有活动负全部责任。我们可以自行决定拒绝为您开立 PLATFORM_TITLE 账户，或暂停或终止任何 PLATFORM_TITLE 账户（包括但不限于重复账户）或暂停或终止您账户中特定数字货币的交易。</p><p><br></p><p>3.2 第三方访问。如果在第 4.10 条允许的范围内，您明确允许受监管的第三方通过受监管的第三方的产品或服务或通过网站访问或连接到您的 PLATFORM_TITLE 账户，您承认授予许可受监管的第三方代表您采取特定行动并不免除您在本协议项下的任何责任。您对访问您的 PLATFORM_TITLE 账户的任何受监管第三方的所有作为或不作为负全部责任，并且该受监管第三方的任何行为均应被视为您授权的行为。此外，您承认并同意，您不会要求 PLATFORM_TITLE 对因访问您的 PLATFORM_TITLE 账户的任何受监管第三方的任何作为或不作为而产生或与之相关的任何责任承担责任，并将赔偿 PLATFORM_TITLE。您可以随时通过网站“设置”页面上的选项卡更改或删除您授予受监管第三方关于您的 PLATFORM_TITLE 帐户的权限。</p><p><br></p><p>3.3 身份验证。您同意向我们提供我们要求的信息（我们可以y 在任何认为必要的时候要求）用于身份验证和侦查洗钱、恐怖主义融资、欺诈或任何其他金融犯罪，包括附录 2（验证程序和限制）中规定的，并允许我们保留此类信息的记录。您需要先完成某些验证程序，然后才能开始使用 PLATFORM_TITLE 服务并访问特定的 PLATFORM_TITLE 服务，包括某些电子货币和数字货币的转移，并且适用于您使用 PLATFORM_TITLE 服务的限制可能是由于持续收集的信息而改变。我们要求的信息可能包括（但不限于）个人信息，例如您的姓名、居住地址、电话号码、电子邮件地址、出生日期、纳税人识别号、政府识别号、有关您的银行帐户的信息（例如银行名称、账户类型、路由号码和帐号）网络状态、客户类型、客户角色、计费类型、移动设备标识符（例如国际移动用户身份和国际移动设备身份）和其他用户状态详细信息，以及根据适用法律要求 PLATFORM_TITLE 不时收集的任何此类信息。您可能还需要进行“强化尽职调查”（见下文第 6.2 节），其中 PLATFORM_TITLE 可能会要求您提交有关您自己或您的业务的其他信息、提供相关记录并安排与 PLATFORM_TITLE 员工的会议，以便 PLATFORM_TITLE 可以：除其他外，确定您在使用 PLATFORM_TITLE 服务过程中进行的任何交易的财富来源和资金来源。在向我们提供此信息或可能需要的任何其他信息时，您确认该信息是真实、准确和完整的，并且您没有隐瞒任何可能影响 PLATFORM_TITLE 为您注册 PLATFORM_TITLE 帐户而对您的评估的信息或向您提供 PLATFORM_TITLE 服务。您承诺及时以书面形式通知并向 PLATFORM_TITLE 提供有关可能导致所提供的任何此类信息变得虚假、不准确或不完整的任何情况变化的信息，并承诺提供 PLATFORM_TITLE 可能要求的任何其他额外文件、记录和信息和/或适用法律。您允许我们保留此类信息的记录。我们将根据第 11 条（数据保护）处理这些信息。您授权我们直接或通过第三方进行我们认为必要的查询，以验证您的身份或保护您和/或我们免受欺诈或其他金融犯罪，并根据此类结果采取我们合理认为必要的行动查询。当我们进行这些查询时，您承认并同意您的个人信息可能会被披露给信用参考和欺诈预防或金融犯罪机构，并且这些机构可能会全面回应我们的查询。这只是身份检查，不会对您的信用评级产生不利影响。此外，我们可能会要求您在交易完成后等待一段时间，然后才能允许您使用更多的 PLATFORM_TITLE 服务和/或允许您进行超出特定交易量限制的交易。</p><p><br></p><p>4. 电子货币服务</p><p><br></p><p>4.1 加载。您可以使用银行转账（或网站上适用于您所在位置的其他付款方式）将资金存入您的 E-Money 钱包，一旦我们收到资金，您的 E-Money 钱包将显示已加载的资金。资金的加载可以手动完成，也可以作为您在 PLATFORM_TITLE 账户上设置的定期交易的一部分（有关更多详细信息，请参见下文第 5.12 节）。您只能从您自己的账户中加载您自己的资金，而不能从任何联合、集合或第三方账户中加载。当资金被加载到 E-Money 钱包中时，PLATFORM_TITLE Payments 将向您发放 E-Money，代表您已加载的资金。电子货币钱包不是存款或投资账户，这意味着您的电子货币将不受金融服务补偿计划的保护。 PLATFORM_TITLE Payments 只会将来自用户的资金存放在受监管金融机构的指定保管账户中。电子货币钱包中的电子货币不会赚取任何利息。您的电子货币钱包可能持有以不同货币计价的电子货币，我们将显示您持有的每种货币的电子货币余额。</p><p><br></p><p>4.2 购买或出售数字货币。您可以使用记入您的电子货币钱包的电子货币购买支持的数字货币。要使用电子货币进行数字货币交易，您必须遵循网站上的相关说明。使用电子货币的数字货币交易通常应在我们收到您的指示后的一个工作日内结算。你授权我们从您的电子货币钱包中扣除电子货币。尽管我们将尝试尽快向您交付数字货币，但在将数字货币交付到您的数字货币钱包之前，电子货币可能会从您的电子货币钱包中扣除。您可以出售数字货币以换取电子货币。您授权我们从您的数字货币钱包中借记，并在您的电子货币钱包中记入相关金额的电子货币。</p><p><br></p><p>4.3 收到指令。如果我们在非工作日或工作日下午 4:30（伦敦时间）之后收到您使用 E-Money 购买数字货币的指示，我们可能会将这些指示视为我们在以下时间收到的指示营业日。</p><p><br></p><p>4.4 撤销。当您向我们指示使用电子货币进行数字货币交易时，您不能撤回对该数字货币交易的同意，除非数字货币交易要到未来的约定日期才会发生，例如如果您已设置未来交易（有关详细信息，请参阅下文第 5.12 节）。在未来交易的情况下，您可以在未来交易到期日的前一个工作日结束之前撤回您的同意。要撤回您对未来交易的同意，请按照网站上的说明进行操作。</p><p><br></p><p>4.5 不成功的付款。如果将资金存入您的电子货币钱包的付款不成功，您授权 PLATFORM_TITLE 自行决定取消任何相关的数字货币交易或从您的其他付款方式（包括 PLATFORM_TITLE 余额或其他关联账户）中扣除完成相关数字货币交易所需的任何金额。您有责任保持足够的余额和/或足够的信用额度，以避免透支或支付提供商收取的类似费用。</p><p><br></p><p>4.6 账户信息。您将能够使用本网站查看您的电子货币钱包余额和交易历史记录，包括 (i) 每次数字货币购买的金额（和货币），(ii) 识别付款人和/或收款人的参考（视情况而定），(iii) 收取的任何费用（包括费用明细），(iv) 进行货币兑换的情况、兑换率以及兑换后的金额（以新货币计）（您所在的地方）付款人）或兑换前的金额（以原始货币计）（您是收款人），以及 (v) 每笔数字货币购买的借记或贷记日期（视情况而定）。</p><p><br></p><p>4.7 兑换电子货币。您可以随时通过选择网站中的相关选项并按照说明赎回您的电子货币钱包中的全部或部分电子货币。除非另有约定，否则资金将转入您在我们注册的银行账户。如果本协议终止，我们将赎回您 E-Money 钱包中剩余的任何 E-Money，并尝试将资金转入您在我们注册的银行账户。在从您的电子货币钱包中兑换电子货币之前，我们可能会根据适用法律的要求进行检查，以防止欺诈、洗钱、恐怖主义融资和其他金融犯罪。这可能意味着您将被阻止或延迟提取 E-Money，直到这些检查以我们合理的满意程度完成以符合我们的监管要求。</p><p><br></p><p>4.8 未经授权和不正确的交易。如果使用您的凭证从您的电子货币钱包开始购买数字货币和/或赎回电子货币，除非您另行通知我们，否则我们将假定您授权了此类交易。如果您认为使用您的电子货币钱包进行了未经您授权的交易（“未经授权的交易”），或者如果您有理由相信使用您的电子货币钱包的交易被错误地执行或不完整（“错误交易”），您必须尽快联系我们，无论如何不得迟于发生未经授权的交易或错误交易后的 13 个月。请务必定期检查您的电子货币钱包余额和交易历史记录，以确保识别任何未经授权的交易或不正确的交易并尽早通知我们。我们不对未经授权的交易或错误交易的任何索赔负责，除非您已根据本第 4.8 条通知我们，在这种情况下，下文第 4.9条规定了我们各自的责任。如下文第 4.9 节进一步所述，如果您以欺诈、故意或重大过失行为而导致未经授权的交易或不正确的交易，我们不对未经授权的交易或不正确的交易提出的任何索赔负责在对任何实际或潜在的未经授权的交易或不正确的交易进行任何调查期间，我们保留暂停您的 PLATFORM_TITLE 帐户以避免进一步的损失。</p><p><br></p><p>4.9 退款权利。</p><p><br></p><p>(A) 未经授权的交易 - 电子货币钱包。</p><p><br></p><p>如果由于我们的失败而在您的电子货币钱包中发生未经授的交易，我们将在得知未经授权的交易后的下一个工作日结束之前退还您该交易的金额并恢复您的电子货币如果未发生未经授权的交易，货币钱包将处于的状态。一般而言，在您将未经授权的交易通知我们或我们未能在任何时候向您提供通知我们的方式后发生的损失，您将不承担任何责任。您将承担因使用丢失或被盗凭证而在您的电子货币钱包中发生的未经授权交易（例如，当您未能保留您的登录详细信息时）造成的任何损失的前 35 英镑PLATFORM_TITLE 帐户安全），并且如果您存在欺诈行为，或者您故意或疏忽未能履行您在本协议下的义务，这会导致您的电子货币钱包中出现未经授权的交易（例如，如果您故意与第三方，或在保护您的电子邮&lt;br&gt;件和密码安全方面存在严重疏忽，在这两种情况下（第 3.2 和/或 4.10 节除外），您将对因任何此类未经授权的交易而产生的所有损失承担责任，不仅仅是第一个 35 英镑。</p><p><br></p><p>如果我们与您之间就交易是否为未经授权的交易存在争议，我们可以（但没有义务）在解决争议期间暂时记入您的电子货币钱包。如果我们确定交易已获授权，我们可能会在不事先通知您的情况下撤销该信用并纠正在 E-Money Wallet 的任何声明中出现的错误，但请注意，在此期间您的 E-Money Wallet 可能会被暂时锁定以避免进一步的未经授权的交易。对于您转移的任何暂时记入您的 E-Money 钱包的 E-Money，您还将对我们负责（作为债务）。</p><p><br></p><p>(B) 错误交易 - 电子货币钱包。</p><p><br></p><p>如果由于我们的行为或错误而在您的电子货币钱包中进行了不正确的交易，我们将立即向您退还该交易的金额，并将您的电子货币钱包恢复到原本的状态未发生不正确的交易。我们还将尽可能向您提供合理的通知。我们还将支付我们负责的任何费用，以及您可以证明您因任何不正确交易而必须支付的任何利息。无论我们承担何种责任，根据您的要求，我们将尝试免费追踪您发起的任何错误交易。但是，我们不能保证我们将能够追踪此类交易。</p><p><br></p><p>4.10 受监管第三方的任命。如第 3.2 节所述，您可以指定受适当监管的第三方访问您的电子货币钱包（“受监管的第三方”）。如果您这样做，您应该知道，通过此类访问，受监管的第三方可能会访问您的交易和其他数据，和/或可能会从您的电子货币钱包发起转账。您将对任何受监管的第三方对您的 PLATFORM_TITLE 账户采取的任何行动负责，如上文第 3.2 节所述。我们保留拒绝访问任何受监管第三方的权利，如下文第 4.11 节所述。</p><p><br></p><p>4.11 拒绝与受监管的第三方打交道。根据适用法律的要求，我们可能会出于客观合理且有充分证据的原因拒绝访问受监管的第三方，这些理由与未经授权或欺诈性访问您的电子货币钱包、洗钱、恐怖主义融资、欺诈或任何其他金融犯罪有关。在这种情况下，除非适用法律禁止我们，否则我们将通知您受监管第三方的访问已被拒绝以及原因。一旦我们确信拒绝访问的原因不再存在，我们将再次允许访问。</p><p><br></p><p>4.12 同意。通过在我们这里开设 PLATFORM_TITLE 账户，您明确同意我们向您提供支付服务（即电子货币服务）。您可以随时通过关闭您的 PLATFORM_TITLE 帐户来撤销此同意。为免生疑问，本同意与我们根据数据保护法律法规处理您的个人信息或您的权利无关。请参阅下文第 11 节（数据保护）和我们的隐私政策，了解我们如何处理您的个人数据以及您在这方面拥有的权利。</p><p><br></p><p>4.13 金融监察员服务。如果您对 PLATFORM_TITLE Payments 向您提供的电子货币服务提出投诉，并且该投诉无法通过第 10.2节中规定的争议程序解决，您可以采取向金融申诉专员服务(“FOS”) 提出的未解决的投诉。您同意，在第 10.2 条规定的争议程序完成之前，您不会向 FOS 提出投诉。您可以使用以下详细信息找到有关 FOS 以及有资格向 FOS 提交问题的投诉人类型的更多信息：</p><p><br></p><p>地址：金融监察员服务，交易塔，海港交易所，伦敦，E14 9SR</p><p><br></p><p>电话：0800 023 4567 或 0300 123 9 123</p><p><br></p><p>电子邮件：complaint.info@financial-ombudsman.org.uk</p><p><br></p><p>网站：http://www.financial-ombudsman.org.uk</p><p><br></p><p>5. 数字货币服务。</p><p><br></p><p>5.1 总则。您的数字货币钱包使您能够通过网站发出指令，向 PLATFORM_TITLE 平台以外的其他用户或第三方发送数字货币，并向其请求、接收和存储数字货币（每笔此类交易都是“数字货币交易” ）。数字货币兑换服务使您能够使用以下方式在 PLATFORM_TITLE 平台上购买数字货币：(A) 来自您与 PLATFORM_TITLE Payments 一起持有的 E-Money 钱包中的 E-Money；</p><p><br></p><p>(B) PLATFORM_TITLE 支持的央行发行的货币（如英镑或欧元）；和/或</p><p><br></p><p>(C) 您的数字货币钱包中的其他类型的数字货币。相反，当您在 PLATFORM_TITLE 平台上出售数字货币时，您可以选择接收：</p><p><br></p><p>(D) 将电子货币存入您使用 PLATFORM_TITLE Payments 持有的电子</p><p><br></p><p>货币钱包；</p><p><br></p><p>(E) PLATFORM_TITLE 支持的央行发行货币（如英镑或欧元）；和/或</p><p><br></p><p>(F) 您的数字货币钱包中的其他类型的数字货币。PLATFORM_TITLE 促进并支持其客户在 PLATFORM_TITLE 平台上购买和销售数字货币。</p><p><br></p><p>5.2 法定货币交易（不使用您的电子货币钱包）。您可以通过将有效的付款方式链接到您的数字货币钱包来购买支持的数字货币。您授权我们使用您选择的付款方式借记资金以完成您的购买。尽管我们会尝试尽快向您交付数字货币，但在您的数字货币交易状态显示为完成之前，可能会从您选择的付款方式中扣除资金，并且数字货币将被交付到您的数字货币钱包中。您可以出售数字货币以换取 PLATFORM_TITLE 支持的法定货币（如英镑或欧元）。在这种情况下，您授权我们从您的数字货币钱包中扣款并发送指令以记入您选择的付款方式以结算卖出交易。我们将尽快发送这些说明。在我们发送此类指示后的工&lt;br&gt;作日结束前，任何法定货币都应记入您选择的付款方式。</p><p><br></p><p>5.3 交易履行。我们将尽合理努力完成对数字货币的所有购买，但在某些情况下，我们可能无法做到。如果是这种情况，我们将通知您并寻求您的批准，以按照当前汇率（定义如下）重新尝试购买。</p><p><br></p><p>5.4 付款方式的可用性。支付方式的可用性取决于许多因素，例如，您所在的位置、您提供给我们的身份信息以及第三方支付处理商施加的限制。</p><p><br></p><p>5.5 转换费。每次购买或出售数字货币都需要支付费用（“兑换费”）。适用的转换费将在每次交易前在网站上显示给您，并在我们向您发出的每张收据中说明。我们可以随时调整我们的转换费。如果转换费和任何其他相关费用加起来超过您的交易价值，我们将不会处理交易。可以在我们的定价和费用披露页面上找到 PLATFORM_TITLE Kenya 费用的完整列表。</p><p><br></p><p>5.6 汇率。每次购买或出售数字货币也受给定交易的汇率影响。 “汇率”是指网站上以法定货币表示的给定受支持数字货币的价格。汇率以“买入价”或“卖出价”表示，即您可以分别买入或卖出数字货币的价格。您承认在任何给定时间买入价汇率可能与卖出价汇率不同，并且我们可能会在报价汇率上增加保证金或“点差”。当您授权交易时，您同意接受汇率。您可以在网站上的“定价和费用披露”页面上了解有关 PLATFORM_TITLE Kenya 汇率的更多信息。我们不保证任何汇率的可用性。我们不保证您能够以任何特定价格或时间在公开市场上购买和/或出售您的数字货币。</p><p><br></p><p>5.7 授权；逆转；取消。通过单击网站上的“购买”或“出售”按钮，您授权 PLATFORM_TITLE 以报价的买入价或卖出价启动交易，并同意任何合作伙伴d 转换费和兑换费以及任何其他费用。您不能取消、撤销或更改任何标记为已完成或待处理的交易。如果您的付款不成功或您的付款方式资金不足，您授权我们自行决定取消交易或从您的其他付款方式中扣除，包括您的电子货币钱包和/或数字货币上的余额钱包，以完成交易所需的任何金额。您有责任保持足够的余额和/或足够的信用额度，以避免您的支付提供商收取透支、资金不足或类似费用。 PLATFORM_TITLE 保留暂停访问 PLATFORM_TITLE 服务（包括 PLATFORM_TITLE 消费者、PLATFORM_TITLE Pro）的权利，直到此类付款不足得到解决。</p><p><br></p><p>5.8 数字货币交易。我们将根据您收到的指示处理数字货币交易。在向我们提交指示之前，您应核实所有交易信息。我们不保证任何用户、接收者、被请求者或其他第三方的身份，并且我们不承担确保您提供的信息准确和完整的责任或&lt;br&gt;义务。数字货币交易一旦被广播到相关的数字货币网络就不能被撤销。如果您通过输入收款人的电子邮件地址或手机号码发起数字货币交易，而收款人没有现有的 PLATFORM_TITLE 账户，我们将邀请收款人开设 PLATFORM_TITLE 账户。如果收款人未在 30 天内开设 PLATFORM_TITLE 账户，我们会将相关数字货币退还至您的数字货币钱包。我们可能会收取网络费用（“矿工费”）以代表您处理数字货币交易。我们将自行决定计算矿工费用，但我们将始终在您授权数字货币交易时（或之前）通知您矿工费用。 PLATFORM_TITLEKenya 矿工费用的完整列表可以在我们网站上的“定价和费用披露”页面上找到。每笔交易的矿工费将在结帐页面上购买时向您披露。当您或第三方从非 PLATFORM_TITLE 托管的外部钱包向 PLATFORM_TITLE 数字货币钱包发送数字货币时，发起交易的人全权负责正确执行交易，其中可能包括支付矿工费以使交易顺利完成。不支付矿工费可能会导致您的交易处于 PLATFORM_TITLE Kenya 无法控制的待处理状态，我们不对因交易启动错误而导致的延迟或损失负责，也没有义务协助此类交易的补救措施。一旦提交到数字货币网络，数字货币交易将在一段时间内未经确认，等待数字货币网络对交易进行充分确认。处于待处理状态的数字货币交易未完成。与处于待处理状态的数字货币交易相关的数字货币将被相应地指定，并且在网络确认之前不会包含在您的数字货币钱包余额中或可用于进行数字货币交易。我们也可以根据法律、法规或 PLATFORM_TITLE 在任何司法管辖区受其管辖的任何法院或其他机构的要求拒绝处理或取消任何待处理的数字货币交易，例如，如果存在洗钱、恐怖主义融资、欺诈、或任何其他金融犯罪。</p><p><br></p><p>5.9 支持的数字货币。我们的数字货币服务仅适用于PLATFORM_TITLE 支持的数字货币（“支持的数字货币”），并且可能会不时更改。在任何情况下，您都不应尝试使用您的数字货币钱包以我们不支持的任何形式存储、发送、请求或接收数字货币。对于将您的数字货币钱包用于我们不支持的数字货币的任何尝试，我们不承担任何责任或义务。您承认并同意 PLATFORM_TITLE 对发送到与您的 PLATFORM_TITLE 账户关联的钱包的任何不受支持的资产不承担任何责任且不承担任何责任。如果您对我们目前支持的数字货币有任何疑问，请访问 https://help.PLATFORM_TITLE.com。</p><p><br></p><p>5.10 结束对数字货币的支持。 PLATFORM_TITLE 可自行决定终止对任何数字货币的支持。 PLATFORM_TITLE 将通过电子邮件向与您的PLATFORM_TITLE 帐户关联的电子邮件地址至少提前 10 天通知您（除非适用法律或监管机构要求更短的期限），以宣布终止此类支持。如果你不在此期间在平台外出售或发送此类数字货币，PLATFORM_TITLE 保留从您的账户中提取此类数字货币并将支持的数字货币或法定货币的市场价值记入您的 PLATFORM_TITLE 账户的权利（面额将在我们的合理的自由裁量权）。</p><p><br></p><p>5.11 USDC 钱包。如果可用，您还可以选择通过 PLATFORM_TITLE购买 USD Coin，这是一种完全由美元抵押的数字货币，由 Circle Internet Financial（“Circle”）发行并由 PLATFORM_TITLE（“USDC”）提供支持。您是您的“USDC 钱包”余额的所有者（即 PLATFORM_TITLE Kenya 提供给您的用于持有 USDC 并可以进行 USDC 中的数字货币交易的数字货币钱包）。 PLATFORM_TITLE 不是 USDC 的发行人，不为 USDC 持有者持有美元（“USD”）储备，也没有义务以美元回购您的 USDC。您可以通过 Circle 兑换您的 USDC，PLATFORM_TITLE 也可以选择回购您的 USDC 以换取美元。您同意受 Circle USDC 协议（位于 https://support.usdc.circle.com/hc/en-us/articles/360001233386-Circle-USDC-User-Agreement）条款的约束，该协议提供了额外的有关 USDC 的义务、承诺和限制。</p><p><br></p><p>5.12 经常性数字货币交易。如果您设置了数字货币的定期购买（“未来交易”），您授权我们根据您选择的数字货币交易和任何相应的支付账户（例如直接借记或贷记）发起定期电子支付，您关联的银行账户。您的未来交易将根据您选择的时间段（例如，每天、每周、每月）以相同的定期分期付款进行，直到您或 PLATFORM_TITLE 取消未来交易。如果您选择银行账户作为您未来交易的付款方式，并且该交易发生在相关银行所在地区的周末或公共假期，或相关银行的营业时间之后，则贷记或借记将被在下一个工作日执行，但将收取定期交易时的数字货币费用。如果您的银行无法处理对 PLATFORM_TITLE 的任何付款，我们将通知您取消交易，并可能利用本协议中规定的补救措施来追回欠 PLATFORM_TITLE 的任何金额。在您更改未来交易设置或通过 https://help.PLATFORM_TITLE.com 向我们提供书面通知之前，此授权将保持完全有效。您同意在未来交易之前以书面形式通知PLATFORM_TITLE 您关联的银行账户信息的任何更改。PLATFORM_TITLE 可以随时通过向您发出通知来终止未来交易。</p><p><br></p><p>5.13 补充协议除外。除非在网站上明确宣布或通过 PLATFORM_TITLE 的官方公开声明或本协议中规定的其他方式，否则受支持的数字货币不包括补充或与受支持的数字货币交互的所有其他协议和/或功能。此排除包括但不限于：元币、彩色硬币、侧链或其他衍生、增强或分叉协议、代币或硬币或其他功能，例如质押、协议治理和/或任何智能合约功能，可能补充或与支持的数字货币交互（统称为“补充协议”）。请勿使用您的 PLATFORM_TITLE 帐户尝试接收、请求、发送、存储或参与任何其他类型的交易或涉及任何此类补充协议的功能，因为 PLATFORM_TITLE 平台未配置为检测、保护或处理这些交易和功能。对此类物品的任何尝试交易都将导致该物品丢失。您承认并同意，除本协议中的规定外，补充协议被排除在受支持的数字货币之外，并且 PLATFORM_TITLE 对与补充协议相关的任何损失不承担任何责任。</p><p><br></p><p>5.14 数字货币协议的操作。我们不拥有或控制管理我们平台上支持的数字货币操作的底层软件协议。一般来说，底层协议是“开源的”，任何人都可以使用、复制、修改和分发它们。我们对底层协议的运行不承担任何责任，我们无法保证网络运行的功能性或安全性。您承认并接受与您存储在您的数字货币钱包中的任何数字货币相关的底层软件协议可能发生变化的风险。特别是，底层协议可能会受到操作规则（包括“分叉”）突然变化的影响。任何此类重大运营变更都可能对可用性、价值、功能和/或 t 的名称产生重大影响您存储在数字货币钱包中的数字货币。 PLATFORM_TITLE 不控制这些重大运营变化的时间和特征。您有责任让自己了解即将发生的运营变化，并且在确定是否继续使用您的 PLATFORM_TITLE 账户以受影响的数字货币进行交易时，您必须仔细考虑公开可用的信息和 PLATFORM_TITLE可能提供的信息。如果发生任何此类运营变更，PLATFORM_TITLE 保留采取必要措施保护 PLATFORM_TITLE 平台上持有的资产的安全性的权利，包括暂时中止相关数字货币的运营，以及其他必要的步骤； PLATFORM_TITLE 将尽最大努力通知您其对任何重大运营变更的响应；但是，此类更改不在 PLATFORM_TITLE 的控制范围内，并且可能在不通知 PLATFORM_TITLE 的情况下发生。 PLATFORM_TITLE对任何重大运营变更的回应均由其自行决定，包括决定不支&lt;br&gt;持任何新的数字货币、分叉或其他行动。您承认并接受对数字货币协议进行操作更改的风险，并同意 PLATFORM_TITLE 不对此类操作更改负责，也不对因操作规则的此类更改而可能导致的任何价值损失承担责任。您承认并接受 PLATFORM_TITLE 有权自行决定其对任何运营变化的响应，并且我们没有责任帮助您处理不受支持的货币或协议。</p><p><br></p><p>5.15 某些数字货币的可替代性。您承认并同意 PLATFORM_TITLE 可以通过多种不同方式在您的数字货币钱包中保存受支持的数字货币，包括跨多个区块链协议，例如第二层网络、替代第一层网络或侧链。就其在您的数字货币钱包中持有受支持的数字货币而言，PLATFORM_TITLE 可以将此类数字货币从主要区块链协议中转移出来，并将此类数字货币保存在由 PLATFORM_TITLE 控制的共享区块链地址上，以与此类兼容的形式在替代区块链协议上协议。您同意跨多个区块链协议持有和提供的所有形式的相同数字货币可被视为可互换且彼此等价，无论 (a) 是否包含任何形式的此类数字货币或 (b ) 存储任何形式的此类&lt;br&gt;数字货币的区块链协议。</p><p><br></p><p>5.16 数字货币存储和传输延迟。 PLATFORM_TITLE 集团以在线和离线存储相结合的方式安全地存储数字货币私钥。我们的安全协议可能会延迟数字货币交易的启动或记入。</p><p><br></p><p>5.17 第三方付款。对于您可能从任何第三方（包括使用数字货币服务）。我们不负责确保与您进行交易的第三方买方或卖方将完成交易或被授权这样做。如果您在使用数字货币服务从任何第三方购买或出售给任何第三方的任何商品或服务遇到问题，或者如果您与该第三方有争议，您应直接与该第三方解决争议派对。如果您认为第三方的行为具有欺诈性、误导性或不当行为，或者您无法充分解决与第三方的争议，您可以通过以下方式通知 PLATFORM_TITLE 支持：trust@PLATFORM_TITLE.com，以便我们考虑采取何种措施采取，如果有的话。</p><p><br></p><p>5.18 PLATFORM_TITLE 保险库。 PLATFORM_TITLE 不支持使用多重签名保险库。您可以选择使用其他服务，例如 PLATFORM_TITLE Vault，它允许您设置提款时间延迟，并围绕您的数字货币的保管和转移创造其他条件。可能适用与此类产品和服务相关的其他规则。有关 PLATFORM_TITLE Vault 的更多信息，请访问：https://help.PLATFORM_TITLE.com/customer/en/portal/articles/2877996-vaults-faq?b_id=13521。</p><p><br></p><p>5.19 数字货币标题。您的数字货币钱包中持有的所有数字货币都是 PLATFORM_TITLE 集团在托管基础上为您的利益而持有的资产。除其他外，这意味着：</p><p><br></p><p>(A) 数字货币的所有权应始终归您所有，不得转让给 PLATFORM_TITLE 集团的任何公司。作为您数字货币钱包中数字货币的所有者，您应承担该数字货币丢失的所有风险。 PLATFORM_TITLE 集团内的任何公司均不对您的数字货币钱包中持有的数字货币的法定货币价值的波动承担任何责任。</p><p><br></p><p>(B) 您的 Digital Cu 中没有任何数字货币rrency 钱包是PLATFORM_TITLE 的财产，或者应该或可能被借给 PLATFORM_TITLE；PLATFORM_TITLE 不会将用户数字货币钱包中的资产表示或视为属于 PLATFORM_TITLE。 PLATFORM_TITLE 不得授予您的数字货币钱包中持有的数字货币的担保权益。除非表面上有效的法院命令要求，或本协议另有规定，否则 PLATFORM_TITLE 不会出售、转让、借出、抵押或以其他方式转让您的数字货币钱包中的数字货币，除非您指示或有管辖权的法院强制这样做。</p><p><br></p><p>(C) 您控制您的数字货币钱包中持有的数字货币。在任何时候，根据中断、停机时间和其他适用政策，您可以通过将您的数字货币发送到您或第三方控制的不同区块链地址来提取您的数字货币。</p><p><br></p><p>(D) 为了更安全地持有客户数字货币，PLATFORM_TITLE 集团可以使用由 PLATFORM_TITLE 集团成员控制的共享区块链地址来持有代表客户和/或代表 PLATFORM_TITLE 肯尼亚持有的数字货币。客户的数字货币与 PLATFORM_TITLE 集团（包括 PLATFORM_TITLE 肯尼亚）自己的数字货币或资金通过客户和 PLATFORM_TITLE 集团账户的单独分类帐分录分开。尽管有上述规定，PLATFORM_TITLE 集团没有任何义务使用不同的区块链地址来存储您拥有的数字货币和其他客户或 PLATFORM_TITLE 集团拥有的数字货币。如果任何数字货币、密码或私钥丢失、被盗、故障、毁坏或以其他方式无法访问，PLATFORM_TITLE 没有义务发行任何替代数字货币。</p><p><br></p><p>5.20 高级交易。 PLATFORM_TITLE 在 https://www.PLATFORM_TITLE.com/（“高级交易”）上提供各种数字货币和法定货币交易对（每个“订单簿”）的订单簿，符合条件的用户可以访问。查看您的 PLATFORM_TITLE 账户以查看高级交易中可用的订单簿。 PLATFORM_TITLE 不向所有司法管辖区的客户提供高级交易。通过访问 Advanced Trading 或 PLATFORM_TITLE API for Advanced Trading，您接受并同意受交易规则的约束</p><p><br></p><p>(A) 交易费用。通过在 Advanced Trading 下订单，您同意支付所有适用费用并授权 PLATFORM_TITLE 直接从您的账户中自动扣除费用。交易费用在交易规则中有规定。</p><p><br></p><p>(B) 提款费用。 PLATFORM_TITLE 可能会对某些法定货币存款或取款方式（例如银行电汇）收取费用。存款和取款可能会受到限制。</p><p><br></p><p>(C) 交易账户使用。您不得向任何其他实体或非您的雇员或代理人的任何个人出售、出租、提供或以其他方式允许或提供您的交易账户的访问权。您对您的员工或代理人使用 Advanced Trading 承担全部责任，无论这种使用是直接通过 PLATFORM_TITLE 还是通过其他方式，例如通过 API 密钥和/或您可能授权的应用程序促进的方式。您理解并同意您对任何和所有进入高级交易的订单、交易和其他指令负责，包括与您的账户相关的标识符、权限、密码和安全代码。</p><p><br></p><p>(D) 暂停和取消。如果您的帐户被暂停或终止，我们将立即&lt;br&gt;取消与您的帐户相关的所有未结订单，阻止所有提款并禁止下进一步的订单，直到解决或帐户取消为止。</p><p><br></p><p>6. 交易限制和加强尽职调查</p><p><br></p><p>6.1 交易限制。所有 PLATFORM_TITLE 服务的使用均受交易量限制，以英镑、欧元或其他法定货币或数字货币表示，您可以在给定时间段内（例如每天）进行交易或转账。请参阅附录 2（验证程序和限制）了解更多详细信息。要查看您的限制，请登录您的 PLATFORM_TITLE 帐户并访问 https://&lt;br&gt;www.PLATFORM_TITLE.com/verifications。您的交易限额可能会因您的付款方式、您已完成的验证步骤以及其他因素而有所不同。我们保留在我们认为必要时更改适用限制的权利。如果您希望将限额提高到超出公布的金额，您可以在 https://help.PLATFORM_TITLE.com 提交请求</p><p><br></p><p>6.2 加强尽职调查。如果您希望提高限制，我们可能会要求您提交有关您自己或您的业务的其他信息、提供记录并安排与 PLATFORM_TITLE 员工的会议（“加强尽职调查”）。我们保留向您收取与此类增强尽职调查相关的成本和费用的权利，但如果我们打算这样做，我们会提前通知您，以便您决定是否希望继续该请求。根据我们的判断，我们可能会拒绝提高您的限制，或者即使您已完成增强尽职调查，我们也可能会在以后降低您的限制。</p><p><br></p><p>7.S暂停使用、终止和取消。</p><p><br></p><p>7.1 暂停、终止和取消。我们可以：(a) 拒绝完成或搁置、阻止、取消或撤销您授权的交易（即使从您的 PLATFORM_TITLE 账中扣除资金之后），(b) 暂停、限制或终止您访问任何或所有 PLATFORM_TITLE 服务，和/或 (c) 出于任何原因立即停用或取消您的 PLATFORM_TITLE 帐户，包括但不限于：</p><p><br></p><p>(A) 我们有理由相信我们需要这样做以保护我们的声誉；</p><p><br></p><p>(B) 我们合理认为，适用法律、法规或我们在任何司法管辖区受其管辖的任何法院或其他当局要求我们这样做；</p><p><br></p><p>(C) 我们有理由怀疑您的行为违反了本协议；</p><p><br></p><p>(D) 我们有理由怀疑您违反了我们的“行为政策”或“禁止使用、禁止业务和有条件使用的政策”（如附录 1 所述）；</p><p><br></p><p>(E) 我们担心交易错误或您的 PLATFORM_TITLE 账户的安全性，或者我们怀疑 PLATFORM_TITLE 服务被以欺诈或未经授权的方式使用；</p><p><br></p><p>(F) 我们怀疑洗钱、恐怖融资、欺诈或任何其他金融犯罪；</p><p><br></p><p>(G) 使用您的 PLATFORM_TITLE 账户会受到任何未决诉讼、调查或政府程序的影响和/或我们认为与您的 PLATFORM_TITLE 账户活动相关的法律或监管违规风险增加；和/或</p><p><br></p><p>(H) 您采取任何可能规避我们控制的行动，例如开设多个 PLATFORM_TITLE 账户或滥用我们可能不时提供的促销活动。如果您的电子货币钱包中的电子货币不足和/或您的数字货币钱包中的数字货币不足以支付交易和（如适用），我们也可能拒绝完成或阻止、取消或撤销您授权的交易在我们收到交易通知时或您的信用卡或借记卡或与您的 PLATFORM_TITLE 帐户或数字货币钱包相关联的任何其他有效付款方式被拒绝时的相关费用。</p><p><br></p><p>7.2 如果我们拒绝完成交易和/或暂停、限制或关闭您的 PLATFORM_TITLE 账户，和/或终止您对 PLATFORM_TITLE 服务的使用，我们将（除非我们这样做是非法的）通知您我们的行动和拒绝、暂停或关闭的原因，以及在适当情况下纠正导致您的 PLATFORM_TITLE 账户拒绝、暂停或关闭的任何事实错误的程序。如&lt;br&gt;果我们拒绝完成交易和/或暂停您的 PLATFORM_TITLE 账户，一旦拒绝和/或暂停的原因不再存在，我们将在合理可行的情况下尽快解除暂停或完成交易。但是，我们没有义务允许您以与暂停、撤销或取消的交易相同的价格或相同的条款恢复交易。我们可能会暂停、限制或终止您对任何或所有 PLATFORM_TITLE 服务的访问和/或停用或取消您的 PLATFORM_TITLE 帐户，而无需提前两个月通知您。您承认我们采取某些行动（包括限制访问、暂停或关闭您的 PLATFORM_TITLE 账户）的决定可能基于对我们的风险管理和安全协议而言必不可少的机密标准。您同意PLATFORM_TITLE 没有义务向您披露其风险管理和安全程序的细节。</p><p><br></p><p>7.3 终止或暂停的后果。在因任何原因终止本协议时，除非适用法律或 PLATFORM_TITLE 在任何司法管辖区受其管辖的任何法院或其他命令禁止，否则您可以访问您的 PLATFORM_TITLE 帐户：</p><p><br></p><p>(A) 此后九十 (90) 天内，出于将数字货币从您的数字货币钱包和/或 PLATFORM_TITLE 平台转移出的目的；和/或</p><p><br></p><p>(B) 自本协议终止之日起六年内的任何时间点，用于将 E-Money 从您的 E-Money 钱包和/或 PLATFORM_TITLE 平台转出。在此期间，您不得将 PLATFORM_TITLE 服务或您的 PLATFORM_TITLE 帐户用于任何其他目的，我们可以酌情决定限制 PLATFORM_TITLE 平台的功能或相应地为您访问网站。如果我们出于任何原因暂停或关闭您的 PLATFORM_TITLE 帐户或终止您对 PLATFORM_TITLE 服务的使用，我们保留要求您重新完成第</p><p><br></p><p>3.3 节（身份验证）中概述的程序的权利，然后才能允许您转移或提取数字货币或电子货币。您可以随时通过提取您的电子货币钱包和数字货币钱包中的所有余额并访问：https://www.PLATFORM_TITLE.com/settings/cancel 来取消您的 PLATFORM_TITLE 账户。取消不会向您收费填写您的 PLATFORM_TITLE 帐户，尽管您将需要支付任何欠我们的未付款项。您授权我们在取消时取消或暂停任何待处理的交易。</p><p><br></p><p>8. 责任</p><p><br></p><p>8.1 PLATFORM_TITLE 的发布。如果您与 PLATFORM_TITLE 服务的一位或多位用户（PLATFORM_TITLE 除外）发生争议，您同意我们、我们的关联公司或服务提供商，以及我们各自的管理人员、董事、代理、合资企业、员工和代表，将对由此类争议引起或以任何方式与之相关的任何种类或性质的任何索赔、要求和损害赔偿（实际的和相应的、直接的或间接的）承担责任。</p><p><br></p><p>8.2 赔偿。您同意就任何费用（包括律师费和任何罚款、费用或由因您违反和/或我们执行本协议（包括但不限于您违反我们的“行为政策”或我们的“政策禁止使用、禁止业务和有条件使用”（如附录 1 所述）或您违反任何法律、规则或法规，或任何第三方的权利。</p><p><br></p><p>8.3 责任限制。 PLATFORM_TITLE 对您因 PLATFORM_TITLE 违反本协议而可能遭受的损失、成本、责任或费用的任何个人索赔或一系列相关索赔的总合计责任应限于最大合计在 PLATFORM_TITLE 发生相关违规行为时，存入您的 E-Money 钱包和您的数字货币钱包中的数字货币和 E-Money 的总价值。如果我们正在考虑与特定交易有关的特定索赔，则该金额应进一步限于争议交易的购买/销售金额（如相关）。</p><p><br></p><p>8.4 损失限制。除了上述第 8.3 节（责任限制）中的责任上限，在任何情况下，我们、我们的关联公司或服务提供商，或我们或他们各自的管理人员、董事、代理、雇员或代表均不对任何根据本协议或其他方式引起或与之相关的以下类型的损失或损害：</p><p><br></p><p>(A) 任何利润损失或预期收入或收益损失，包括任何预期交易利润损失和/或任何实际或假设的直接或间接交易损失，即使我们被告知或知道或应该知道相同的可能性。这意味着，仅作为示例（并且不限制前一句的范围），如果您声称我们未能正确处理数字货币交易，您的损失将限制在不超受支持数字货币的总价值交易中涉及的货币和电子货币，您可能无法就预期交易利润的任何“损失”或因未能买卖数字货币而造成的任何实际交易损失进行赔偿；</p><p><br></p><p>(B) 声誉或商誉的任何损失或损害；任何业务或机会、客户或合同的损失；任何间接费用、管理或其他员工时间的损失或浪费；或任何其他直接或间接的收入损失或实际或预期的节省，即使我们被告知或知道或应该知道相同的可能性；</p><p><br></p><p>(C) 任何硬件、软件或数据的使用损失和/或数据的任何损坏；包括但不限于因数字货币价格数据的任何不准确、缺陷或遗漏而引起或与之相关的任何损失或损害；传输此类数据的任何错误或延迟；和/或任何此类数据的任何中断；和</p><p><br></p><p>(D) 任何非因我们违反本协议而直接造成的损失或损害（无论您是否能够证明此类损失或损害）。</p><p><br></p><p>8.5 适用法律。本第 8 条（责任）中的责任限制受以下任何义务的约束：根据适用的法律和法规，我们有义务在提供 PLATFORM_TITLE 服务时行使合理的谨慎和技能。本协议中的任何内容均不得限制我们因欺诈或欺诈性失实陈述、重大过失、故意不当行为、因我们或我们的分包商的疏忽而导致的死亡或人身伤害的责任。</p><p><br></p><p>8.6 无保证。 PLATFORM_TITLE 服务、PLATFORM_TITLE 平台和网站均按“原样”和“可用”的基础提供，我们不对 PLATFORM_TITLE 服务的可用性作出进一步承诺。具体而言，我们不对所有权、适销性、特定用途的适用性和/或不侵权提供任何默示保证。我们不做任何访问的承诺对于本网站，任何 PLATFORM_TITLE 服务或其中包含的任何材料将是连续的、不间断的、及时的或无错误的。我们不对网站上可用的历史数字货币价格数据的准确性、顺序、及时性或完整性作出任何陈述。 PLATFORM_TITLE 通过本网站提供的任何材料、信息、观点、意见、预测或估计仅供参考，如有更改，恕不另行通知。您必须自行评估网站和/或网站上提供的材料、信息、观点、预测或估计的相关性、及时性、准确性、充分性、商业价值、完整性和可靠性。因此，PLATFORM_TITLE 不提供任何保证，并且 PLATFORM_TITLE 不接受任何直接或间接因您对提供或提供的任何材料、信息、观点、意见、预测或估计采取行动而导致的任何损失本网站和/或本网站。PLATFORM_TITLE 服务、PLATFORM_TITLE 平台和网站并非旨在提供具体的投资、税务或法律建议，或就任何投资或产品对任何特定投资者的适用性提出任何建议。在对投资或产品进行投资之前，您应寻求自己的独立财务、法律、监管、税务或其他建议。如果您选择不向相关顾问寻求建议，您应考虑该投资或产品是否适合您。我们将尽合理努力确保及时处理涉及数字货币钱包、电子货币钱包、银行账户、信用卡和借记卡的数字货币交易、借记和贷记请求，但 PLATFORM_TITLE 对金额不作任何陈述或保证完成处理所需的时间取决于我们无法控制的许多因素。我们将尽合理努力确保及时处理涉及银行账户、信用卡和支票签发的电子借记卡和贷记卡请求，但我们对完成处理所需的时间不作任何陈述或保证，这取决于在我们无法控制的许多因素上。除本协议中规定的明确声明外，您在此承认并同意，对于您对 PLATFORM_TITLE 服务和网站的使用和访问，您没有依赖任何其&lt;br&gt;他书面或口头声明或理解。</p><p><br></p><p>8.7 不承担违约责任。对于任何因我们无法控制的异常和不可预见的情况而直接或间接引起的任何违反本协议的行为，包括延迟、未能履行或服务中断，我们概不负责，尽管对本协议有任何影响，但其后果将是不可避免的相反，如果违反是由于适用强制性法律规则而导致的，我们也不承担任何责任。</p><p><br></p><p>9. 网站可用性和准确性</p><p><br></p><p>9.1 访问和可用性。在大幅波动或交易量大时，对 PLATFORM_TITLE 服务的访问可能会降级或不可用。这可能会导致对您的 PLATFORM_TITLE 帐户或 PLATFORM_TITLE 服务的访问受到限制，包括无法启动或完成交易，还可能导致支持响应时间延迟。</p><p><br></p><p>(A) 尽管我们努力为您提供优质的服务，但我们不保证网站或其他 PLATFORM_TITLE 服务不会中断，我们不保证任何订单将被执行、接受、记录或保持开放，或者您的 PLATFORM_TITLE 帐户将可以访问；和</p><p><br></p><p>(B) 请注意，我们的客户支持响应时间可能会延迟，包括在大幅波动或交易量大的时候，尤其是在非信任和安全问题上。在任何情况下，PLATFORM_TITLE 均不对因服务中断、交易处理延迟或 PLATFORM_TITLE 客户支持未及时响应而造成的任何所谓的损害负责。</p><p><br></p><p>9.2 网站准确性。尽管我们打算在网站上提供准确及时的信息，但网站（包括但不限于内容（定义见下文））可能并不总是完全准确、完整或最新，还可能包括技术不准确或印刷错误。为了继续向您提供尽可能完整和准确的信息，在适用法律允许的范围内，信息可能会不时更改或更新，恕不另行通知，包括但不限于有关我们的政策、产品和服务的信息.因此，您应在依赖所有信息之前对其进行验证，所有基于本网站所含信息的决定均由您自行负责，我们对此类决定不承担任何责任。第三方材料（包括但不限于任何网站）的链接可能会被提供为nience，但不受我们控制。您承认并同意，对于从本网站可访问或链接的任何此类第三方材料中包含的信息、内容或服务的任何方面，我们概不负责。</p><p><br></p><p>10. 客户反馈、查询、投诉和争议解决</p><p><br></p><p>10.1 联系 PLATFORM_TITLE。如果您有任何反馈、问题或投诉，请通过我们的“客户支持”网页与我们联系，网址为 https://help.PLATFORM_TITLE.com。当您与我们联系时，请向我们提供您的姓名、电子邮件地址以及我们可能需要识别您、您的 PLATFORM_TITLE 帐户以及您有反馈、问题或投诉的交易的任何其他信息。</p><p><br></p><p>10.2 投诉。如果您与 PLATFORM_TITLE 有争议，您同意首先联系我们的支持团队以尝试解决此类争议。如果我们无法通过我们的支持团队解决争议，您和我们同意使用第 10.2 节中规定的投诉流程。您同意在开始第 10.4 节中规定的任何行动之前使用此流程。如果您在根据第 10.4 条采取行动之前未遵循本第 10.2 条规定的程序，我们有权要求相关法院/当局驳回您的行动/申请，除非且直到您完成以下步骤：如果您与 PLATFORM_TITLE 支持部门联系未能解决投诉，请使用我们的投诉表列出您的投诉原因、您希望我们如何解决投诉以及您认为相关的任何其他信息.投诉表格可以在 PLATFORM_TITLE 支持页面 help.PLATFORM_TITLE.com 上找到，也可以从 PLATFORM_TITLE 客户支持处索取。在您提交投诉表后，我们将确认收到您的投诉表。客户投诉专员（“专员”）将考虑您的投诉。该官员将根据您提供的信息以PLATFORM_TITLE 提供的任何信息，在不影响您的投诉的情况下考虑您的投诉。在我们收到您的投诉后的 15 个工作日内，该官员将通过向您发送一封电子邮件（“解决通知”）来解决您在投诉中提出的所有问题，其中该官员将：(i) 提出以您要求的方式解决您的投诉; (ii) 作出拒绝您的投诉的决定并说明拒绝的原因；或 (iii) 提出用替代解决方案解决您的投诉。在某些情况下，如果该官员无法在 15 个工作日内回复您的投诉，该官员将（除非适用法律禁止）向您发送暂缓答复，说明延迟回复您的投诉的原因并指定截止日期该官员将回复您的投诉（不迟于我们收到您的投诉后的 35 个工作日）。向您提出的任何解决方案只有在您接受的情况下才对我们具有约束力。提出解决方案并不构成我们承认与投诉主题有关的任何不当行为或责任。</p><p><br></p><p>10.3 如果我们无法通过上文第 10.2 节中规定的投诉程序解&lt;br&gt;决您的投诉，您可以通过下文第 10.4(A) 至 10.4(B) 节中适用&lt;br&gt;于您的争议程序升级您的投诉。</p><p><br></p><p>10.4 您和我们双方同意，在第 10.2 条规定的投诉程序完成&lt;br&gt;之前，我们不会就您的全部或部分投诉启动下文第 10.4(A) 至 10.4(B) 条规定的任何争议程序。已完成，尽管第 10.2 节或本第 10.4 节中的任何内容均不得解释为阻止任何一方在任何有管辖权的法院寻求保全或类似的临时救济：</p><p><br></p><p>(A) 电子货币服务。如果您的投诉与任何电子货币服务有&lt;br&gt;关，您可能有权将该投诉提交给 FOS，如第 4.13 节所述。</p><p><br></p><p>(B) 对于因本协议或提供 PLATFORM_TITLE 服务、PLATFORM_TITLE 平台或网站而产生或与之相关的投诉或争议，如果无法通过上文第10.2 条规定的投诉程序解决，您提交给非- 英格兰和威尔士法院的专属管辖权，但不损害消费者（即不从事与其贸易、业务或专业相关的行为的个人，“消费者”）在管辖法院对PLATFORM_TITLE 提起诉讼的任何强制性权利他们居住的地方。</p><p><br></p><p>11. 数据保护。</p><p><br></p><p>11.1 个人资料。您承认我们可能会处理与您有关的个人数据（如果您是个人），以及您已经提供（或将来提供）给我们的与您的员工和其他员工或其他个人（如果您不是个人），与本协议或 PLATFORM_TITLE 服务有关。我们将根据构成本协议一部分的隐私政策处理这些个人数据吨。因此，您声明并保证：</p><p><br></p><p>(A) 您向我们披露与您以外的个人有关的任何个人数据已经或将按照所有适用的数据保护和数据隐私法进行，并且这些数据在披露时是准确的、最新的和相关的；</p><p><br></p><p>(B) 在向我们提供任何此类个人数据之前，您承认您已阅读并理解我们的隐私政策，其副本可在此处获得：隐私政策，如果是与您以外的个人有关的个人数据，已经（或将在披露时）向个人提供了一份副本，或将个人引导至包含该隐私政策（不时修订）的网页；</p><p><br></p><p>(C) 如果我们不时向您提供隐私政策的替代版本，您将立即阅读该通知并将隐私政策的更新副本提供给或重定向到包含更新隐私政策的网页，任何您已向我们提供其个人数据的个人。</p><p><br></p><p>12. 安全</p><p><br></p><p>12.1 密码安全。为了访问 PLATFORM_TITLE 服务，您需要创建或获得安全详细信息，包括用户名和密码。您有责任确保您访问 PLATFORM_TITLE 服务所使用的电子设备的安全，并对您用于访问 PLATFORM_TITLE 服务的任何和所有安全细节保持足够的安全性和控制。这包括采取一切合理措施避免此类电子设备丢失、被盗或误用，并确保此类电子设备得到加密和密码保护。您的电子设备或您的安全详细信息的任何丢失或损坏都可能&lt;br&gt;导致第三方未经授权访问您的 PLATFORM_TITLE 账户，以及您的 PLATFORM_TITLE 账户和任何相关联的任何电子货币、数字货币和或资金的丢失或被盗账户，包括您关联的银行账户和信用卡。您必须始终确保您的安全详细信息安全。例如，您不应将它们写下来或以其他方式让其他人看到它们。当您登录到您PLATFORM_TITLE 帐户时，您不应允许远程访问或与其他人共享您的计算机和/或计算机屏幕。 PLATFORM_TITLE 在任何情况下都不会要求您提供您的 ID、密码或 2 因素身份验证码或屏幕共享或以其他方式试图访问您的计算机或帐户。除非根据第 3.2 和 4.10 节特别授权，否则您不应将您的详细信息提供给任何第三方以远程访问您的帐户。如果您对任何通信或通知的真实性有任何不确定性，请始终通过本网站登录您的 PLATFORM_TITLE 帐户以查看任何交易或所需的操作。对于因 PLATFORM_TITLE 的无过错和/或未遵循本第 12.1 节中规定的要求，或未遵循或按照我们的任何通知或警报采取行动而导致帐户登录凭据泄露而造成的任何损失，我们不承担任何责任可以发给你。</p><p><br></p><p>12.2 身份验证和验证。为了访问 PLATFORM_TITLE 服务，用户需要提供电子邮件地址并创建密码。 PLATFORM_TITLE 通过用户的移动设备（短消息服务（“SMS”）或受支持的基于时间的一次性密码应用程序提供双重身份验证。需要经过验证的电话号码才能通过短信启用双重身份验证。用户负责保持用于访问 PLATFORM_TITLE 服务的电子设备的安全，并保持足够的安全性和控制用于访问 PLATFORM_TITLE 服务的任何和所有安全细节。这包括采取所有合理的步骤来避免所述电子设备的丢失、被盗或滥用，以及确保所述电子设备受密码保护。个人电子设备或安全细节的任何丢失或泄露都可能导致第三方未经授权访问用户的 PLATFORM_TITLE 帐户以及任何电子货币、数字货币和/或您的 PLATFORM_TITLE 账户中持有的资金以及任何相关账户的滥用，包括关联的银行账户和信用卡/借记卡。</p><p><br></p><p>12.3 安全漏洞。如果您怀疑您的 PLATFORM_TITLE 帐户或您的任何安全详细信息已被泄露，或者您发现任何欺诈或企图欺诈或任何其他影响您和/或 PLATFORM_TITLE 的安全事件（包括网络安全攻击）（统称为“安全漏洞”），您必须：</p><p><br></p><p>(A) 尽快通过免费电子邮件通知 PLATFORM_TITLE 支持trust@PLATFORM_TITLE.com，或致电我们：0808 168 4639，或 +1 (888) 908 7930（可能收取国际费用）；</p><p><br></p><p>(B) 在整个安全漏洞期间继续提供准确和最新的信息；</p><p><br></p><p>(C) 您必须采取我们合理要求的任何步骤来减少、管理或报&lt;br&gt;告任何安全漏洞。未能提供及时通知在我们确定适当的解决方案时，可能会考虑任何安全漏洞。</p><p><br></p><p>12.4 您的计算机和设备的安全和保障。 PLATFORM_TITLE 不对任何可能影响您的计算机或其他设备的计算机病毒或其他恶意代码或任何网络钓鱼、欺骗或其他攻击造成的任何损害或中断负责。我们建议定期使用信誉良好且随时可用的病毒筛查和预防软件。您还应该知道，SMS 和电子邮件服务容易受到欺骗和网络钓鱼攻击，并且在查看声称来自我们的消息时应小心谨慎。</p><p><br></p><p>13. 一般</p><p><br></p><p>13.1 您遵守适用法律。您在使用 PLATFORM_TITLE 服务、PLATFORM_TITLE 平台和网站。</p><p><br></p><p>13.2 有限许可。根据本协议的条款，我们授予您有限的、非排他性的、不可转让的许可，以访问和使用本网站以及相关的内容、材料、信息（统称为“内容”），仅用于批准的目的：我们不时允许。明确禁止对本网站或内容的任何其他使用，并且本网站或内容的所有其他权利、所有权和利益均为 PLATFORM_TITLE 及其许可人的财产。您同意不复制、传输、分发、销售、许可、逆向工程、修改、发布或参与转让或销售、创建衍生作品或以任何其他方式利用任何内容，无论是全部还是在部分。“PLATFORM_TITLE.com”、“PLATFORM_TITLE”、“PLATFORM_TITLEPro”、“Pro.PLATFORM_TITLE.com”以及与 PLATFORM_TITLE 服务相关或显示在网站上的所有徽标是 PLATFORM_TITLE 或其许可方的商标或注册商标。未经我们事先书面同意，您不得复制、模仿或使用它们。</p><p><br></p><p>13.3 禁止和有条件的使用。关于您对 PLATFORM_TITLE 服务的使用以及您与其他用户和第三方的互动，您同意遵守“禁止使用、禁止业务和有条件使用的政策”（如附录 1 所述）。此处包含的任何内容均不得解释为以暗示、禁止反言或其他方式授予电子货币或数字货币用于非法、非法、欺诈、不道德或未经授权的目的或促进或促进任何非法、非法、欺诈、不道德或未经授权的活动。我们保留随时监控、审查、保留和/或披露任何必要信息的权利，以满足任何适用法律、法规、制裁计划、法律程序或政府要求。</p><p><br></p><p>13.4 出口管制和制裁。您对 PLATFORM_TITLE 服务和网站的使用受国际出口管制和经济制裁要求的约束。通过网站或 PLATFORM_TITLE 服务发送、接收、购买、出售、交易或存储数字货币，即表示您同意遵守这些要求。在以下情况下，您不得通过本网站&lt;br&gt;获取数字货币或使用任何 PLATFORM_TITLE 服务：</p><p><br></p><p>(A) 您在古巴、伊朗、朝鲜、苏丹或叙利亚或受美国禁运、联合国制裁、欧盟或英国财政部金融制裁的任何其他国家地区、受其控制或国民或居民制度（每个“受制裁国家”），或者如果您是适用当局（包括但不限于金融制裁实施办公室（英国财政部的一部分）不时发布的经济制裁名单上的人，美国商务部的拒绝人员名单、未经核实的名单或实体名单，或欧盟金融制裁制度）（“受制裁人”）；或者</p><p><br></p><p>(B) 您打算向受制裁国家（或受制裁国家的国民或居民）或受制裁人提供任何获得或存储的数字货币或电子货币或 PLATFORM_TITLE 服务。</p><p><br></p><p>13.5 修正。我们将至少提前两个月通过电子邮件通知您有关电子货币服务的协议的任何变更。在这种情况下，如果您在&lt;br&gt;变更生效日期前未另行通知我们，则视为您已接受变更并继续使用 PLATFORM_TITLE 服务。如果您不接受更改，则应告知我们，本协议将在两个月通知结束时终止。您也可以在两个月通知到期之前的任何时间立即免费终止本协议。我们可以通过在网站上发布修订后的协议或通过电子邮件将其发送给您，对协议进行所有其他修订（包括与任何其他 PLATFORM_TITLE 服务有关的修订），表明修订后的协议何时生效。尽管我们会尽力在可能的情况下提前通知您，在合法的情况下，我们可能会表明修改后的协议应立即生效，如果您不同意任何此类修改，您应关闭您的 PLATFORM_TITLE 账户并停止使用 PLATFORM_TITLE 服务。您同意以上述方式发出的任何修改通知应足以通知您，并且您继续访问和/或使用 PLATFORM_TITLE 服务和/或本网站应构成您对修改的肯定确认，并应被视为表示您接受修订后的协议。本协议的最新版本将随时在网站上提供。</p><p><br></p><p>13.6 双方的关系。本协议中的任何内容均不应被视为或旨在被视为，也不应导致您或 PLATFORM_TITLE 被视为合作伙伴或合资企业，或您或 PLATFORM_TITLE 被视为另一方的代理人。</p><p><br></p><p>13.7 他人的隐私。如果您通过 PLATFORM_TITLE 服务收到有关其他用户的信息，您必须对该信息保密，并且仅将其用于与 PLATFORM_TITLE 服务相关的用途。除非您得到用户的明确同意，否则您不得向第三方披露或分发用户信息或使用该信息，除非为执行交易和其他合理附带的功能（例如支持、对账和会计）而合理必要。您不得通过 PLATFORM_TITLE 服务向其他用户发送未经请求的通信。</p><p><br></p><p>13.8 联系信息。您有责任在您的 PLATFORM_TITLE 账户资料中更新您的联系方式（包括您的电子邮件地址和电话号码），以便接收我们可能发送给您的任何通知或警报（包括实际或疑似安全漏洞的通知或警报） ）。有关我们将如何与您沟通的更多详细信息，请参阅附录 3。</p><p><br></p><p>13.9 税收。您有责任确定任何税款是否适用于您通过 PLATFORM_TITLE 服务进行的任何交易，以及在何种程度上适用于您通过 PLATFORM_TITLE 服务进行的任何交易，并向相应的税务机关代扣、收取、报告和汇缴正确的税款。您的交易历史可通过您的 PLATFORM_TITLE 账户获得。</p><p><br></p><p>13.10 无人认领的财产。如果我们代表您持有电子货币或数字货币，并且我们无法与您联系并且几年来没有您使用 PLATFORM_TITLE 服务的记录，则适用法律可能要求我们将电子货币或数字货币报告为无人认领的财产在某些司法管辖区的当局。我们将尝试在我们记录中显示的地址找到您，但如果我们无法找到您，我们可能需要将任何此类电子货币或数字货币作为无人认领的财产交付给某些司法管辖区的当局。在适用法律允许的情况下，我们保留从此类无人认领的资金中扣除休眠费或其他管理费用的权利。</p><p><br></p><p>13.11 账户持有人死亡。出于安全原因，如果我们收到确认您死亡的法律文件或其他使我们相信您已经死亡的信息，我们将冻结您的 PLATFORM_TITLE 账户，在此期间，任何交易都可能完成，直到：(i) 您指定的执行人/受托人已经开设一个新的 PLATFORM_TITLE 账户或以他们的名义通知 PLATFORM_TITLE 另一个现有的 PLATFORM_TITLE 账户，如下所述，并且您的全部 PLATFORM_TITLE 账户已&lt;br&gt;转移到该新账户，或 (ii) 我们已收到表格形式的证明令我们满意的是你没有死。如果我们有理由相信您可能已经死亡，但我们没有以我们满意的形式证明您的死亡，您授权我们直接或通过第三方进行调查，我们认为有必要确定您是否已经死亡.在我们收到令我们满意的您去世的证据后，您在有效遗嘱或类似遗嘱文件中指定的执行人/受托人将被要求开设一个新的 PLATFORM_TITLE 账户或通知 PLATFORM_TITLE 另一个以其名义现有的 PLATFORM_TITLE 账户您的 PLATFORM_TITLE 账户中的全部资金应转入其中。如果您没有指定执行人/受托人，那么我们保留以下权利： (i) 将任何有权继承您的 PLATFORM_TITLE 帐户的人视为您的执行人/受托人，由我们在收到和审查我们唯一的文件后确定和绝对酌情权，认为必要或适当，包括（但不限于）遗嘱或类似文件，或 (ii) 要求对您的财产具有管辖权的法院指定执行人/受托人的命令。如果我们全权酌情确定执行人/受托人指定的有效性存在不确定性，我们保留在采取任何与你的 PLATFORM_TITLE 帐户。根据上述规定，除非您的指定的执行人/受托人已经持有 PLATFORM_TITLE 账户（在这种情况下，他们可能仍需要进行额外的身份验证程序），在 PLATFORM_TITLE 账户所有者去世后，必须由指定的执行人/受托人开设新的 PLATFORM_TITLE 账户，并且您在此同意，您的执行人/受托人将被要求开设一个新的 PLATFORM_TITLE 账户并提供本协议第 3 节所要求的信息，以便访问您的 PLATFORM_TITLE 账户的内容。</p><p><br></p><p>13.12 完整协议。本协议（包括通过引用并入本文的文件）构成您与 PLATFORM_TITLE 之间就本协议标的达成的全部理解和协议，并取代任何和所有先前的任何形式的讨论、协议和理解（包括但不限于任何先前版本的本协议），以及您与 PLATFORM_TITLE 之间的所有性质。</p><p><br></p><p>13.13 解释。本协议中的章节标题仅为方便起见，不管辖本协议任何条款的含义或解释。</p><p><br></p><p>13.14 转让和转让。本协议是您个人的，您不能将您的权利、许可、利益和/或义务转让或转让给任何其他人。我们可以随时转让或转让我们的权利许可、利益和/或我们的义务，包括作为涉及 PLATFORM_TITLE 的合并、收购或其他公司重组的一部分，前提是这种转让或转让不会对 PLATFORM_TITLE 服务的质量产生重大影响你收到。在遵守上述规定的前提下，本协议将具有约束力，并符合各方、其继承人和获准受让人的利益。如果我们转让和/或转让协议，您保留立即终止协议的权利。</p><p><br></p><p>13.15 担保权益。除非您事先获得我们的书面批准，否则您不得为您的电子货币或数字货币设置安全性。</p><p><br></p><p>13.16 无效。如果根据任何适用法律确定本协议的任何条款无效或不可执行，这不会影响任何其他条款的有效性。如果发现任何条款无法执行，则无法执行的条款将被切断，其余条款将被执行。</p><p><br></p><p>13.17 行使我们的权利。我们可能并不总是严格执行我们在本协议下的权利。如果我们在任何时候都选择不行使我们的权利，这是一项临时措施，我们可能会随时再次严格行使我们的权利。</p><p><br></p><p>13.18 语言。本协议以及您或我们要提供的任何信息或通知应为英文。本协议或其他文件的任何译文仅为您的方便而提供，可能无法准确地表示英文原文中的信息。如有任何不一致，以本协议或其他文件的英文版本为准。</p><p><br></p><p>13.19 控制权变更。如果 PLATFORM_TITLE 被第三方实体收购或合并，我们保留在任何这些情况下转让或转让我们从您那里收集的信息以及我们与您的关系（包括本协议）作为一部分的权利此类合并、收购、出售或其他控制权变更。</p><p><br></p><p>13.20 生存。本协议的所有条款因其性质超出本协议的到期或终止，包括但不限于与暂停或终止、PLATFORM_TITLE 帐户取消、欠 PLATFORM_TITLE 的债务、PLATFORM_TITLE 平台或网站的一般使用有关的部分，与 PLATFORM_TITLE 的争议，一般条款将在本协议终止或到期后继续具有约束力和运作。</p><p><br></p><p>13.21 适用法律。本协议和我们之间的关系应受英格兰和威尔士法律的管辖，但须遵守任何当地强制性法律或消费者可获得的权利。</p>', '0', '2023-08-16 16:07:05', 0, NULL);
INSERT INTO `t_option_rules` VALUES (100121, '服务条款', 'ja', '<p>Eユーザプロトコルです</p><p><br></p><p>本契約(「契約」)は、米国、英国、eea、日本、シンガポール以外にお住まいのお客様に適用されます。</p><p><br></p><p>これらの用語を見ていると緑色のテキストがありますこれらの条項はCB Payments, Ltdがご提供する規制対象サービスにのみ適用され、PLATFORM_TITLE Kenya Limitedがご提供するサービスには適用されません。</p><p><br></p><p>CB Payments, Ltd (PLATFORM_TITLEの名でも取引されています)は英国金融行為監督庁の監督を受けています。</p><p><br></p><p>これはあなたと以下の当事者との間の契約です:CB Payments Ltd (PLATFORM_TITLE Payments)は、イングランドとウェールズで設立された民間有限会社で、会社番号は09708629です。登録オフィスの住所は5 Fleet Place, London EC4M 7RD, United Kingdomです;PLATFORM_TITLE Ascending Markets Kenya Limited(「PLATFORM_TITLEKenya」)はケニアで設立された民間有限会社です(会社番号pvt-27u5y39y)。郵便ポスト10643番郵便ポストケニアのナイロビですこのプロトコルにおける「PLATFORM_TITLE」、「私たち」、「私たちの」、または「私たち」への言及は、PLATFORM_TITLE Paymentsおよび/またはPLATFORM_TITLE Kenyaを意味し、特に議論されているサービスに依存します。「あなた」または「あなたの」への引用は、PLATFORM_TITLEと本契約を結んだ人を意味します。PLATFORM_TITLE.comまたはpro.PLATFORM_TITLE.comを介して利用アカウントを登録するか、または当社の任意の関連サイト、アプリケーションプログラムインターフェース(「API」)、またはモバイルアプリケーション(総称「ウェブサイト」)を介して利用アカウントを登録します。すなわち、この合意に含まれるすべての条項と条件、ならびに当社のプライバシーポリシーとクッキーポリシーを読み、理解し、受け入れることに同意するという意味です。電子マネーサービス、デジタルマネーサービス、および付加サービス(以下の定義を参照)を総称して「PLATFORM_TITLEサービス」と呼びます。PLATFORM_TITLEが運営するプラットフォーム(「PLATFORM_TITLEプラットフォーム」)(オンラインプラットフォームを含む)からアクセス可能webサイトまたはPLATFORM_TITLEが時折定める場所からアクセス可能です)。PLATFORM_TITLE &lt;br&gt;Paymentsが自ら電子マネーサービスの提供を決めた場合にのみ、電子マネーサービスへのアクセスが自動的に提供されます。</p><p><br></p><p>以下の2で説明するように、各PLATFORM_TITLEサービスは、PLATFORM_TITLE PaymentsまたはPLATFORM_TITLE Kenyaによって提供されます。*デジタル通貨を取引したり保有したりした場合、損失のリスクが大きいことはおわかりでしょう。どのような資産と同様に、デジタル通貨の価値は上昇または下落する可能性があり、デジタル通貨を購入、売却、保有または投資する際に損失を被るという大きなリスクがあります。デジタル通貨サービスおよび追加サービスは現在、金融行為監督当局、ケニア中央銀行、英国またはケニアの他のいかなる監督機関の監督も受けていません。デジタル通貨サービスおよび付加サービスは英国金融監査院のサービスの管轄外にあり、あなたのデジタル通貨および電子マネーは英国金融サービス補償プログラムの保護を受けません。ケニア中央銀行の2015年通知第14号によると、デジタル通貨はケニアでは法定通貨ではないため、PLATFORM_TITLEが財政的困難に直面した場合、保護を受けることはできません。あなたの財務状態に応じて、デジタル通貨を取引したり保有したりすることが適切かどうかをよく考えるべきです。*</p><p><br></p><p>1.資格です。</p><p><br></p><p>いずれかのPLATFORM_TITLEサービスの利用資格を得るには、18歳以上であることと、該当するPLATFORM_TITLEサービスにアクセスできる国・地域に居住していることが必要です。すべての国でPLATFORM_TITLEサービスが利用できるわけではありませんのでご注意ください。国/地域別にアクセス可能なPLATFORM_TITLEサービスの一覧はhttps://www.PLATFORM_TITLE.com/globalにあります。</p><p><br></p><p>2.サービスです。</p><p><br></p><p>2.1電子マネーサービスです。</p><p><br></p><p>PLATFORM_TITLE Paymentsは、次のようなサービス(「電子マネーサービス」)を提供する可能性があります。(A) CB Paymentsが発行する法定通貨(「電子マネー」)で計算された電子マネーを保存できるデジタルウォレット(「電子マネーウォレット」)をホストします。と</p><p><br></p><p>(B)電子マネーの送受信を可能にするいくつかの支払いサービス(以下で説明する)。</p><p><br></p><p>電子マネーサービスは英国金融行為監督庁(「FCA」)の監督下にあります。PLATFORM_TITLE PaymentsはFCAが認可・規制する認可電子マネー機関で、登録番号は900635です。電子マネーサービスへのアクセスは自動ではなく、PLATFORM_TITLE Paymentsがこれらのサービスの提供を自ら決定した場合にのみ提供されます。</p><p><br></p><p>2.2デジタル通貨サービスです。</p><p><br></p><p>PLATFORM_TITLE Kenyaは、以下のサービス(「デジタル通貨サービス」)を提供する可能性があります:</p><p><br></p><p>(A)サポートされているいくつかのデジタル通貨(ビットコインやエセリウムなど)の残高(総称して「デジタル通貨」または「デジタル通貨」と呼ばれます)を保存、追跡、転送、管理することができる1つまたは複数のホストデジタル通貨ワレット(「デジタル通貨ワレット」)。</p><p><br></p><p>(B)デジタル通貨交換サービスは、あなたがデジタル通貨を購入して販売する価格を得ることができ、ウェブサイト上で(一定の制限を受けて)そのような購入または販売を行うことができるサービスです(「デジタル通貨交換サービス」)。電子マネーサービスと違って、デジタルマネーサービスは規制されていません。PLATFORM_TITLE Kenyaは規制金融サービスプロバイダーではありません。PLATFORM_TITLE Kenyaはケニアにありケニアでサービスを提供しています重要なヒント:PLATFORM_TITLE Kenyaは規制された金融サービスプロバイダーではなく、ケニア中央銀行、資本市場庁、またはケニアの他の金融サービス監督機関に登録、監督、または権限を与えられていません。そのため、投資家や預金保護プログラムなど、これらの規制された団体に関連する規制保護を利用することはできません。</p><p><br></p><p>2.3その他のPLATFORM_TITLEサービス</p><p><br></p><p>コアサービス(電子マネーサービスおよびデジタルマネーサービス)に加えて、PLATFORM_TITLE Kenya(またはPLATFORM_TITLEグループの他のメンバー。定義は2.6項参照)は、ある資格基準を満たすユーザーに以下のサービス(「追加サービス」)を提供する可能性があります。</p><p><br></p><p>(A)デジタル通貨註文簿交換プラットフォーム(付録4参照)(「PLATFORM_TITLE Pro」);</p><p><br></p><p>(B) PLATFORM_TITLEが提供する開発アプリケーション(付録5参照)(「開発者ツール」)です。</p><p><br></p><p>(C)質的サービス(詳細は付録6を参照)(「質的サービス」)です。</p><p><br></p><p>2.4いくつかの責任です。PLATFORM_TITLE PaymentsとPLATFORM_TITLE Kenyaの責任は連帯ではなく単独であることに同意されます。そして、PLATFORM_TITLE PaymentsおよびPLATFORM_TITLE Kenyaは、それぞれ本プロトコルの下での義務およびそれらの違反に対してのみ責任義務を負います。これは、彼らの一人一人が、お互いの違反行為に対してではなく、あなた自身の違反行為に対して責任を持つことを意味します。</p><p><br></p><p>2.5料金です。あなたが責任を持って支払い、すべての費用を支払うことに同意します。PLATFORM_TITLEサービスの完全な料金明細(時々変更されます)は、本契約の一部をなすウェブサイトの「価格設定および料金開示」ページおよび「取引料金」ページで見ることができます。</p><p><br></p><p>2.6 PLATFORM_TITLEグループです。本契約における「PLATFORM_TITLEグループ」とは、PLATFORM_TITLE Kenyaとその子会社のことで、デジタル通貨のストレージやワレットサービスを提供するデラウェア州の企業PLATFORM_TITLE, Inc.が含まれます。この定義には、PLATFORM_TITLE Paymentsを含むがこれらに限定されませんが、電子マネーサービスのみを提供するすべての企業の子会社を含みません。</p><p><br></p><p>2.7支払いサービスパートナーです。PLATFORM_TITLEは、関連する国/地域の関連する中央銀行が発行する通貨建てであなたとPLATFORM_TITLEとの間のいかなる支払いも、第三者の決済プロセッサまたは入金エージェントを使用して処理することができます。関連した支払いを含みますが、これらに限定されません。電子マネーのウォレット、またはPLATFORM_TITLEアカウントにおけるデジタル通貨の取引、預金または引き出しの使用を禁止します。</p><p><br></p><p>3.アカウントの設定です。</p><p><br></p><p>3.1 PLATFORM_TITLEアカウントを登録します。PLATFORM_TITLEサービスを利用するには、詳細情報(お名前、eメールアドレス、パスワードを含む)の提供と本契約の約款を受け入れてPLATFORM_TITLEアカウント(「PLATFORM_TITLEアカウント」)を登録する必要があります。PLATFORM_TITLEアカウントを使用するということは、このプロトコルのセクション3.2および4.10に従って事前にPLATFORM_TITLEの承認を得ていない限り、あなた自身がPLATFORM_TITLEサービスを使用することに同意していることを意味します。PLATFORM_TITLEアカウントの登録はお客様1人につき1つしかできません。あなたはあなたのPLATFORM_TITLEアカウントで発生したすべての活動に対してすべての責任を負います。PLATFORM_TITLEアカウントの開設を拒否するか、または任意のPLATFORM_TITLEアカウント(重複アカウントを含みますがこれに限定されません)を一時停止または終了するか、またはPLATFORM_TITLEアカウント内の特定のデジタル通貨の取引を一時停止または終了するかは、私たち自身で決定することができます。</p><p><br></p><p>3.2サードパーティアクセスです。4.10条によって許可される範囲内で、監督される第三者が監督される第三者の製品またはサービスを介して、またはウェブサイトを介してPLATFORM_TITLEアカウントにアクセスまたは接続することを明示的に許可する場合、監督される第三者があなたに代わって特定の行動を取る許可を与えることは、本契約の下であなたの責任を免除するものではありません。あなたは、あなたのPLATFORM_TITLEアカウントにアクセスした監督された第三者のすべての行為または不行為に対してすべての責任を負い、その監督された第三者のすべての行為は、あなたの許可された行為とみなされるべきです。さらに、あなたのPLATFORM_TITLEアカウントにアクセスした監督された第三者の行為または不行為によって生じた、またはそれに関連するいかなる責任についても、PLATFORM_TITLEに対してPLATFORM_TITLEを要求することなく、PLATFORM_TITLEを賠償することをあなたは承認し、同意します。PLATFORM_TITLEアカウントに関して監督対象の第三者に付与した権限を、webサイトの「設定」ページ上のタブからいつでも変更または削除することができます。</p><p>3.3本人認証です。あなたは、私たちが要求する情報(私たちはyが必要と認める場合は何でも要求することができます)を、マネーロンダリング、テロ資金調達、詐欺、または他の金融犯罪の捜査のために使用することに同意し、付録2(検証手順と制限)に規定されているものを含め、私たちがそのような情報の記録を保持することを許可します。PLATFORM_TITLEサービスの利用を開始し、特定のPLATFORM_TITLEサービスにアクセスするには、いくつかの認証手続きを完了する必要があります。これには、いくつかの電子マネーやデジタルマネーの転送が含まれます。PLATFORM_TITLEサービスのご利用に適用される制限は、継続的に収集される情報により変更される場合があります。要求する情報には個人情報が含まれる場合がありますが、これらに限定されるものではありません。例えば、お名前、居住地、電話番号、eメールアドレス、生年月日、納税者識別番号、政府の識別番号、銀行口座に関する情報(例えば、銀行名、口座タイプ、ルーティング番号および口座番号)ネットワーク状態、顧客タイプ、顧客役割、課金タイプ、移動機器識別子(例えば、国際移動体加入者idと国際移動体デバイス識別子)部分)およびその他のユーザステータス詳細情報、および適用法に従ってPLATFORM_TITLEが時々収集するように要求される何らかのこのような情報です。あなたはまた、「強化デューデリジェンス」(以下6.2節参照)を行う必要があるかもしれません。ここでPLATFORM_TITLEはあなた自身またはあなたの業務に関する他の情報の提出、関連記録の提供、PLATFORM_TITLEの従業員との会議のスケジュールを要求するかもしれません。PLATFORM_TITLEは以下のようなことができるようにします。PLATFORM_TITLEサービスの使用中に行われる任意の取引の富の出所と資金の出所を特定します。私たちにこの情報または必要とされる可能性のある他の情報を提供する場合、あなたはその情報が真実で、正確で、完全であることを確認します。また、PLATFORM_TITLEアカウントを登録するためのPLATFORM_TITLEの評価に影響を与える可能性のある情報を隠したり、PLATFORM_TITLEサービスを提供したりしていません。あなたは、提供されたこのようないかなる情報も虚偽、不正確、または不完全になる可能性があるいかなる状況変化についての情報を書面で通知し、PLATFORM_TITLEにタイムリーに提供することを約束し、PLATFORM_TITLEが要求する可能性があるいかなる他の追加のファイル、記録、情報、および/または適用法を提供することを約束します。このような情報の記録を保持することを許可していただきます。私たちはこれらの情報を第11条(データ保護)に従って処理します。あなたの身元を確認するため、または詐欺または他の金融犯罪からあなたおよび/または私たちを保護するために必要と認められる照会を直接または第三者を介して私たちに許可し、その結果に基づいて私たちが合理的に必要と認める行動照会を行います。私たちがこれらの照会を行うと、あなたの個人情報が信用リファレンス、詐欺予防または金融犯罪機関に開示される可能性があることを承認し同意し、これらの機関は私たちの照会に全面的に応じてくれるかもしれません。これはあくまでも身分確認であって、あなたの信用格付けに悪影響を及ぼすものではありません。また、PLATFORM_TITLEサービスの追加利用および/または特定の取引量の制限を超える取引を許可するためには、取引完了後しばらくお待ちいただく必要がある場合がございます。</p><p><br></p><p>4電子マネーサービスです</p><p><br></p><p>4.1ロードします。送金(またはウェブサイト上で自分の場所に適した他の支払い方法)を使って資金をe-moneyウォレットに入金することができます。入金を受け取ると、e-moneyウォレットはロードされた資金を表示します。資金のロードは手動で行うこともできますし、PLATFORM_TITLEアカウントに設定された定期的な取引の一部として利用することもできます(より詳しい情報については、次の5.12節を参照)。自分のアカウントから自分の資金をロードすることができますが、任意の統合、集合、または第三者のアカウントからロードすることはできません。資金がe-moneyウォレットにロードされると、PLATFORM_TITLE Paymentsはロードされた資金の代わりにe-moneyを発行します。電子マネーのウォレットは預金口座や投資口座ではありません。つまり、あなたの電子マネーは金融サービス補償プログラムから保護されないことになります。PLATFORM_TITLE Paymentsは、利用者からの資金を規制対象金融機関の指定保管口座に預けるだけです。電子マネーのワレットの中の電子マネーは、金利を稼ぐことはありません。お持ちの電子マネーウォレットは、異なる通貨建ての電子マネーをお持ちの場合があります。お持ちの各通貨の電子マネー残高を表示します。</p><p><br></p><p>4.2デジタル通貨を購入または販売します。対応デジタル通貨は、電子マネーウォレットに記入した電子マネーで購入することができます。電子マネーを利用してデジタル通貨を取引するには、ウェブサイトの説明に従わなければなりません。電子マネーを用いたデジタルマネーの取引は、通常、ご指示を受けてから一営業日以内に決済されます。私たちに電子マネーウォレットから電子マネーを差し引く権限を与えます。できるだけ早くデジタル通貨をお渡ししようと試みますが、デジタル通貨をお渡しするまでの間、電子マネーはお渡しするウォレットから差し引かれる可能性があります。電子マネーと引き換えにデジタルマネーを販売することができます。あなたのデジタル通貨のワレットからお金を借りて、電子通貨のワレットに関連する金額の電子マネーを記入することを許可します。</p><p><br></p><p>4.3コマンドを受信します。営業日以外、または営業日の午後4時30分(ロンドン時間)以降にe-moneyを利用してデジタル通貨を購入するよう指示を受けた場合、その指示を下記の時刻に受け取った営業日の指示とみなす場合があります。</p><p><br></p><p>4.4撤回します。例えば、将来の取引を設定している場合など、将来の取引が約束された日にならない限り、電子マネーを使用してデジタル通貨取引を行うことを当社に指示した場合、デジタル通貨取引の同意を撤回することはできません(詳細については、次の5.12節を参照)。将来の取引の場合、将来の取引期日の前日までに同意を撤回することができます。将来の取引についての同意を撤回するには、ウェブサイトの説明に従ってください。</p><p><br></p><p>4.5不成功な支払いです。電子マネーウォレットへの入金が失敗した場合、PLATFORM_TITLEは関連するデジタル通貨取引をキャンセルするか、あるいはPLATFORM_TITLE残高または他の関連アカウントを含む他の支払い方法から関連するデジタル通貨取引を完了するために必要な金額を引き落とすことを自分で決定することを許可します。あなたは、貸し越しを回避するために、またはプロバイダーが課した同様の料金を支払うために、十分な残高および/または十分な信用限度を維持する責任があります。</p><p><br></p><p>4.6アカウント情報です。当サイトを使用して、電子マネーのウォレットの残高および取引履歴を見ることができます。(i)一度にデジタルマネーを購入した金額(および通貨)、(ii)支払者および/または受取者を識別する参照(場合によっては)、(iii)請求された任意の料金(料金明細を含む)、(iv)通貨を交換した場合、交換レートおよび交換後の金額(新通貨ベース)(あなたのいる場所)支払者)または交換前の金額(元通貨ベース)(あなたが受取人)、および(v)各デジタル通貨の購入時の支払日(場合によっては)です。</p><p><br></p><p>4.7電子マネーに交換します。ウェブサイト内のオプションを選択し、説明された通りに電子マネーウォレットの電子マネーの全部または一部を受け取ることができます。別の約束がない限り、資金はあなたが登録した銀行口座に振り込まれます。本契約が終了した場合、私たちはあなたのe-moneyウォレットの中の残りのe-moneyを買い戻し、私たちが登録した銀行口座に資金を振り込むことを試みます。電子マネーのウォレットから電子マネーに交換する前に、詐欺、マネーロンダリング、テロ資金調達、その他の金融犯罪を防止するために、適用法の要求に従って検査を行うことがあります。これは、イーマネーの抽出が我々の規制要件を満たすために、これらの検査が我々の合理的な満足度で完了するまで、阻止されるか遅延されることを意味するかもしれません。</p><p><br></p><p>4.8不正取引、不正取引です。電子マネーウォレットからあなたの信用証明を使用してデジタルマネーの購入および/または電子マネーの償還を開始する場合、私たちはあなたが別途の通知をしない限り、このような取引を許可したと仮定します。電子マネーのワレットを使用して不正な取引が行われたと思われる場合(「不正取引」)、または電子マネーのワレットを使用した取引が誤って実行されたり不完全であったと信じる理由がある場合(「誤った取引」)は、速やかにご連絡ください。いずれにしても、不正取引や誤った取引が発生してから13ヶ月後には遅れてはなりません。不正取引や不正確な取引を確実に特定し、できるだけ早くお知らせするために、電子マネーのウォレット残高と取引履歴を定期的にチェックしてください。当社は、この第4.8条に基づいて当社に通知されていない場合を除き、無許可取引または誤った取引に対するいかなるクレームも責任を負いません。この場合、以下の第4.9条に当社の責任が規定されています。さらに、次のセクション4.9で説明するように、詐欺、故意、または重大な過失によって不正取引または不正確な取引が発生した場合、私たちは、不正取引または不正確な取引の実際または潜在的な調査の間、不正取引または不正確な取引を請求する責任はありません。私たちはあなたのPLATFORM_TITLEアカウントの一時停止を保留し、さらなる損失を回避します。</p><p><br></p><p>4.9払い戻しの権利です。</p><p><br></p><p>(A)不正取引-電子マネーのワレットです。</p><p><br></p><p>私たちの失敗によってあなたの電子マネーのウォレットに不正取引が発生した場合、私たちは不正取引を知った次の営業日までにその取引の金額を返金してあなたの電子マネーを回復します。不正取引が発生していない場合、通貨のウォレットはそのままの状態になります。一般的に言えば、あなたが無許可取引を私達に通知した後、または私達がいつでも私達に通知する方法を提供できなかった後に発生した損失について、あなたは何の責任も負いません。あなたは紛失または盗難の信用証明の使用によってあなたの電子マネーのワレットで発生した不正取引(例えば、あなたがログインの詳細情報を保持できなかった場合)によるいかなる損失も、最初の35ポンドのPLATFORM_TITLEアカウントのセキュリティを負担します。電子マネーのワレットで不正な取引が発生することになります(例えば、故意に第三者と、または電子メール&lt;br&gt;メールの保護とパスワードのセキュリティに重大な不注意があった場合、両方(節3.2および/または4.10を除く)。あなたはこのような不正な取引のいずれかによって生じるすべての損失について責任を負います。最初の35ポンドだけではありません。</p><p><br></p><p>私たちとあなたとの間に許可されていない取引かどうかについて紛争がある場合、私たちは紛争を解決する間にあなたの電子マネーのウォレットに一時的に記入することができます(ただし義務はありません)。取引が許可されたことが確認された場合、事前にお知らせすることなくクレジットを取り消し、e-money Walletの声明に記載されているエラーを訂正することがありますが、この期間中にあなたのe-money Walletが一時的にロックされ、さらなる不正取引を避けることができますのでご注意ください。あなたのe-money財布に一時的に入金されたe-moneyを転送する場合、あなたはまた私たちに対して(債務として)責任を負います。</p><p><br></p><p>(B)誤取引-電子マネーのウォレットです。</p><p><br></p><p>私たちの行為やミスにより、あなたの電子マネーのウォレットで不正確な取引が行われた場合、私たちは直ちにその取引の金額を返金し、あなたの電子マネーのウォレットを不正確な取引が発生していない元の状態に戻します。私達はまた可能な限りあなたに合理的な通知を提供します。私たちはまた、私たちが責任を負う費用、およびあなたが不正確な取引のためにあなたが支払う必要があることを証明できるすべての金利を支払います。私たちがどのような責任を負うにせよ、あなたの要求に応じて、私たちはあなたが開始した任意の間違った取引を無料で追跡しようと試みます。しかし、このような取引を追跡できる保証はありません。</p><p><br></p><p>4.10監督する第三者の任命を受けます。chapt3.2に記載されているように、電子マネーのワレット(「監視された第三者」)にアクセスする適切な監視対象の第三者を指定することができます。そうすれば、このようなアクセスによって、監視対象の第三者があなたの取引および他のデータにアクセスする可能性があり、および/または、電子マネーのウォレットから送金を開始する可能性があることを理解すべきです。あなたは、上記のセクション3.2で説明されているように、あなたのPLATFORM_TITLEアカウントに対して監督された第三者がとるいかなる行動に対しても責任を負うことになります。我々は、以下の節4.11で説明するように、監督される第三者へのアクセスを拒否する権利を保持します。</p><p><br></p><p>4.11は規制された第三者との取引を拒否します。私たちは、電子マネーのワレットへの不正アクセス、マネーロンダリング、テロ資金調達、詐欺、またはその他の金融犯罪に関連する、客観的かつ十分な証拠のある理由で、規制されている第三者へのアクセスを拒否する可能性があります。この場合、法律で禁止されない限り、監視対象の第三者からのアクセスが拒否されたこととその理由をお知らせします。アクセス拒否の理由がもはや存在しないと確信したら、再度アクセスを許可します。</p><p><br></p><p>4.12同意します。こちらにPLATFORM_TITLEアカウントを開設することで、決済サービス(つまり電子マネーサービス)を提供することを明確に同意していただきます。PLATFORM_TITLEアカウントを閉じることでいつでもこの同意を取り消すことができます。疑問を避けるため、この同意は私達がデータ保護法律法規に従ってあなたの箇人情報またはあなたの権利を処理することとは関系ありません。以下のセクション11(データ保護)と私たちのプライバシーポリシーを参照して、私たちがあなたの個人データをどのように扱うか、そしてあなたが持つ権利を理解してください。</p><p><br></p><p>4.13金融監視員サービスです。PLATFORM_TITLE Paymentsがあなたの提供する電子マネーサービスに苦情を申し立てる場合、かつその苦情が第10.2条に規定された紛争手続きによって解決されない場合は、ファイナンシャル・オンブズ・サービス(FOS)に未解決の苦情を申し立てることができます。10.2条に規定された争議手続きが完了するまで、FOSに苦情を申し立てることはありません。FOSとFOSに問題を提出する資格のあるクレーマーのタイプに関する更なる情報は、以下の詳細情報を使用して見つけることができます:</p><p><br></p><p>住所:金融監視員サービス、トレーディングタワー、港湾取引所、ロンドン、E14 9SRです</p><p><br></p><p>電話番号は0800 023 4567または0300 123 9 123です</p><p><br></p><p>eメール:complaint.info@financial-ombudsman.org.ukです</p><p>5、デジタル通貨サービスです。</p><p><br></p><p>5.1総則です。デジタル通貨ワレットを利用すると、ウェブサイトを介して、PLATFORM_TITLEプラットフォーム以外のユーザーや第三者にデジタル通貨を送信したり、要求したり、受信したり、保管したりすることができます(このような取引はすべて「デジタル通貨取引」となります)。デジタル通貨交換サービスは、以下の方法を使用してPLATFORM_TITLEプラットフォーム上でデジタル通貨を購入することができます。(A) PLATFORM_TITLE Paymentsと一緒に所有しているe-moneyウォレット内のe-moneyから。</p><p><br></p><p>(B) PLATFORM_TITLEが支援する中央銀行発行通貨(例えばポンドやユーロ)です。および/またはです</p><p><br></p><p>(C)あなたのデジタル通貨ウォレットにある他のデジタル通貨です。逆に、プラットフォームPLATFORM_TITLEでデジタル通貨を販売する場合は、次のようなメッセージを受け取ることができます。</p><p><br></p><p>(D) PLATFORM_TITLE Paymentsでお持ちの電子マネーを入金します。</p><p><br></p><p>貨幣の財布です;</p><p><br></p><p>(E) PLATFORM_TITLEが支援する中央銀行発行通貨(例えばポンドやユーロ)です。および/またはです</p><p><br></p><p>(F)あなたのデジタル通貨ウォレット内の他のデジタル通貨です。PLATFORM_TITLEは、顧客がPLATFORM_TITLEプラットフォーム上でデジタル通貨を購入・販売することを促進し、支援します。</p><p><br></p><p>5.2法定通貨取引(電子マネーウォレットを使用しません)。デジタル通貨ウォレットに有効な支払い方法をリンクさせることで、対応デジタル通貨を購入することができます。あなたは私達にあなたの購入を完了するためにあなたの選択した支払い方法を使用して資金をデビットすることを許可します。できるだけ早くデジタル通貨をお渡ししようと試みますが、ご自身のデジタル通貨の取引状態が完了したと表示されるまで、ご選択の支払い方法から金額が差し引かれ、デジタル通貨がごデジタル通貨ウォレットにお渡しされる場合があります。デジタル通貨を販売することで、PLATFORM_TITLEがサポートする法定通貨(ポンドやユーロなど)と交換することができます。この場合、あなたは私たちがデジタル通貨ワレットからお金を引き落とし、販売取引を決済するためにあなたが選択した支払い方法に記入するコマンドを送信することを許可します。私たちはできるだけ早くこれらの説明書を送ります。私達がこのような指示を送った後の作業日が終了する前に、どの法定通貨もあなたの選択した支払い方法に記入されるべきです。</p><p><br></p><p>5.3取引を履行します。私たちは、デジタル通貨のすべての購入に合理的な努力を尽くすつもりですが、場合によってはそうはいかないかもしれません。このような場合、私たちはあなたに通知し、現在のレート(以下のように定義されています)で再度購入を試みるために承認を求めます。</p><p><br></p><p>5.4支払い方法の可用性です。支払い方法の利用可能性は、例えばあなたの位置、あなたが私たちに提供した識別情報、第三者の支払い処理業者によって課せられた制限など、多くの要因に依存します。</p><p><br></p><p>5.5変換料です。デジタル通貨を購入したり売ったりするたびに費用(「両替料」)がかかります。適用される変換料は、各取引の前にwebサイトに表示され、私たちが発行する領収書1枚1枚に記載されます。私たちはいつでも変換料を調整することができます。変換費用とその他の関連費用があなたの取引価値を上回る場合、私たちは取引を処理しません。PLATFORM_TITLE Kenya料金の完全なリストは、当社の価格設定および料金開示ページで見ることができます。</p><p><br></p><p>5.6為替レートです。デジタル通貨を買ったり売ったりするたびに、与えられた取引の為替レートの影響を受けます。「為替レート」とは、サイト上で法定通貨として表示されている支持デジタル通貨の所与の価格のことです。為替レートは「買い値」または「売り値」で表示され、デジタル通貨をそれぞれ購入または売却できる価格です。あなたは任意の所与の時点で買値レートと売値レートが異なる可能性があることを認めて、そして私達は提示レートに手付金または「ポイント差」を追加するかもしれません。取引を許可するとき、あなたはレートを受け入れることに同意します。PLATFORM_TITLE Kenyaの為替レートに関する詳細な情報は、ウェブサイトの「価格設定と料金の開示」ページからおわかりいただけます。我々はいかなる為替レートの利用可能性も保証しません。私たちは、あなたが公開市場において、特定の価格または時間において、あなたのデジタル通貨を購入および/または販売できることを保証しません。</p><p><br></p><p>5.7授権します;逆転します;キャンセルします。ウェブサイト上の「購入」または「販売」ボタンをクリックすることで、PLATFORM_TITLEがオファーの購入価格または売却価格で取引を開始することを許可し、パートナーdへの変換料、交換料、その他任意の費用に同意します。完了または処理対象と表示された取引をキャンセル、撤回、または変更することはできません。お支払いが成功しなかったり、お支払い方法の資金が不足している場合は、取引をキャンセルするか、電子マネーのワレットおよび/またはデジタル通貨上の残高ワレットを含む他のお支払い方法から差し引くことを当社に委任して、必要な金額をすべて完了させます。あなたは支払プロバイダーが当座貸し越し、資金不足、または同様の料金を請求しないように、十分な残高および/または十分な信用限度を維持する責任があります。PLATFORM_TITLEは、このような支払い不足が解消されるまで、PLATFORM_TITLE消費者、PLATFORM_TITLE Proを含むPLATFORM_TITLEサービスへのアクセスを一時停止する権利を保持します。</p><p><br></p><p>5.8デジタル通貨の取引です。私たちは、あなたが受け取った指示に従ってデジタル通貨の取引を処理します。私たちに指示を出す前に、あなたはすべての取引情報を確認すべきです。私たちは、ユーザー、受信者、要求された側、または他の第三者のアイデンティティを保証するものではなく、あなたが提供する情報が正確で完全であることを保証する責任または義務を負いません。デジタル通貨の取引は、いったん当該デジタル通貨ネットワークに放送されると、廃止することはできません。受信者のメールアドレスや携帯電話番号を入力してデジタル通貨の取引を開始しても、受信者が既存のPLATFORM_TITLEアカウントを持っていない場合は、PLATFORM_TITLEアカウントの開設を呼びかけます。受取人が30日以内にPLATFORM_TITLEアカウントを開設していない場合、関連するデジタル通貨をあなたのデジタル通貨ウォレットに返金します。あなたに代わってデジタル通貨取引を処理するために、ネットワーク料金(「マイナー料金」)を請求する場合があります。マイナー料金の算定は当社で決定しますが、デジタル通貨取引の承認時(またはその前)には常にマイナー料金をお知らせします。PLATFORM_TITLEKenyaマイナー料金の完全なリストは、当社のウェブサイトの「価格設定と料金の開示」ページで見ることができます。取引ごとのマイナー手数料は、チェックアウトページでの購入時に開示されます。あなたまたは第三者が非PLATFORM_TITLEホストされた外部ワレットからPLATFORM_TITLEデジタル通貨ワレットにデジタル通貨を送信する場合、取引を開始した者は、取引をスムーズに完了させるためにマイナー手数料を支払うことも含めて、取引を正確に実行する責任を負います。作業者料金の不支払いにより、あなたの取引はPLATFORM_TITLE Kenyaの制御不能な処理対象状態になる可能性があります。取引の起動エラーによる遅延や損失については責任を負いませんし、そのような取引の救済に協力する義務もありません。いったんデジタル通貨ネットワークに提出すると、デジタル通貨の取引はしばらく確認されず、デジタル通貨ネットワークによる取引の確認が十分に行われるまで待ちます。処理対象のデジタル通貨の取引は未完了です。処理対象のデジタル通貨取引に関連するデジタル通貨は、それに応じて指定され、ネットワークが確認するまであなたのデジタル通貨ウォレット残高に含まれないか、またはデジタル通貨取引に利用可能です。また、マネーロンダリング、テロ資金調達、詐欺、またはその他の金融犯罪があった場合など、法律、規制、またはPLATFORM_TITLEが管轄する管轄区域内の裁判所またはその他の機関の要請に従って、処理対象となるデジタル通貨取引の処理を拒否し、または取り消すこともできます。</p><p><br></p><p>5.9でサポートされるデジタル通貨です。当社のデジタル通貨サービスは、PLATFORM_TITLEが対応しているデジタル通貨(「対応デジタル通貨」)のみに対応しており、時々変更される場合があります。いずれの場合も、当社がサポートしていない形態でデジタル通貨を保存、送信、要求、または受信しようとしては、あなたのデジタル通貨ウォレットを使用してはいけません。我々がサポートしていないデジタル通貨にあなたのデジタル通貨ウォレットを使用するいかなる試みについても、我々は責任または義務を負いません。PLATFORM_TITLEは、あなたのPLATFORM_TITLEアカウントに関連付けられたウォレットに送信されたサポートされていないいかなるアセットに対しても責任を負わないことを承認し、同意します。現在サポートしているデジタル通貨についてご質問がございましたら、https://help.PLATFORM_TITLE.comをご覧ください。</p><p><br></p><p>5.10でデジタル通貨のサポートが終了します。PLATFORM_TITLEは、任意のデジタル通貨のサポートを終了することを自ら決定することができます。PLATFORM_TITLEは、このようなサポートの終了を宣言するために、あなたのPLATFORM_TITLEアカウントに関連付けられた電子メールアドレスに少なくとも10日前に電子メールで通知します(適用される法律または規制当局がより短い期間を要求しない限り)。この期間中にプラットフォームの外でこのようなデジタル通貨を販売または送信しない場合、PLATFORM_TITLEはあなたのアカウントからこのようなデジタル通貨を引き出し、サポートしているデジタル通貨または法定通貨の市場価値をあなたのPLATFORM_TITLEアカウントに記入する権利を保持します(額面価格は私たちの合理的な裁量権にあります)。</p><p><br></p><p>5.11 USDCウォレットです。利用可能な場合は、PLATFORM_TITLEからUSD Coinを購入することもできます。これは完全にドル抵当型のデジタル通貨で、Circle Internet Financial(「Circle」)が発行し、PLATFORM_TITLE(「USDC」)がサポートしています。あなたは、あなたの「USDCウォレット」残高の所有者です(つまり、PLATFORM_TITLE Kenyaは、USDCを所有し、USDC内のデジタル通貨を取引するためにあなたのデジタル通貨ウォレットを提供します)。PLATFORM_TITLEはUSDCの発行者ではなく、USDC保有者のためにドル(「USD」)を保有しておらず、USDCをドルで買い戻す義務もありません。Circleを通じてUSDCを交換することができ、PLATFORM_TITLEはドルと交換してUSDCを買い戻すこともできます。あなたの同意を受けサークルusdc合意(https://support.usdc.circle.com/hc/en-us/articles/360001233386-circle-usdc-user-agreement)に条項の取り締まり、このプロトコルは、USDCに関する追加の義務、約束、および制限を提供します。</p><p><br></p><p>5.12経常デジタル通貨取引です。あなたがデジタル通貨の定期購入(「将来の取引」)を設定している場合、あなたの銀行口座に関連付けられたあなたの選択したデジタル通貨取引および任意の対応する支払い口座(例えば直接デビットまたはローン)に基づいて定期的な電子支払いを開始することを、私たちに許可します。あなたの将来の取引は、あなたまたはPLATFORM_TITLEが将来の取引をキャンセルするまで、あなたの選択した期間(例えば、毎日、毎週、毎月)に応じて同じ定期分割払いで行われます。将来の取引の支払い手段として銀行口座を選択した場合、当該取引が当該銀行が所在する地域の週末または祝日、または当該銀行の営業時間後に行われた場合、ローンまたはデビットは翌営業日に実行されますが、定期取引時にデジタル通貨の料金が請求されます。もしあなたの銀行がPLATFORM_TITLEへの支払いを処理できない場合、私たちはあなたに取引のキャンセルを通知し、本契約に規定されている救済措置を利用してPLATFORM_TITLEの未払い金額を回収することができます。この許可は、あなたが将来の取引設定を変更するまで、またはhttps://help.PLATFORM_TITLE.comを通じて私たちに書面通知を提供するまで、完全に有効なままです。PLATFORM_TITLEに関連付けられた銀行口座情報の変更を、今後の取引の前に書面で通知することに同意します。PLATFORM_TITLEはいつでもあなたに通知を出すことで将来の取引を終了することができます。</p><p><br></p><p>5.13追加協議除外します。webサイト上で明示的に宣言されない限り、またはPLATFORM_TITLEの公式な宣言によって、または本契約で規定された他の方法によって、サポートされるデジタル通貨は、サポートされるデジタル通貨を補完する、または相互作用する他のすべてのプロトコルおよび/または機能を含みません。この除外には、メタコイン、カラーコイン、サイドチェーンまたは他の派生、強化またはフォークプロトコル、トークンまたはコイン、または質、プロトコルガバナンス、および/またはサポートデジタル通貨を補完または相互作用する可能性のある任意のスマートコントラクト機能などが含まれますが、これらに限定されません。PLATFORM_TITLEプラットフォームは、これらの取引および機能を検出、保護、または処理するように構成されていないので、他の種類の取引を受信、要求、送信、保存、または参加する機能、またはそのような追加プロトコルに関与する機能をPLATFORM_TITLEアカウントを使用してはいけません。このような品物のいかなる取引の試みもその品物を失うことになります。本契約の規定を除き、追加契約はサポートされているデジタル通貨から除外され、PLATFORM_TITLEは追加契約に関連するいかなる損失に対しても責任を負いません。</p><p>5.14デジタル通貨プロトコルの操作です。私たちは、プラットフォーム上でサポートされているデジタル通貨の動作を管理するソフトウェアプロトコルを所有していませんし、制御もしていません。基本的に基本プロトコルは「オープンソース」であり、誰でも利用、複製、修正、配布することができます。我々は基礎となるプロトコルの運用について責任を負いません。我々はネットワークの運用の機能性や安全性を保証することはできません。あなたのデジタル通貨ワレットに保存されているあらゆるデジタル通貨に関連したソフトウェアプロトコルが変更される可能性があるというリスクを認め、受け入れます。特に、基本的なプロトコルは、「フォーク」を含むオペレーションルールの急な変化の影響を受ける可能性があります。このような重大な運用変更は、あなたのデジタル通貨ワレットに保存されているデジタル通貨の可用性、価値、機能、および/またはtの名前に大きな影響を及ぼす可能性があります。PLATFORM_TITLEは、このような大きなオペレーションの変化のタイミングや特徴を制御しません。あなたはこれから起こる運用の変化を自分自身に理解させる責任があり、影響を受けるデジタル通貨の取引のためにあなたのPLATFORM_TITLEアカウントを使用し続けるかどうかを判断する際には、利用可能な情報とPLATFORM_TITLEが提供する可能性のある情報を公開することを慎重に考慮しなければなりません。このような運用変更が発生した場合、PLATFORM_TITLEは、PLATFORM_TITLEのプラットフォーム上に保有する資産の安全性を保護するために必要な措置を取る権利を保持します。これには、関連するデジタル通貨の運用を一時的に停止する他の必要なステップが含まれます。PLATFORM_TITLEは、重大な運用変更に対する応答を通知するために最善を尽くします。ただし、このような変更はPLATFORM_TITLEの制御範囲外であり、PLATFORM_TITLEへの通知なしに発生する可能性があります。PLATFORM_TITLEは、新しいデジタル通貨、フォーク、その他のアクションを一切サポートしないという決定を含む、重大なオペレーション変更への対応を独自に決定します。あなたはデジタル通貨プロトコルの動作変更のリスクを認め、受け入れ、PLATFORM_TITLEはそのような動作変更の責任を負わず、また動作規則のこのような変更に起因するいかなる価値損失の責任も負わないことに同意します。PLATFORM_TITLEは、いかなる運営の変化に対する応答も、あなた自身で決定する権利があり、私たちは、サポートされていない通貨またはプロトコルの取り扱いを支援する責任はありません。</p><p><br></p><p>5.15いくつかのデジタル通貨の代替可能性です。PLATFORM_TITLEは、複数のブロックチェーン・プロトコル(例えば、第2層ネットワーク、第1層ネットワークの代わりに、またはサイドチェーン)にまたがる複数の異なる方法で、あなたのデジタル通貨ワレットにサポートされたデジタル通貨を保存することができることを承認し、同意します。あなたのデジタル通貨ワレットにサポートされたデジタル通貨を保有している場合、PLATFORM_TITLEはそのようなデジタル通貨を主要なブロックチェーン・プロトコルから移し、PLATFORM_TITLEが制御する共有ブロックチェーン・アドレス上に保存することができます。これらと互換性のある形で代替ブロックチェーン・プロトコルにプロトコルしています。あなたは、(a)このようなデジタル通貨の任意の形態を含むか、(b)このようなデジタル通貨の任意の形態を格納するブロックチェーン・プロトコルにかかわらず、複数のブロックチェーン・プロトコルにまたがって所有および提供されるすべての形態の同じデジタル通貨は、互換性があり、互いに等価であるとみなされることに同意します。</p><p><br></p><p>5.16デジタル通貨のストレージと転送遅延です。PLATFORM_TITLEグループは、デジタル通貨の秘密鍵をオンラインとオフラインを組み合わせた方法で安全に保存しています。我々のセキュリティプロトコルは、デジタル通貨取引の開始または記入を遅らせる可能性があります。</p><p><br></p><p>5.17第三者の支払いです。任意の第三者(デジタル通貨サービスの利用を含む)から利用する場合があります。私たちはあなたと取引を行う第三者の買い手または売り手が取引を完了するか、または許可されることを保証する責任はありません。デジタル通貨サービスを使用して第三者から購入または販売した商品またはサービスに問題がある場合、または第三者と紛争がある場合は、第三者と直接紛争を解決しなければなりません。第三者の行為が詐欺的、誤解を招く、または不適切な行為であると判断される場合、または第三者との紛争を十分に解決できない場合は、以下の方法でPLATFORM_TITLEのサポートを通知することができます:trust@PLATFORM_TITLE.comは、我々がどのような措置を取るかを検討するために。</p><p><br></p><p>5.18 PLATFORM_TITLE金庫です。PLATFORM_TITLEはマルチシグネチャ金庫の使用をサポートしていません。PLATFORM_TITLE Vaultのような他のサービスを利用することもできます。PLATFORM_TITLE Vaultは引き出し時間の遅延を設定し、デジタル通貨の保管と転送のための他の条件を作ることができます。そのような製品やサービスに関する別のルールが適用される場合があります。PLATFORM_TITLE Vaultに関するさらなる情報はこちらです:https://help.platform_title.com/customer/en/portal/articles/2877996-vaults-faq?b_id=13521。</p