で使用します。あなたの取引口座へのアクセス権を、他のエンティティ、またはあなたの従業員や代理人ではない個人に販売、貸与、提供、またはその他の方法で許可または提供してはいけません。あなたは、あなたの従業員または代理人がAdvanced Tradingを使用することに対して、すべての責任を負います。そのような使用がPLATFORM_TITLEによって直接行われるか、あるいは、APIキーおよび/またはあなたが許可する可能性のあるアプリケーションによって促進されるかにかかわらず。あなたのアカウントに関連する識別子、権限、パスワード、セキュリティコードを含む、高度な取引に入るあらゆる註文、取引、およびその他の命令に対する責任を理解し、同意します。</p><p><br></p><p>(D)一時停止とキャンセルです。あなたのアカウントが停止または終了された場合、私たちは直ちにあなたのアカウントに関連するすべての未完了註文をキャンセルし、すべての引き出しを阻止し、それ以上の註文を禁止します。解決またはアカウントがキャンセルされるまで。</p><p><br></p><p>6.取引規制とデューデリジェンスの強化</p><p><br></p><p>6.1取引制限です。すべてのPLATFORM_TITLEサービスの利用は、取引量によって制限され、ポンド、ユーロ、またはその他の法定通貨またはデジタル通貨で表され、所与の時間帯(例えば毎日)に取引または送金を行うことができます。詳細は、付録2(検証手順と制限)をご参照ください。ご制限を確認するには、PLATFORM_TITLEのアカウントにログインして、https://&lt;br&gt;www.PLATFORM_TITLE.com/verificationsへアクセスしてください。あなたの取引限度額は、お支払い方法、完了した検証手順、その他の要因によって異なる場合があります。私たちは、私たちが必要と認める場合に適用制限を変更する権利を留保します。限度額を公表以上に引き上げたい場合は、https://help.PLATFORM_TITLE.comで請求することができます。</p><p><br></p><p>6.2デューデリジェンスを強化します。制限の引き上げをご希望の場合は、ご自身またはご業務に関するその他の情報の提出、記録の提供、PLATFORM_TITLEの従業員との会議の予定(「デューデリジェンスの強化」)を要求するかもしれません。私たちは、このような強化デューデリジェンスに関連したコストと費用を請求する権利を留保しますが、もし私たちがそうするつもりであるならば、あなたがこの請求を継続することを望むかどうかを決定するために、私たちはあなたに前もってお知らせします。私たちの判断によると、私たちはあなたの制限を高めることを拒否するか、またはあなたが強化デューデリジェンスを完了した場合でも、私たちはあなたの制限を後で下げるかもしれません。</p><p><br></p><p>7.Sは使用を一時停止して、終了して取り消します。</p><p><br></p><p>7.1停止、終了、およびキャンセルします。私たちはできます:(a) PLATFORM_TITLEアカウントから資金を差し引いても、許可された取引を完了または保留、阻止、キャンセルまたは撤回することを拒否します。(b)あらゆるPLATFORM_TITLEサービスへのアクセスを一時停止、制限、または終了します。および/または(c)いずれかの理由であなたのPLATFORM_TITLEアカウントを直ちに停止またはキャンセルします。以下を含みますがこれらに限定されません。</p><p><br></p><p>(A)私たちの評判を守るために必要だと信じる理由があります</p><p><br></p><p>(B)私たちは合理的に、適用される法律、規則、または私たちがいかなる管轄区域でもその管轄下にあるいかなる裁判所またはその他の当局が私たちにこのようなことを要求していると考えます。</p><p><br></p><p>(C)私達はあなたの行為が本契約に違反することを疑う理由があります;</p><p><br></p><p>(D)私たちはあなたが私たちの「行動ポリシー」または「使用禁止、業務禁止、条件付き使用ポリシー」に違反した疑いがある理由があります(付録1に記載)。</p><p><br></p><p>(E)取引エラーやあなたのPLATFORM_TITLEアカウントのセキュリティを心配します。あるいはPLATFORM_TITLEサービスが詐欺や不正な方法で使用されている疑いがあります。</p><p><br></p><p>(F)資金洗浄テロ資金調達詐欺その他の金融犯罪が疑われます</p><p><br></p><p>(G)あなたのPLATFORM_TITLEアカウントの使用は、係属中の訴訟、調査、または政府の手続きの影響を受けること、および/または私たちがあなたのPLATFORM_TITLEアカウントの活動に関連する法律または規制違反のリスクが増加すると考えることです。および/またはです</p><p><br></p><p>(H) PLATFORM_TITLEアカウントを複数開設したり、我々が時々提供する可能性のある販促キャンペーンを悪用するなど、我々のコントロールを回避する可能性のある行動を取ることです。あなたの電子通貨ワレット内の電子マネーが不十分である場合、および/またはあなたのデジタル通貨ワレット内のデジタルマネーが取引および適用されるように支払いに不十分である場合、また、私たちが取引の通知を受け取ったとき、またはあなたのクレジットカードまたはデビットカード、またはあなたのPLATFORM_TITLEアカウントまたはデジタル通貨ワレットに関連付けられた他の有効な支払い方法が拒否されたとき、許可された取引を完了または阻止、キャンセルまたは撤回することを拒否する可能性があります。</p><p>7.2当社が取引の完了および/またはPLATFORM_TITLEアカウントの停止、制限、または停止、および/またはPLATFORM_TITLEサービスの使用の終了を拒否する場合、当社の行動および拒否、停止、または停止の理由を(違法でない限り)お知らせします。また、適切な場合には、PLATFORM_TITLEアカウントの拒否、停止、または停止の原因となる事実上の誤りを訂正するプログラムです。私たちはPLATFORM_TITLEアカウントの取引完了および/または停止を拒否します。拒否および/または停止の原因がもはや存在しない場合、合理的に実行可能な限りできるだけ早く停止を解除または完了します。しかし、一時停止、撤回、またはキャンセルされた取引と同じ価格または同じ条件で取引を再開させる義務はありません。PLATFORM_TITLEサービスのいずれかまたはすべてへのアクセスを停止、制限、または終了し、かつ/またはPLATFORM_TITLEアカウントを2ヶ月前に通知することなく停止またはキャンセルする場合があります。PLATFORM_TITLEアカウントへのアクセス制限、一時停止、または停止を含む何らかの行動を取るという当社の決定が、当社のリスク管理およびセキュリティプロトコルにとって必要不可欠な機密基準に基づく可能性があることを承認されました。PLATFORM_TITLEがリスク管理およびセキュリティ手順の詳細をあなたに開示する義務がないことに同意します。</p><p><br></p><p>7.3終了または停止の結果です。何らかの理由で本契約が終了した場合、適用される法律またはPLATFORM_TITLEがいかなる管轄区域においてもその管轄下にある裁判所または他の命令で禁止されない限り、あなたはあなたのPLATFORM_TITLEアカウントにアクセスすることができます:</p><p><br></p><p>(A)その後90日以内に、あなたのデジタル通貨ウォレットおよび/またはPLATFORM_TITLEプラットフォームからデジタル通貨を転送する目的で行います。および/またはです</p><p><br></p><p>(B)この契約の終了日から6年以内の任意の時点で、あなたのe-moneyウォレットおよび/またはPLATFORM_TITLEプラットフォームからe-moneyを引き出すために使用されます。その間、PLATFORM_TITLEサービスまたはあなたのPLATFORM_TITLEアカウントを他のいかなる目的にも使用してはいけません。適宜、PLATFORM_TITLEプラットフォームの機能を制限するか、またはそれに応じてあなたのウェブサイトへのアクセスを制限することができます。私たちが何らかの理由であなたのPLATFORM_TITLEアカウントを一時停止または停止したり、PLATFORM_TITLEサービスの使用を終了したりした場合、私たちはあなたへの要求を保留します。</p><p><br></p><p>セクション3.3 (id認証)に概説されているプログラムの権利を取得してから、デジタルマネーや電子マネーの移転や引き出しを許可します。いつでも抽出してあなたのための電子貨幣の财布やデジタル通貨の财布の中のすべての残高を訪問、https://www.platform_title.com/settings/cancel贵方を取り消しplatform_title口座に来ます。キャンセルは、あなたのPLATFORM_TITLEアカウントを入力するために課金されませんが、あなたは私たちの未払い金を支払う必要があります。あなたは私達がキャンセル時に処理すべき取引をキャンセルまたは停止することを許可します。</p><p><br></p><p>8.責任です</p><p><br></p><p>8.1 PLATFORM_TITLEのリリースです。PLATFORM_TITLEサービスの1人または複数のユーザー(PLATFORM_TITLEを除く)と紛争が発生した場合、当社、当社の関連会社またはサービスプロバイダー、ならびに当社のそれぞれの役員、取締役、エージェント、ジョイントベンチャー、従業員、代表者に同意していただけます。このような紛争に起因する、または何らかの方法で関連する、あらゆる種類または性質のクレーム、要求、損害賠償(実際および対応する、直接または間接的)に対して責任を負います。</p><p><br></p><p>8.2補償します。付録1に記載されたような費用(弁護士費用、罰金、費用、または当社の違反および/または当社による本契約の実施(当社の「行動ポリシー」または当社の「ポリシーによる使用禁止、業務禁止、条件付き使用」の違反を含むがこれらに限定されません)について、または法律、規則、規制、または第三者の権利への違反に同意ください。</p><p><br></p><p>8.3責任制限です。PLATFORM_TITLEの本契約違反によるあなたの損失、コスト、責任または費用のいずれかの個人的な請求または一連の関連する請求に対するPLATFORM_TITLEの合計責任は、PLATFORM_TITLEに関連する違反行為が発生した場合の最大合計に限定されるべきです。e-moneyウォレットとデジタル通貨ウォレット内のデジタル通貨とe-moneyの合計価値を保存します。私たちが特定の取引に関連した特定のクレームを検討している場合、その金額は係争中の取引の購入/販売の金額(関連する場合)にさらに制限されるべきです。</p><p><br></p><p>8.4損失制限です。上記のセクション8.3(責任制限)における責任の上限を除いて、いずれの場合にも、当社、当社の関連会社またはサービスプロバイダ、または当社またはその管理者、取締役、代理人、従業員、または代表者は、本契約またはその他の方法によって引き起こされる、またはそれに関連する以下の種類の損失または損害を一切負いません。</p><p><br></p><p>(A)予期された取引利益の損失および/または実際または想定された直接または間接的な取引損失を含む利益の損失または予期された収益または利益の損失は、たとえ我々が知らされたか知っていたとしても、あるいは同じ可能性を知っていたはずです。これが意味するのは、単なる例として(前文の範囲を限定するものではなく)、当社がデジタル通貨の取引を適切に処理できなかったと主張する場合、あなたの損失は、デジタル通貨の支持された価値以上の取引に関与しない通貨および電子マネーに限定され、取引の利益が予想される「損失」、またはデジタル通貨の売買ができなかったことによる実際の取引の損失を補償することができない場合があります。</p><p><br></p><p>(B)評判やのれんによる損失や損害です。任意の業務や机会、顧客や契約の損失です;任意の間接費用、管理または他の従業員の時間の損失または無駄です;または任意の他の直接または間接的な収入の損失または実際または予期された節約、たとえ私達が教えられるか知っているか同じ可能性を知っているはずです;</p><p><br></p><p>(C)任意のハードウェア、ソフトウェアまたはデータの使用の損失および/またはデータの任意の破損です。デジタル通貨価格データの不正確、欠陥、または欠落による、または、それに関連する損失または損害を含みますが、これらに限定されません。このようなデータの送信のエラーまたは遅延;および/またはこのようなデータの任意の中断です;と</p><p><br></p><p>(D)当社が本契約に違反したことによる直接的な損失または損害ではないもの(そのような損失または損害を証明できるかどうかに関わらず)です。</p><p><br></p><p>8.5法律を適用します。本第8条(責任)における責任制限は、適用される法律および規則に基づき、PLATFORM_TITLEサービスを提供する際に合理的な慎重さと技能を行使する義務があります。本契約のいかなる内容も、私たちの詐欺や詐欺的陳述、重大な過失、故意の不当行為、私たちまたは私たちの下請業者の不注意による死亡や人身傷害の責任を制限するものではありません。</p><p><br></p><p>8.6保証な