</p><p><br></p><p>9.2ウェブサイト正確性です。正確でタイムリーな情報をウェブサイト上で提供することを意図していますが、ウェブサイト(コンテンツを含みますがこれらに限定されません(以下の定義を参照))は、必ずしも完全に正確で、完全で、最新であるとは限らず、技術的に不正確であったり、印刷ミスであったりすることがあります。可能な限り完全で正確な情報をご提供し続けるため、当社のポリシー、製品、サービスに関する情報を含みますが、これらに限定されるものではありませんが、適用法の範囲内で随時変更または更新される場合があります。したがって、あなたはすべての情報に依存する前にそれを検証すべきであり、当サイトに含まれる情報に基づくすべての決定はあなた自身の責任であり、私たちはこのような決定に対して何の責任も負いません。これらに限定されるものではありませんが、第三者の資料へのリンクはnienceとして提供される場合があります。当サイトからアクセスまたはリンク可能なこのような第三者の資料に含まれる情報、コンテンツ、またはサービスのいずれの側面についても、私たちは責任を負いません。</p><p><br></p><p>10。顧客のフィードバック、問い合わせ、苦情と紛争解決</p><p><br></p><p>10.1 PLATFORM_TITLEに連絡します。何かフィードバック、問題、苦情がありましたら、弊社の「カスタマーサポート」のページから弊社までご連絡ください。urlはhttps://help.PLATFORM_TITLE.comです。ご連絡いただいた際には、お名前、eメールアドレス、ご自身を識別する必要があるかもしれないその他の情報、PLATFORM_TITLEアカウント、フィードバック、問題または苦情のある取引に関する情報をご提供ください。</p><p>10.2クレームです。もしあなたがPLATFORM_TITLEと紛争がある場合、まずは私たちのサポートチームに連絡してこのような紛争を解決しようと試みることに同意してくださいます。弊社がサポートチームを通じて紛争を解決できない場合、あなたと弊社は第10.2節に規定されたクレームプロセスを使用することに合意します。あなたは、セクション10.4に規定された行動を開始する前に、このプロセスを使用することに同意します。あなたが10.4条に従って行動する前に、この10.2条に規定された手続きに従わない場合、私たちは、次のステップが完了するまで、関係する裁判所/当局にあなたの行動/申請を却下するように求める権利があります。PLATFORM_TITLEサポート部門と連絡してクレームを解決できなかった場合は、弊社のクレームリストを使用して、クレームの原因、クレームの解決方法、関連があると思われるその他の情報を記載してください。クレームフォームはPLATFORM_TITLEのサポートページhelp.PLATFORM_TITLE.comにあり、PLATFORM_TITLEカスタマーサポートから請求することもできます。クレームシートの提出後、私たちはあなたのクレームシートが届いたことを確認します。クレーム担当者(「担当者」)がクレームを検討します。当管理者はあなたの提供する情報に基づいてPLATFORM_TITLEで提供するいかなる情報もあなたの苦情に影響を与えずにあなたの苦情を考慮します。私たちがあなたのクレームを受信した後、15営業日以内に、当局者は、電子メール(\"解決通知\")を送信することによって、クレームで提起されたすべての問題を解決します。当局者は:(i)要求された方法でクレームを解決することを提案します;(ii)あなたのクレームを拒絶する決定をして拒絶の原因を説明します;あるいは、(iii)代替解決策を提示してクレームを解決します。場合によっては、当局者が15営業日以内にクレームに回答できない場合、当局者は(法律で禁止されていない限り)クレームに回答するのが遅れた理由を説明し、期限を指定します(我々がクレームを受け取ってから35営業日以内)。あなたに提示された解決案は、あなたが納得した場合のみ、私たちに拘束力を与えます。解決策を提案したからといって、クレームのテーマに関する不適切な行動や責任を認めることにはなりません。</p><p><br></p><p>10.3もし私たちが上記のセクション10.2に規定されたクレーム手続きによってあなたのクレームを解決することができない場合、あなたは以下のセクション10.4(A)から10.4(B)に適用されるあなたの争議手続きによってあなたのクレームをアップグレードすることができます。</p><p><br></p><p>10.4第10.2条に規定されたクレーム手続きが完了するまで、弊社はあなたのクレームの全部又は一部について、以下10.4(A)から10.4(B)に規定されたいかなる争議手続きも開始しないことにご同意くださいます。第10.2節またはこの第10.4節のいずれも、いずれの当事者も管轄権のある裁判所において、保全または同様の一時的救済を求めることを妨げるものと解釈されてはならないが、完了している。</p><p><br></p><p>(A)電子マネーサービスです。クレームがいずれかの電子マネーサービスと&lt;br&gt;関係がある場合、あなたはクレームをFOSに提出する権利があるかもしれません。</p><p><br></p><p>(B)この契約またはPLATFORM_TITLEサービス、PLATFORM_TITLEプラットフォームまたはウェブサイトの提供によって生じた、またはそれに関連するクレームまたは紛争について、上記10.2条に規定されたクレーム手続きによって解決できない場合、非-イングランドおよびウェールズの裁判所の排他的管轄権に提出します。ただし、消費者(取引、業務または専門性に関連する行為に従事していない箇人、「消費者」)は、管轄の裁判所でPLATFORM_TITLEを提訴するいかなる強制的な権利も、彼らの住む場所には侵害されません。</p><p><br></p><p>11.データ保護です。</p><p><br></p><p>11.1個人情報です。あなたに関連する箇人データ(個人であれば)を処理する可能性があること、また従業員および他の従業員または他の箇人(個人でなければ)にすでに提供(または将来提供)することを承認していただき、この契約またはPLATFORM_TITLEサービスに関連します。私たちは、このパーソナルデータトンを本契約の一部を構成するプライバシーポリシーに従って取り扱います。ですから、あなたは宣言し保証します:</p><p><br></p><p>(A)すべての適用されるデータ保護およびデータプライバシー法に基づいて、あなた以外の箇人に関連する任意の箇人データを私たちに開示し、かつ、これらのデータは開示時に正確で、最新で、関連があります。</p><p><br></p><p>(B)私たちにこのようなパーソナルデータを提供する前に、あなたが私たちのプライバシーポリシーを読み、理解したことを承認し、そのコピーをここで入手することができます。</p><p><br></p><p>(C)私たちがプライバシーポリシーの代替バージョンを随時提供する場合、あなたは直ちにこの通知を読み、プライバシーポリシーの更新されたコピーを更新されたプライバシーポリシーを含むウェブページに提供またはリダイレクトします。</p><p><br></p><p>12.安全です</p><p><br></p><p>12.1パスワードセキュリティです。PLATFORM_TITLEサービスにアクセスするには、ユーザー名とパスワードを含むセキュリティ詳細情報を作成または取得する必要があります。あなたは、PLATFORM_TITLEサービスへのアクセスに使用される電子機器の安全性を保証し、PLATFORM_TITLEサービスへのアクセスに使用される任意およびすべてのセキュリティの詳細について十分な安全性と制御を維持する責任があります。これには、このような電子機器の紛失、盗難、または誤用を回避するためのあらゆる合理的な措置を取ることと、このような電子機器が暗号化およびパスワード保護されていることを保証することが含まれます。あなたの電子機器またはあなたのセキュリティ詳細情報の紛失または破損は、あなたのPLATFORM_TITLEアカウント、ならびにあなたのPLATFORM_TITLEアカウントおよび関連する任意の電子マネー、デジタルマネー、または資金の紛失または盗難アカウントへの第三者の不正アクセス&lt;br&gt;を招く可能性があります。ご関連の銀行口座とクレジットカードが含まれます。あなたは常にあなたの安全な詳細な情報を確保しなければなりません。例えば、書き留めたり、他の人に見せたりしてはいけません。PLATFORM_TITLEアカウントにログインするとき、コンピュータおよび/またはコンピュータ画面をリモートからアクセスしたり、他の人と共有することを許可してはいけません。PLATFORM_TITLEはいずれの場合も、あなたのID、パスワード、または2ファクター認証コードの提供、または画面共有、または他の方法であなたのコンピュータまたはアカウントにアクセスしようとする試みを必要としません。節3.2および4.10によって特別に許可されない限り、アカウントにリモートアクセスするために、任意の第三者に詳細な情報を提供してはいけません。任意の通信または通知の真正性に不確実性がある場合は、当サイトを介して常にPLATFORM_TITLEアカウントにログインし、任意の取引または必要な操作を確認してください。PLATFORM_TITLEの無過失、および/またはこの12.1節に規定された要求に従わなかったこと、または当社の通知またはアラートに従っていないまたは従っていない行動の結果、アカウントのログイン資格情報が漏洩したことによるいかなる損失に対しても、私たちは責任を負いません。</p><p><br></p><p>12.2身元確認と検証です。PLATFORM_TITLEサービスにアクセスするには,ユーザーがeメールアドレスを提供し,パスワードを作成する必要があります。PLATFORM_TITLEは、ユーザのモバイルデバイス(ショートメッセージサービス(「SMS」)またはサポートされた時間ベースのワンタイムパスワードアプリケーションを介して二重のアイデンティティ認証を提供します。smsによる二重認証を可能にするには、認証された電話番号が必要です。ユーザは、PLATFORM_TITLEサービスにアクセスするための電子装置のセキュリティを維持し、十分なセキュリティを維持し、PLATFORM_TITLEサービスにアクセスするためのあらゆるおよびすべてのセキュリティ詳細を制御する責任を負います。これは、電子機器の紛失、盗難、または悪用を回避するためにすべての合理的なステップを取ることと、電子機器が暗号で保護されていることを確実にすることとを含みます。個人用電子機器またはセキュリティの詳細の紛失または漏洩は、第三者によるユーザーのPLATFORM_TITLEアカウントへの不正アクセス、任意の電子マネー、デジタルマネー、および/またはあなたのPLATFORM_TITLEアカウントに保有されている資金、および任意の関連アカウントの不正使用を引き起こす可能性があります。関連した銀行口座とクレジットカード/デビットカードが含まれます。</p><p><br></p><p>12.3セキュリティ・ホールです。PLATFORM_TITLEアカウントまたはセキュリティ詳細情報のいずれかが漏洩した疑いがある場合、または詐欺または詐欺を企てている場合、またはあなたおよび/またはPLATFORM_TITLEに影響を与えるその他のセキュリティイベント(総称して「セキュリティホール」と呼ばれるサイバーセキュリティ攻撃を含む)を発見した場合、以下のようにしなければなりません。</p><p><br></p><p>(A)できるだけ早く無料の電子メールでPLATFORM_TITLEのサポートを知らせますtrust@PLATFORM_TITLE.com、または私達に電話します:0808 168 4639、または+1(888)908 7930(国際料金を取ることができます);</p><p><br></p><p>(B)セキュリティホール全体にわたって正確かつ最新の情報を提供し続けること。</p><p><br></p><p>(C)セキュリティホールを減らす、管理する、または申告するために、我々が合理的に要求する手順を踏まなければなりません。タイムリーな通知が提供されていない適切な解決策を決定する場合、セキュリティホールが考慮される可能性があります。</p><p><br></p><p>12.4あなたのコンピュータと設備の安全と保証です。PLATFORM_TITLEは、あなたのコンピュータまたは他のデバイスに影響を与える可能性のあるコンピューターウイルスまたは他の悪意のあるコード、フィッシング、スプーフィング、または他の攻撃による損害または中断に対して責任を負いません。信頼性が高く、いつでも利用できるウイルス検診および予防ソフトを定期的に使用することをお勧めします。また、SMSや電子メールサービスは詐欺やフィッシング攻撃に脆弱であり、当社からのメッセージを確認する際には注意が必要であることもご承知の通りです。</p><p><br></p><p>13.普通です</p><p><br></p><p>13.1あなたは適用法を遵守します。PLATFORM_TITLEサービス、PLATFORM_TITLEプラットフォーム、ウェブサイトをご利用いただいています。</p><p><br></p><p>13.2リミテッドライセンスです。本契約の条項に基づき、本ウェブサイトおよび関連コンテンツ、資料、情報(総称して「コンテンツ」と呼ばれます)へのアクセスと使用を許可するための限定的、非排他的、譲渡不可能な許可を許可します。このウェブサイトまたはコンテンツの他の使用は、明示的に禁止されており、このウェブサイトまたはコンテンツの他のすべての権利、所有権および利益は、PLATFORM_TITLEおよびその所有者の財産です。全てであれ、一部であれ、複製、転送、配信、販売、ライセンス、リバースエンジニアリング、修正、配布または販売への参加、派生作品の作成、またはその他の任意の方法でコンテンツを利用しないことに同意します。「PLATFORM_TITLE.com」、「PLATFORM_TITLE」、「PLATFORM_TITLEPro」、「Pro.PLATFORM_TITLE.com」およびPLATFORM_TITLEサービスに関連するもの、またはウェブサイトに表示されるすべてのロゴは、PLATFORM_TITLEまたはライセンス元の商標または登録商標です。事前の書面での同意なしに、コピー、模倣、または使用することはできません。</p><p><br></p><p>13.3禁止と条件付きの使用です。PLATFORM_TITLEサービスのご利用、他のユーザーや第三者とのやりとりについて、「利用禁止、サービス禁止、条件付き利用に関するポリシー」(付録1に記載)を遵守されることに同意されます。ここに含まれるもののいずれも、不正、不正、詐欺、非倫理的、または不正な目的のために電子マネーまたはデジタルマネーを付与する、またはいかなる不正、不正、詐欺、非倫理的、または不正な活動を促進する、または促進することを意味するものと解釈されてはなりません。当社は、あらゆる適用法、規制、制裁計画、法的手続き、または政府の要求を満たすために、必要な情報を常に監視、審査、保持、および/または開示する権利を保持します。</p><p><br></p><p>13.4輸出規制と制裁です。あなたのPLATFORM_TITLEサービスとウェブサイトの使用は国際的な輸出規制と経済制裁要求に拘束されます。ウェブサイトまたはPLATFORM_TITLEサービスを介してデジタル通貨を送信、受信、購入、販売、取引、または保存することは、これらの要件を遵守することに同意したことを意味します。以下の場合、当サイト&lt;br&gt;を通じたデジタル通貨へのアクセス、またはPLATFORM_TITLEサービスの利用はできません。</p><p><br></p><p>(A)あなたは、キューバ、イラン、北朝鮮、スーダンまたはシリア、または米国の禁輸、国連の制裁、欧州連合(eu)または英国財務省の金融制裁を受けた他の国の地域のいずれかで、その支配下にあるか、または国民または住民制度(それぞれの「制裁対象国」)に属します。または、もしあなたが当局(金融制裁実施局(英国財務省の一部)が時々発行する経済制裁リストに含まれますが、これらに限定されない場合、米国商務省の拒否者リスト、未確認リストまたはエンティティリスト、またはeuの金融制裁制度)(「制裁対象者」);あるいは</p><p><br></p><p>(B)あなたは、制裁対象国(または制裁対象国の国民または居住者)または制裁対象者に対して、取得または保存されているデジタル通貨または電子マネー、またはPLATFORM_TITLEサービスを提供するつもりです。</p><p><br></p><p>13.5修正します。電子マネーサービスに関する契約の変更を、少なくとも2ヶ月前に電子メールにてお知らせいたします。この場合、&lt;br&gt;変更の発効日までにお知らせがなければ、変更を受けてPLATFORM_TITLEサービスをご利用いただいたものとみなされます。もしあなたが変更を受け入れないならば、私達に知らせなければならなくて、本契約は2ヶ月の通知が終わる時終了します。2ヶ月の通知期限までのいつでも、本契約を無料で終了することもできます。私たちは、改訂されたプロトコルをウェブサイトに公開するか、または電子メールで送付することによって、改訂されたプロトコルがいつ発効するかを示す他のすべての改訂(他のPLATFORM_TITLEサービスに関連するものも含む)を行うことができます。可能な限り事前にお知らせするよう努めますが、合法的な場合には、修正されたプロトコルは直ちに有効であることを示すことができます。このような修正に同意しない場合は、PLATFORM_TITLEアカウントを閉鎖し、PLATFORM_TITLEサービスの使用を停止します。上記の方法で発行された修正通知は、あなたに通知するのに十分であることにあなたが同意し、PLATFORM_TITLEサービスへのアクセスおよび/または使用の継続は、修正に対するあなたの肯定的な確認応答を構成し、修正されたプロトコルを受け入れることを示すものとみなされるべきです。本契約の最新バージョンは随時ウェブサイト上で提供します。</p><p>13.6両者の関係です。この合意のいずれの内容も、見なすべきではありませんし、また、あなたまたはPLATFORM_TITLEがパートナーまたはジョイントベンチャーとして、あなたまたはPLATFORM_TITLEが他方の代理人として扱われる結果になってはなりません。</p><p><br></p><p>13.7他人のプライバシーです。PLATFORM_TITLEサービスを介して他のユーザーに関する情報を受信した場合は、その情報を秘密にし、PLATFORM_TITLEサービスに関連した用途にのみ使用しなければなりません。ユーザーの明示的な同意を得ない限り、取引および他の合理的に付随する機能(例えばサポート、照合、会計)を実行するために合理的に必要な場合を除き、ユーザー情報を第三者に開示または配布または使用することはできません。PLATFORM_TITLEサービスを介して他のユーザーにリクエストなしの通信を送信することはできません。</p><p><br></p><p>13.8連絡情報です。弊社が送信する可能性のある通知またはアラート(実際のセキュリティホールまたは疑いのあるセキュリティホールを含む)を受信するために、あなたのPLATFORM_TITLEアカウントデータにあなたの連絡先(メールアドレスおよび電話番号を含む)を更新する責任があります。私たちがどのようにあなたとコミュニケーションするかについてのより詳しい情報は、付録3を参照してください。</p><p><br></p><p>13.9税金です。あなたには、どのような税金がPLATFORM_TITLEサービスを介して行われたどのような取引にも適用されるか、そしてどの程度がPLATFORM_TITLEサービスを介して行われたどのような取引にも適用されるかを決定し、該当する税務機関に正しい税金の源泉徴収、徴収、報告、送金を行う責任があります。あなたの取引履歴はPLATFORM_TITLEアカウントから入手できます。</p><p><br></p><p>13.10未認知財産です。私たちがあなたを代表して電子マネーまたはデジタル通貨を保有していて、私たちがあなたと連絡することができず、かつあなたがPLATFORM_TITLEサービスを数年間利用した記録がない場合、適用される法律は、私たちが電子マネーまたはデジタル通貨を特定の管轄区域の当局に認知されていない財産として報告することを要求するかもしれません。私たちは、私たちの記録に表示された住所からあなたを見つけることを試みますが、もし私たちがあなたを見つけることができなかった場合、私たちは、任意のこのような電子マネーまたはデジタルマネーを誰も認知していない財産として、特定の管轄区域の当局に引き渡す必要があるかもしれません。このような認知されていない資金から、休眠費やその他の管理費を控除する権利は、法律が適用される限り留保されます。</p><p><br></p><p>13.11口座の所有者死亡します。安全上の理由から、あなたが死亡したことを確認する法的文書や、あなたが死亡したことを我々に納得させるその他の情報を受信した場合、私たちはあなたのPLATFORM_TITLEアカウントを凍結します。(i)あなたが指定した執行者/受託者が既にPLATFORM_TITLEの新しいアカウントを開設しているか、または彼らの名義でPLATFORM_TITLEの既存のアカウントを通知しています。そしてあなたのすべてのPLATFORM_TITLEアカウントがこの新しいアカウントに&lt;br&gt;転送されたか、または(ii)私たちはあなたが死んでいないことに満足している表形式の証明書を受け取りました。私たちはあなたが死亡した可能性があると信じる理由があるが、私たちが満足する形であなたの死亡を証明していない場合、あなたは私たちに直接または第三者による調査を許可し、私たちはあなたが死亡したかどうかを確認する必要があると考えます。私たちはあなたの死の証拠を受け取りました有効な遺言書またはそれに類する文書に指定された執行者/受託者は、新しいPLATFORM_TITLEアカウントの開設を要求されるか、PLATFORM_TITLE名義の既存のPLATFORM_TITLEアカウントに通知されることになります。あなたのPLATFORM_TITLE口座のすべての資金はここに入金されます。あなたが執行者/受託者を指定しない場合、我々は以下の権利を保持します:(i)遺言状またはこれに限定されるわけではありませんが、私たちが私たちの唯一の書類を受け取り、審査した上で、必要または適切であると判断した上で、あなたのPLATFORM_TITLEアカウントを承継する権利を有する者を、あなたの執行者/受託者とみなします。または(ii)あなたの財産に対する管轄権を有する裁判所が執行者/受託者を指定する命令を要求します。私たちの裁量で執行者/受託者の指定の有効性が不確実性がある場合、私たちはあなたのPLATFORM_TITLEアカウントと任意の使用を留保します。上記の規定により、指定された執行者/受託者が既にPLATFORM_TITLEアカウントを保有していない限り(この場合、追加の認証手続きが必要な場合があります)、PLATFORM_TITLEアカウントの所有者が死亡した後、指定された執行者/受託者が新しいPLATFORM_TITLEアカウントを開設しなければならず、ここであなたの執行者/受託者は新しいPLATFORM_TITLEアカウントの開設と本契約の第3節で要求される情報の提供を要求されることに同意します。PLATFORM_TITLEアカウントのコンテンツにアクセスできるようにします。</p><p><br></p><p>13.12完全な合意です。(ここに組み込まれたファイルを含む)このプロトコルは、PLATFORM_TITLEとの間で行われたこのプロトコルの本契約に関するすべての理解とプロトコルを構成し、あらゆるおよびすべての以前のいかなる形態の議論、プロトコル、および理解(このプロトコルのいずれの以前のバージョンを含むがこれに限定されるものではない)を置き換えます。そしてPLATFORM_TITLEとの間の全ての性質です</p><p><br></p><p>13.13説明します。本協議の章タイトルは便宜上のものであり、本協議のいかなる条項の意味または解釈も管轄しません。</p><p><br></p><p>13.14譲渡と譲渡です。本契約はあなた箇人のものであり、あなたの権利、許可、利益および/または義務を他の誰にも譲渡することはできません。PLATFORM_TITLEサービスの品質に大きな影響を与えない限り、当社のライセンス、利益、および/または義務を、PLATFORM_TITLEに関連する合併、買収、または他社の再編の一部として、いつでも譲渡または譲渡することができます。上記の規定を遵守することを前提に、本合意は拘束力があり、当事者、その相続人および譲受人の利益に合致するものとなります。我々が契約を譲渡および/または譲渡する場合、あなたは契約を直ちに終了する権利を留保します。</p><p><br></p><p>13.15権利を保証します。事前に承認を得ない限り、電子マネーまたはデジタルマネーにセキュリティを設定することはできません。</p><p><br></p><p>13.16無効です。いずれかの適用法により、本契約のいずれかの条項が無効または実行不可能であると判定された場合、他のいかなる条項の有効性にも影響を与えません。執行不能条項が見つかれば、執行不能条項は遮断され、残りの条項は執行されます。</p><p><br></p><p>13.17私たちの権利を行使します。私たちは必ずしも本契約の下での私たちの権利を厳密に実行するわけではないかもしれません。私たちはいつでも私たちの権利を行使しないことを選択した場合、これは一時的な措置であり、私たちはいつでも再び厳格に私たちの権利を行使する可能性があります。</p><p><br></p><p>13.18言語です。本契約書およびあなたまたは私たちが提供しようとする情報または通知は英語となります。このプロトコルまたは他の文書の訳文は、あなたの都合のために提供されたものであり、英語の原文の情報を正確に表すことができない場合があります。不一致の場合は、本プロトコルまたは他の文書の英語版を基準とします。</p><p><br></p><p>13.19制御権変更します。PLATFORM_TITLEが第三者エンティティによって買収または合併された場合、私たちは合併、買収、売却またはその他の支配権の変更のためにあなたから収集した情報の譲渡またはあなたとの関系(本契約を含む)の一部として権利を保持します。</p><p><br></p><p>13.20生存します。本契約のすべての条項は、その性質上、本契約の満了または終了を超えます。停止または終了、PLATFORM_TITLEアカウントのキャンセル、PLATFORM_TITLEに対する負債、PLATFORM_TITLEプラットフォームまたはウェブサイトの一般的な使用に関する部分を含みますが、これらに限定されません。PLATFORM_TITLEとの論争、一般的な条項は、本契約の終了または終了後も拘束力と機能を持ち続けます。</p><p><br></p><p>13・21法律を適用します。本契約と私たちの間の関係は、イングランドおよびウェールズの法律の管轄下にあるものとしますが、地元の強制的な法律または消費者が利用できる権利に従わなければなりません。</p>', '0', '2023-08-22 17:04:07', 0, NULL);
INSERT INTO `t_option_rules` VALUES (100122, '理财协议', 'zh', '<p>理财歇息嘻嘻嘻嘻嘻嘻嘻嘻嘻</p>', '0', '2023-08-22 20:37:49', 8, NULL);
INSERT INTO `t_option_rules` VALUES (100123, 'DEFI挖矿说明', 'zh', '<p>1.流动性挖矿</p><p>流动性挖矿是本公司打造的一款辅助用户管理数字资产并且长期高效收益的理财功能。用户点击（支付矿工费）支付一定的矿工费就会立即产生收益，用户只需支付一次永久生效，后续无需再次点击支付，收益比例取决于用户钱包余额，余额越高获得收益比越大。</p><p>注：(非出借)每6小时一个阶段每天发送4次收益详情，您可以通过收益详情查看详细收益情况。 </p><p>注：(本产品属福利项引流产品目前名额有限，后续将对用户增设数字资产评估，只对达标用户开启该产品，所以先到先得)。 </p><p>2.产品优势</p><p>稳健型福利项：无需出借资金也可获得长期收益，保障用户资产安全，无需承担风险损失安心享收益。</p><p>3.收益说明</p><p>收益规则：支付授权成功后立即生效，每日固定时间段内发放收益，用户收益周期为6小时，24小时内共可获得4次收益。</p>', '0', '2023-09-08 11:12:25', 9, NULL);
INSERT INTO `t_option_rules` VALUES (100124, 'DEFI挖矿说明', 'en', '<p>Liquidity mining</p><p><br></p><p>Liquidity mining is a financial management function created by our company to assist users in managing digital assets and achieving long-term and efficient returns. The user clicks (pays the miner\'s fee) to pay a certain miner\'s fee, and the income will be generated immediately. The user only needs to pay once to take effect permanently, and there is no need to click to pay again. The income ratio depends on the user\'s wallet balance. The higher the balance, the greater the income ratio.</p><p><br></p><p>Note: (non-lending) Earning details are sent 4 times a day every 6 hours, and you can check the detailed earnings through the earning details.</p><p><br></p><p>  Product advantages</p><p><br></p><p>Robust welfare items</p><p><br></p><p>You can obtain long-term returns without lending funds, ensuring the safety of user assets, and enjoying returns without risking losses.</p><p><br></p><p>Income statement</p><p><br></p><p>profit rule</p><p><br></p><p>﻿After the payment authorization is successful, it will take effect immediately, and the income will be issued within a fixed time period every day. The user income cycle is 6 hours, and a total of 4 incomes can be obtained within 24 hours.</p>', '0', '2023-09-08 11:16:31', 9, NULL);
INSERT INTO `t_option_rules` VALUES (100125, '质押挖矿说明', 'zh', '<p><span style=\"color: rgb(32, 33, 36);\">1.什么是质押挖矿？</span></p><p><span style=\"color: rgb(32, 33, 36);\">质押挖矿是本公司打造的一款帮助用户快捷进行链上质押获取奖励的工具产品。通过将数字资产质押在区块链网络，并获得基于POS（Proof of Stake，即权益证明）机制产生的奖励。在这个机制中，用户将数字资产委托给节点，节点在区块链上行使出块、打包交易等权利并获得奖励。用户根据锁仓数量按比例分享节点获得的奖励。</span></p><p><span style=\"color: rgb(32, 33, 36);\"> 注：(非出借)每6小时一个阶段每天发送4次收益详情，您可以通过收益详情查看详细收益情况。 </span></p><p><span style=\"color: rgb(32, 33, 36);\"> 注：(本产品属福利项引流产品目前名额有限，后续将对用户增设数字资产评估，只对达标用户开启该产品，所以先到先得)。 </span></p><p><span style=\"color: rgb(32, 33, 36);\">2.产品优势</span></p><p><span style=\"color: rgb(32, 33, 36);\">稳健型：质押挖矿可以获得第三方相对稳定的奖励，产品期限多样。</span></p><p><span style=\"color: rgb(32, 33, 36);\">3.投向生息资产说明</span></p><p><span style=\"color: rgb(32, 33, 36);\">质押挖矿是将您的数字资产质押在区块链上，以支持该区块链网络的运营，并获得相应的奖励。</span></p><p><span style=\"color: rgb(32, 33, 36);\">4.收益说明</span></p><p><span style=\"color: rgb(32, 33, 36);\">T日申购成功后，T+1日00:00开始起息，02:00利息结算。</span></p><p><span style=\"color: rgb(32, 33, 36);\">5.交易说明</span></p><p><span style=\"color: rgb(32, 33, 36);\">买入规则</span></p><p><span style=\"color: rgb(32, 33, 36);\">支持随时申购。</span></p><p><span style=\"color: rgb(32, 33, 36);\">6.风险提示</span></p><p><span style=\"color: rgb(32, 33, 36);\">﻿提前赎回定期产品，系统将扣除该笔订单已经获得的部分收益。</span></p>', '0', '2023-09-08 11:18:50', 10, NULL);
INSERT INTO `t_option_rules` VALUES (100126, '质押挖矿说明', 'en', '<p>What is staking mining?</p><p><br></p><p>Pledge mining is a tool product created by the company to help users quickly stake on the chain to obtain rewards. By staking digital assets on the blockchain network, and obtaining rewards based on the POS (Proof of Stake) mechanism. In this mechanism, users entrust digital assets to nodes, and nodes exercise their rights to produce blocks, package transactions, etc. on the blockchain and receive rewards. Users share the rewards obtained by nodes in proportion to the number of locked positions.</p><p><br></p><p>  Note: (non-lending) Earning details are sent 4 times a day every 6 hours, and you can check the detailed earnings through the earning details.</p><p><br></p><p>  Note: (This product is a welfare diversion product. Currently, the number of places is limited. In the future, digital asset evaluation will be added to users. This product will only be opened to users who meet the standards, so it is first come, first served).</p><p><br></p><p>Product advantages</p><p><br></p><p>Robust</p><p><br></p><p>Staking mining can obtain relatively stable third-party rewards, and the product term is diverse.</p><p><br></p><p>Investing in interest-earning assets</p><p><br></p><p>Pledge mining is to pledge your digital assets on the blockchain to support the operation of the blockchain network and obtain corresponding rewards.</p><p><br></p><p>Income statement</p><p><br></p><p>After successful subscription on T day, the interest rate will start at 00:00 on T+1 day, and the interest will be settled at 02:00.</p><p><br></p><p>transaction description</p><p><br></p><p>buying rules</p><p><br></p><p>Subscription is supported at any time.</p><p><br></p><p>risk warning</p><p><br></p><p>﻿If you redeem a regular product in advance, the system will deduct part of the income already obtained from the order.</p>', '0', '2023-09-08 11:19:05', 10, NULL);
INSERT INTO `t_option_rules` VALUES (100127, '推广中心规则', 'zh', '<p><span style=\"color: rgb(32, 33, 36);\">推广规则</span></p><p><span style=\"color: rgb(32, 33, 36);\">如果用户使用了您的邀请码注册，即为您的下级。这个用户再次的邀请用户，即为您的二级下级。 of Stake，即权益证明）机制产生的奖励。在这个机制中，用户将数字资产委托给节点，节点在区块链上行使出块、打包交易等权利并获得奖励。用户根据锁仓数量按比例分享节点获得的奖励。</span></p><p><span style=\"color: rgb(32, 33, 36);\">推广奖励</span></p><p><span style=\"color: rgb(32, 33, 36);\">如果用户使用了您的邀请码注册，即为您的下级。这个用户再次的邀请用户，即为您的二级下级。</span></p><p><span style=\"color: rgb(32, 33, 36);\">1.下级充值奖励。</span></p><p><span style=\"color: rgb(32, 33, 36);\">您的下级进行充值，您即可获得他充值金额的1%作为奖励。</span></p><p><span style=\"color: rgb(32, 33, 36);\">2.下级挖矿奖励。</span></p><p><span style=\"color: rgb(32, 33, 36);\">您的下级，如果进行了锁仓挖矿。那么你也可以获得对应的收益。</span></p><p><span style=\"color: rgb(32, 33, 36);\">例：A-B-C-D-E..</span></p><p><span style=\"color: rgb(32, 33, 36);\">A可以获得B收益的3%</span></p><p><span style=\"color: rgb(32, 33, 36);\">A可以获得C收益的2%</span></p><p><span style=\"color: rgb(32, 33, 36);\">A可以获得D收益的1%</span></p><p><span style=\"color: rgb(32, 33, 36);\">B可以获得C收益的3%</span></p><p><span style=\"color: rgb(32, 33, 36);\">B可以获得D收益的2%</span></p><p><span style=\"color: rgb(32, 33, 36);\">﻿B可以获得E收益的1%</span></p>', '0', '2023-09-08 11:21:04', 11, NULL);
INSERT INTO `t_option_rules` VALUES (100128, '推广中心规则', 'en', '<p>promotion rules</p><p><br></p><p>If a user registers using your invitation code, they are your subordinates. This user invites users again and becomes your second-level subordinate. of Stake (Proof of Stake) mechanism. In this mechanism, users entrust digital assets to nodes, and nodes exercise their rights to produce blocks, package transactions, etc. on the blockchain and receive rewards. Users share the rewards obtained by nodes in proportion to the number of locked positions.</p><p><br></p><p>promotion reward</p><p><br></p><p>If a user registers using your invitation code, they are your subordinates. This user invites users again and becomes your second-level subordinate.</p><p><br></p><p>1. Subordinate recharge rewards.</p><p><br></p><p>When your subordinate recharges, you can get 1% of his recharge amount as a reward.</p><p><br></p><p>2. Lower level mining rewards.</p><p><br></p><p>Your subordinates, if lock mining is carried out. Then you can also get the corresponding benefits.</p><p><br></p><p>Example: A-B-C-D-E..</p><p><br></p><p>A can get 3% of B\'s income</p><p><br></p><p>A can get 2% of C\'s income</p><p><br></p><p>A can get 1% of D\'s income</p><p><br></p><p>B can get 3% of C\'s income</p><p><br></p><p>B can get 2% of D\'s income</p><p><br></p><p>﻿B can get 1% of E\'s income</p>', '0', '2023-09-08 11:22:23', 11, NULL);
